insert  into `wp_options`(`option_id`,`option_name`,`option_value`,`autoload`) values ('676','_transient_wpuf_addons','[{\"title\":\"BuddyPress Profile Integration\",\"desc\":\"Want to use BuddyPress profile fields in frontend registration form? It is really simple and easy to use. Just assign the fields while making the registration form.\",\"thumbnail\":\"https:\\/\\/wedevs-com-wedevs.netdna-ssl.com\\/wp-content\\/uploads\\/2013\\/08\\/BuddyPress-Profile-Integration.jpg\",\"class\":\"WPUF_BP_Profile\",\"url\":\"https:\\/\\/wedevs.com\\/products\\/wp-user-frontend-pro\\/buddypress-profile-integration\\/\"},{\"title\":\"Paid Memberships Pro\",\"desc\":\"Want to use Paid Memberships Pro with frontend posting feature? Here is the add-on you can use with WP User Frontend Pro. It is easy to configure and use.\",\"thumbnail\":\"https:\\/\\/wedevs-com-wedevs.netdna-ssl.com\\/wp-content\\/uploads\\/2013\\/08\\/Paid-Memberships-Pro.jpg\",\"class\":\"WPUF_Pm_Pro\",\"url\":\"https:\\/\\/wedevs.com\\/products\\/wp-user-frontend-pro\\/paid-memberships-pro\\/\"},{\"title\":\"Comments Manager\",\"desc\":\"Want to let the authors manage comments on their own post? Now you can! Just install this add-on along with WP User Frontend Pro- The famous frontend plugin.\",\"thumbnail\":\"https:\\/\\/wedevs-com-wedevs.netdna-ssl.com\\/wp-content\\/uploads\\/2013\\/11\\/Frontend-Comment-Manager.jpg\",\"class\":\"WPUF_Comments\",\"url\":\"https:\\/\\/wedevs.com\\/products\\/wp-user-frontend-pro\\/comments-manager\\/\"},{\"title\":\"User Listing & Profile\",\"desc\":\"Want to built a user directory plugin with custom profile and searching feature? It has all these features along with limiting visibility of profile data.\",\"thumbnail\":\"https:\\/\\/wedevs-com-wedevs.netdna-ssl.com\\/wp-content\\/uploads\\/2014\\/05\\/User-Listing-Profile.jpg\",\"class\":\"WPUF_User_Listing\",\"url\":\"https:\\/\\/wedevs.com\\/products\\/wp-user-frontend-pro\\/user-listing-profile\\/\"},{\"title\":\"User Analytics\",\"desc\":\"This add-on for WP User Frontend collects user IP address, country, timezone, browser and operating system information when the user submit a new post.\",\"thumbnail\":\"https:\\/\\/wedevs-com-wedevs.netdna-ssl.com\\/wp-content\\/uploads\\/2014\\/08\\/User-Analytics.jpg\",\"class\":\"WPUF_User_Analytics\",\"url\":\"https:\\/\\/wedevs.com\\/products\\/wp-user-frontend-pro\\/user-analytics\\/\"},{\"title\":\"Mailchimp Add-On\",\"desc\":\"If you are looking for a solution to add users to mailchimp upon registration, then this is the must have plugin. It is simple, easy, minimal configuration.\",\"thumbnail\":\"https:\\/\\/wedevs-com-wedevs.netdna-ssl.com\\/wp-content\\/uploads\\/2014\\/05\\/Mailchimp.jpg\",\"class\":\"WPUF_Mailchimp\",\"url\":\"https:\\/\\/wedevs.com\\/products\\/wp-user-frontend-pro\\/mailchimp\\/\"},{\"title\":\"Mailpoet Add-On\",\"desc\":\"Looking for a solution to add newly registered users to MailPoet subscribers? This add-on is your key to the power! It works with MailPoet (Wysija) plugin.\",\"thumbnail\":\"https:\\/\\/wedevs-com-wedevs.netdna-ssl.com\\/wp-content\\/uploads\\/2014\\/05\\/MailPoet.jpg\",\"class\":\"WPUF_Mailpoet\",\"url\":\"https:\\/\\/wedevs.com\\/products\\/wp-user-frontend-pro\\/mailpoet\\/\"}]','no');
