s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"http://heropress.com/essays/on-the-other-side/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:15937:\"<img width=\"960\" height=\"480\" src=\"http://heropress.com/wp-content/uploads/2016/08/083016-Ed-Kratz-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: The failure of a lot of outsource projects, companies, and freelancers is the lack of clear expectations in the beginning.\" /><p>My first experience with WordPress came in 2005. I was taking an online theology program and became friends with the director of the course, C. Michael Patton. The course was provided by a popular Christian website, but over time it became necessary to move it to its’ own site because of limitations in the current sites platform. I don’t know what it was at the time, I believe it may have been custom built.</p>\n<p>Michael, along with me and several other students of the course searched for the best platforms to build the new site on we played with all the popular ones at the time. We looked at Joomla (Mambo at the time), Drupal, and WordPress. We also chose Moodle for the classroom piece and WordPress for the main site. We built the site and it went over well, the theology program was getting popular and the live chats that we did on Pal Talk were getting a lot of attention. The chat rooms were constantly getting attacked by malicious users who pop in and disrupt the classes, but we also wanted the rooms to stay public as there was a pretty significant Christian presence on there and we were getting many new students.</p>\n<p>Michael decided that the best thing to do was to build our own chat platform add all the features that would make teaching and conferencing more efficient. Michael found someone to finance the new system, and I quit my job to work on this full time.</p>\n<h3>Trying Outsourcing</h3>\n<p>That lead to my first experience with outsourcing work, this was a big project and would require a large team. We ended up hiring an outsourcing company from Noida, India. We got to work building the ultimate conferencing platform.</p>\n<p>There were a lot of challenges with the application, many were technical as we had purchased a voice conferencing SDK that could do peer to peer audio and text chat, but it was buggy and would drop users on a regular basis. As many technical issues as we had, we had more with the outsourcing company.</p>\n<p>They were very friendly and polite, but there were cultural differences that I didn’t understand at the time, and these became a huge obstacle to ever completing the project. My past experience working for a high end financial consulting company that dealt with super wealthy investors, taught me that quality and deadlines were all that mattered, and if I gave a deadline for something or was given one it had to be met no matter what.</p>\n<p>Things didn’t quite work that way in outsourcing, deadlines were treated as guidelines, and things that seemed like common sense such as how a confirmation box would work became additional features.</p>\n<blockquote><p>Basically, things that I took for granted but didn’t provide documentation for were never thought about, no one ever asked about how things like that would work, and the level of frustration built.</p></blockquote>\n<p>After two trips to India to try to get things back on track we finally pulled the project and moved it to the US.</p>\n<p>During this same period, it was blatantly obvious that the SDK we were building this on was never going to work as advertised and we would need to write one from scratch. I had an acquaintance from the theology program, a professor at a college in San Francisco who had a small development company there.</p>\n<p>Their main developer was a self-proclaimed genius and had done a lot of work in audio compression and had written code for Gibson mixers as well as some networking protocol work so it seemed a perfect fit.</p>\n<p>We signed the contract and off we went, or so we thought. After 6 weeks of discussions, emails, and arguing back and forth, the company wanted a percentage of our business to build the conferencing piece. They were claiming that their developer was going to use his custom algorithm to provide the service, but that was not part of the contract so they would need to own a portion of the company.</p>\n<p>My guess is that they planned on that from the beginning, but nevertheless, after over $10,000 and a lot of lost time all we received was some documents with the theory behind this magic algorithm and copies of a bunch of downloaded open source communication frameworks.</p>\n<p>I can go on about this project, but the main thing is that it ultimately ended in failure, and it still haunts me that we never got this to market.</p>\n<p>As difficult and painful as this failure was, I did learn a lot from it, I know that’s cliché but it really is true, and what I learned is the point of this post.</p>\n<h3>WordPress in El Salvador</h3>\n<p>In 2010 I moved to El Salvador for reasons that are beyond this post and would require way too much of your time. I got married here, and my wife and I started a coffee export business. We did pretty well with that until 2012 when the rust leaf virus hit the country and really hurt the quality and quantity of coffee available for export.</p>\n<p>I needed to find a way for us to make a living, and I started scouring the internet for jobs that I could do from here. I found a listing on Craig’s List, and landed a job as a project manager for an outsource company based in the US.</p>\n<p>Most of the work was in WordPress which I had continued to dabble in by doing sites for friends, and our coffee business, so I was pretty comfortable with the platform. The part that was the challenge of the job was that I was again working with developers’ half way around the world, that didn’t understand the American culture or clients’ perspectives.</p>\n<p>My experience with WordPress helped quite a bit because I could jump in and fix things, and finish projects that were incomplete. I built a good reputation with clients many of whom where marketing companies that needed sites built to promote their clients’ businesses.</p>\n<p>The owner of the company is a bit of an entrepreneur and in 2013 he decided to build a new business setting appointments for real estate agents in the US. I got the job of building a custom portal for his new venture using a couple of the developers that I had been working with over the last year and a half.</p>\n<p>This was a fairly large project as it was tied to several APIs and was on an unrealistic deadline, but we managed to get it done and the business was rolling. Ultimately this didn’t work because it required telemarketers that were working on commission so they were doing anything to get appointments including booking them when they shouldn’t. The real estate agents were mad, the owner of the company was refunding money constantly, and that was the end of it, and the outsourcing company.</p>\n<p>I started doing work on my own using the two developers that I had worked with that were very good, and things were going well, but I still had to deal with the time and cultural differences. Waking up to see what progress was made on a project only to hear from the dev that he couldn’t do anything because he had some questions, even though we discussed projects and had the details in our online management system.</p>\n<h3>Building Locally</h3>\n<p>In 2014 I decided it was time to hire local developers, I was getting busy and I couldn’t afford to miss deadlines and I needed more control over my projects. Besides, my goal was always to earn a living here, while treating the local people fairly and not taking advantage of them. I wanted to provide opportunities not just make money.</p>\n<p>My wife formed the legal company as I cannot own a company here yet, I’ve still got to finish the legalization process.</p>\n<p>I hired our first two full time developers in the fall of 2014, one front end for themes and templates, and one back end for plugins and API work. While we had plenty of work we didn’t exactly hit the ground running.</p>\n<p>There was still a cultural adjustment period, and neither were really that familiar with WordPress. This meant a lot of long hours for me as they were learning the ins and out of WordPress, and even more importantly, the importance of detail and meeting deadlines.</p>\n<p>The work culture here is a lot like that in most of the world, much more laid back then that in the US, so I had to teach my team to understand what mattered and what didn’t to our clients. I had to use the lessons that I learned from my failures in working with outsourcing companies and individuals in the past and use that to build a working environment that is productive for the company but also a place that my workers are happy to come to every day.</p>\n<p>There were a lot of challenges that we had to overcome aside from just the cultural differences and approaches. The employment laws here were a surprise that I learned on what appeared to be a little later than a need to know basis.</p>\n<p>All employees get 15 days’ paid vacation from year one, and they get 15% of their monthly salary in addition to their regular pay for that time. They also get an annual bonus that is 50% of their monthly salary. And then there is indemnizacion which is basically unemployment, except here the company pays one month’s salary for every year an employee works, you have the option of paying this annually, or all at once if you fire an employee.</p>\n<p>These were things I learned after agreeing to pay my developers their asking salaries.</p>\n<blockquote><p>If you’re going to start an outsourcing company in a foreign country, learn their laws first!</p></blockquote>\n<p>Other issues that I learned from my first outsourced project is that other countries have their own holiday schedules. I had Hindus on projects that had some holidays, Muslims that had other holidays, and clients that didn’t care about either. The same thing here, El Salvador’s’ Independence Day is not July 4<sup>th</sup>, their Labor Day is not the first Monday of Sept. and they have a lot of holidays based on the Catholicism.</p>\n<p>These are all issues we work around by managing our time and projects, and a lot of extra work on my part during these holidays. My team works most US holidays, but that would be the best time for them to be off, and when I would like to be off.</p>\n<p>We currently have four full-time developers and we keep everyone fairly busy, but I also care about my team and we try to manage our projects so that no one needs to work overtime, or even the half days on Saturdays that they are contracted for. So far I have only needed to have them work on Saturdays twice in the two years since we started here, but they all understand that if deadlines are in danger of not being met we will work Saturdays. That’s a little motivation that seems to be working.</p>\n\n<a href=\"http://heropress.com/essays/on-the-other-side/chicho2/\"><img width=\"150\" height=\"150\" src=\"http://heropress.com/wp-content/uploads/2016/08/chicho2-150x150.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"Chicho\" /></a>\n<a href=\"http://heropress.com/essays/on-the-other-side/mayra-flor-luis/\"><img width=\"150\" height=\"150\" src=\"http://heropress.com/wp-content/uploads/2016/08/mayra-flor-luis-150x150.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"Mayra, Flor, and Luis\" /></a>\n\n<p>I also realize that I am not going to get a lot of production out of a new developer for a couple months. Most people here don’t know WordPress very well, or the other platforms that we work on, so we train them, give them small things to do and time to learn. They need to learn not only how to do the actual programming, but how to embrace WordPress as an application development platform or framework. In the beginning they all want to work on their favorite MVC framework for everything, but when they really learn the power and clarity of the platform they get hooked and productions shoots up.</p>\n<blockquote><p>I never wait until I have too much work to hire someone new because I know the beginning will be slow.</p></blockquote>\n<p>If I need to scale in a hurry, I still have relationships with my oversees guys and I’ll give them a project to keep moving.</p>\n<h3>Outsourcing On The Other Side</h3>\n<p>There is a lot to running an outsourcing company from a foreign country, and I have a big advantage having spent most of my life working in the Northeastern US and understanding what clients expect. One of the main things I do is to manage those expectations to create realistic requirements, and realistic deadlines. We meet those deadlines or we work extra, though we have hardly ever needed to do that.</p>\n<blockquote><p>I believe the failure of a lot of outsource projects, companies, and freelancers is the lack of clear expectations in the beginning.</p></blockquote>\n<p>Much like most of the world, the people here put a lot of importance on being agreeable and polite when discussing projects or really anything. That sounds good on the surface but it leads to unmet goals and cranky clients. If you’re working with US clients it’s far better to be honest about deadlines, skillsets, etc. than to just say yes to everything and have it fall apart.</p>\n<p>My team has learned that it’s better to tell me the reality than just what I want to hear, if they’re struggling with something they come to me and I guide them, sometimes to one of the other developers, sometimes I do it myself, but the key is that they are comfortable in knowing that none of us knows everything. Salvadorans are very proud people so this is a huge accomplishment.</p>\n<p>I know this is a long post and maybe I ramble a bit, but if you’re living in a foreign country and running or considering running an outsource business I hope that some of my experiences will provide a little guidance to help you along. Having been on both sides of the outsourcing world has really helped me to understand what clients want, and how to help my team deliver it.</p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: On the other side\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=On%20the%20other%20side&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Fon-the-other-side%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: On the other side\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Fon-the-other-side%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Fon-the-other-side%2F&title=On+the+other+side\" rel=\"nofollow\" target=\"_blank\" title=\"Share: On the other side\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/on-the-other-side/&media=http://heropress.com/wp-content/uploads/2016/08/083016-Ed-Kratz-150x150.jpg&description=On the other side\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: On the other side\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/on-the-other-side/\" title=\"On the other side\"></a></div><p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/on-the-other-side/\">On the other side</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 31 Aug 2016 12:00:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Ed Kratz\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"Post Status: Mobile apps that work with WordPress — Draft Podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=26286\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://poststatus.com/mobile-apps-work-wordpress-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3185:\"<p>Welcome to the Post Status <a href=\"https://poststatus.com/category/draft\">Draft podcast</a>, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>, <a href=\"https://play.google.com/music/m/Ih5egfxskgcec4qadr3f4zfpzzm?t=Post_Status__Draft_WordPress_Podcast\">Google Play</a>, <a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>, and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Post Status Draft is hosted by Joe Hoyle &#8212; the CTO of Human Made &#8212; and Brian Krogsgard.</p>\n<p><span>In this episode, Joe and Brian talk about various third party publishing apps available and how they work with WordPress. They dig into apps that currently exist, how the connect to WordPress, how the future of WordPress could improve the third party ecosystem, and many of the challenges that must be tackled when interacting with WordPress as a third party application.</span></p>\n<p><!--[if lt IE 9]><script>document.createElement(\'audio\');</script><![endif]-->\n<a href=\"https://audio.simplecast.com/45625.mp3\">https://audio.simplecast.com/45625.mp3</a><br />\n<a href=\"http://audio.simplecast.com/45625.mp3\">Direct Download</a></p>\n<h3>Apps we discussed</h3>\n<ul>\n<li><a href=\"https://apps.wordpress.com/mobile/\">WordPress mobile apps</a></li>\n<li><a href=\"http://www.ulyssesapp.com/\">Ulysses</a></li>\n<li><a href=\"http://desk.pm/\">Desk</a></li>\n<li><a href=\"https://bywordapp.com/\">Byword</a></li>\n<li><a href=\"https://www.red-sweater.com/marsedit/\">MarsEdit</a></li>\n<li><a href=\"https://wordpress.com/windows-live-writer/\">Windows Live Writer</a></li>\n<li><a href=\"https://zapier.com/zapbook/evernote/wordpress/\">Evernote to WordPress Zapier</a></li>\n<li><a href=\"https://medium.com/ia-writer-tips-and-tricks/ia-writer-to-wordpress-511a8aa73643#.c5d531y0p\">iA Writer</a></li>\n<li><a href=\"https://zapier.com/zapbook/onenote/wordpress/\">OneNote to WordPress Zapier</a></li>\n</ul>\n<h3>Editor interfaces</h3>\n<ul>\n<li><a href=\"https://www.tinymce.com/\">TinyMCE</a> (web editor)</li>\n<li><a href=\"http://quilljs.com/\">QuillJS</a> (web editor)</li>\n<li><a href=\"https://facebook.github.io/draft-js/\">DraftJS</a> (web editor)</li>\n<li><a href=\"https://github.com/wordpress-mobile/WordPress-Editor-iOS\">WordPress iOS editor</a> (native editor)</li>\n</ul>\n<h3>Other links</h3>\n<ul>\n<li><a href=\"http://wp-api.org/\">WordPress REST API</a></li>\n<li><a href=\"https://github.com/joehoyle/vienna\">Vienna</a></li>\n</ul>\n<h3>Sponsor: Delicious Brains</h3>\n<p>Today’s show is sponsored by <a href=\"https://deliciousbrains.com/\">Delicious Brains</a>. <a href=\"https://deliciousbrains.com/wp-migrate-db-pro/\">WP Migrate DB Pro </a>makes moving and copying databases simple. They are also working on an exciting new project right now for merging databases, called Mergebot. Go to <a href=\"https://mergebot.com/\">Mergebot.com</a> for updates on that, and <a href=\"https://deliciousbrains.com/\">deliciousbrains.com</a> for more information on WPMigrate DB Pro, and thanks to the team at Delicious Brains for being a Post Status partner.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 30 Aug 2016 18:50:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Katie Richards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"WP Mobile Apps: WordPress for iOS: Version 6.4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://apps.wordpress.com/?p=3568\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://apps.wordpress.com/2016/08/26/wordpress-for-ios-version-6-4/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4716:\"<p>Hi there, WordPress users! <a href=\"https://itunes.apple.com/us/app/wordpress/id335703880?mt=8&uo=6&at=&ct=\">Version 6.4 of the WordPress for iOS app</a> is now available in the App Store.</p>\n<h1>What&#8217;s New:</h1>\n<p><strong>iPad Keyboard Shortcuts.</strong> Press down the command key on your external keyboard to see a list of available shortcuts in the main screen and in the post editor.</p>\n\n<a href=\"https://apps.wordpress.com/img_0007/\"><img width=\"300\" height=\"225\" src=\"https://apps.files.wordpress.com/2016/08/img_0007.png?w=300&h=225\" class=\"attachment-medium size-medium\" alt=\"Hold down the command key, and see the available shortcuts.\" /></a>\n<a href=\"https://apps.wordpress.com/img_0006/\"><img width=\"300\" height=\"225\" src=\"https://apps.files.wordpress.com/2016/08/img_0006.png?w=300&h=225\" class=\"attachment-medium size-medium\" alt=\"There are many shortcuts you can use in the post editor, too.\" /></a>\n\n<p><strong>Share Media.</strong> Our sharing extension now supports media, too!</p>\n\n<a href=\"https://apps.wordpress.com/img_2385/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/08/img_2385.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"Select any image and tap on the WordPress icon.\" /></a>\n<a href=\"https://apps.wordpress.com/img_2386/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/08/img_2386.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"Add a message and share it to your blog!\" /></a>\n\n<p><strong>People Management.</strong> You can now manage your site&#8217;s users and roles using your mobile device.</p>\n\n<a href=\"https://apps.wordpress.com/img_2392/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/08/img_2392.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"A new people management section is available.\" /></a>\n<a href=\"https://apps.wordpress.com/img_2393/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/08/img_2393.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"See a list of your blog\'s users and their roles.\" /></a>\n<a href=\"https://apps.wordpress.com/img_2394/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/08/img_2394.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"Tap on any person to see their details.\" /></a>\n\n<p><strong>Search in the Reader.</strong> The Reader now has search capability and autocompletes suggestions.</p>\n\n<a href=\"https://apps.wordpress.com/img_2390/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/08/img_23901.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"Tap the magnification icon on the top right corner.\" /></a>\n<a href=\"https://apps.wordpress.com/img_2389/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/08/img_2389.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"Searching is easier than ever.\" /></a>\n\n<p><strong>Improved Gestures.</strong> Full screen image previews can be dismissed with a swanky flick/toss gesture.</p>\n<p><strong>Bugs Squashed.</strong> A new homemade bug spray formula has allowed us to squash <a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?q=is%3Aclosed+is%3Aissue+milestone%3A6.4+label%3A%22%5BType%5D+Bug%22\">many uninvited guests</a>.</p>\n<p><strong>And much more! </strong>You can see the full list of changes <a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?utf8=✓&q=is%3Aissue%20is%3Aclosed%20milestone%3A6.4\">here</a>.</p>\n<h1>Thank You</h1>\n<p>Thanks to all of the contributors who worked on this release:<br />\n<a href=\"https://github.com/aerych\">@aerych</a>, <a href=\"https://github.com/astralbodies\">@astralbodies</a>, <a href=\"https://github.com/claudiosmweb\">@claudiosmweb</a>, <a href=\"https://github.com/diegoreymendez\">@diegoreymendez</a>, <a href=\"https://github.com/frosty\">@frosty</a>, <a href=\"https://github.com/jleandroperez\">@jleandroperez</a>, <a href=\"https://github.com/koke\">@koke</a>, <a href=\"https://github.com/kurzee\">@kurzee</a>, <a href=\"https://github.com/kwonye\">@kwonye</a>, <a href=\"https://github.com/oguzkocer\">@oguzkocer</a>, <a href=\"https://github.com/sendhil\">@sendhil</a>, <a href=\"https://github.com/SergioEstevao\">@SergioEstevao</a>.</p>\n<p>You can track the development progress for the next update by visiting <a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?utf8=✓&q=is%3Aissue+milestone%3A6.5+\" target=\"_blank\">our 6.5 milestone on GitHub</a>. Until next time!</p><img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=apps.wordpress.com&blog=108068616&post=3568&subd=apps&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 26 Aug 2016 12:27:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"diegoreymendez\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"WP Mobile Apps: WordPress for Android: Version 5.7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://apps.wordpress.com/?p=3535\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://apps.wordpress.com/2016/08/26/wordpress-for-android-version-5-7/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2814:\"<p>Hello WordPress users! <a href=\"https://play.google.com/store/apps/details?id=org.wordpress.android\" target=\"_blank\">Version 5.7 of the WordPress for Android app</a> is now available in the Google Play Store.</p>\n<h1>New &#8220;Plans&#8221; section in My Site</h1>\n<p>Starting with 5.7, you can see your current WordPress.com plan and learn more about the benefits we offer in other plans.</p>\n<p><img class=\"aligncenter wp-image-3532\" src=\"https://apps.files.wordpress.com/2016/08/screenshot-2016-08-02_15-46-12-755.png?w=600\" alt=\"screenshot-2016-08-02_15.46.12.755\" /></p>\n<h1>Manage your followers and viewers from the &#8220;People Management&#8221; screen</h1>\n<p>You&#8217;re now able to use the app to invite new Administrators, Editors, Authors or Contributors to your site, or remove unwanted followers.</p>\n<p><img class=\"aligncenter wp-image-3533\" src=\"https://apps.files.wordpress.com/2016/08/screenshot-2016-08-02_15-51-08-242.png?w=600\" alt=\"screenshot-2016-08-02_15.51.08.242\" /></p>\n<h1 id=\"other-changes\">Other Changes</h1>\n<p>Version 5.7 also comes with a few other changes and fixes:</p>\n<ul>\n<li>Reader tweaks in the Post Detail screen for tablets.</li>\n<li>Keeps the &#8220;View Site&#8221; link visible for newly created users.</li>\n<li>Fixes a rare crash when creating a new account.</li>\n</ul>\n<p>You can track our development progress for the next release by visiting <a href=\"https://github.com/wordpress-mobile/WordPress-Android/milestones/5.8\">our 5.8 milestone on GitHub</a>.</p>\n<h1>Beta</h1>\n<p>Do you like keeping up with what’s new in the app? Do you enjoy testing new stuff before anyone else? Our testers have access to beta versions with updates shipped directly through Google Play. The beta versions may have new features, new fixes — and possibly new bugs! Testers make it possible for us to improve the overall app experience, and offer us invaluable development feedback.</p>\n<p>Want to become a tester? <a href=\"https://play.google.com/apps/testing/org.wordpress.android\">Opt-in</a>!</p>\n<h1>Thank you</h1>\n<p>Thanks to our GitHub contributors: <a href=\"https://github.com/0nko\">@0nko</a>, <a href=\"https://github.com/aforcier\">@aforcier</a>, <a href=\"https://github.com/hypest\">@hypest</a>, <a href=\"https://github.com/karambir252\">@karambir252</a>, <a href=\"https://github.com/khaykov\">@khaykov</a>, <a href=\"https://github.com/kwonye\">@kwonye</a>, <a href=\"https://github.com/maxme\">@maxme</a>, <a href=\"https://github.com/mzorz\">@mzorz</a>, <a href=\"https://github.com/nbradbury\">@nbradbury</a>, <a href=\"https://github.com/oguzkocer\">@oguzkocer</a>, and <a href=\"https://github.com/theck13\">@theck13</a>.</p><img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=apps.wordpress.com&blog=108068616&post=3535&subd=apps&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 26 Aug 2016 11:33:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Maxime\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"HeroPress: A Minority Amongst Minorities\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1241\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"http://heropress.com/essays/minority-amongst-minorities/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:25056:\"<img width=\"960\" height=\"480\" src=\"http://heropress.com/wp-content/uploads/2016/08/082416-Uriahs-Victor-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: Time passed, and I fell more and more in love with WordPress.\" /><p>I’m a minority amongst minorities, but it doesn’t matter.</p>\n<h3>Let’s get to know each other</h3>\n<p>Hi, I’m Uriahs Victor and I’m a Carib &#8211; bean from the island of St. Lucia. How many Black Developers do you know in the WordPress Community? 5? 20? How many of them are from the Caribbean? How many raised up in places like this:</p>\n\n<a href=\"http://heropress.com/essays/minority-amongst-minorities/my_childhood_home/\"><img width=\"150\" height=\"150\" src=\"http://heropress.com/wp-content/uploads/2016/08/my_childhood_home-150x150.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"Uriahs Victor\'s childhood home, a blue house with low jungle around it\" /></a>\n<a href=\"http://heropress.com/essays/minority-amongst-minorities/view_from_my_old_home/\"><img width=\"150\" height=\"150\" src=\"http://heropress.com/wp-content/uploads/2016/08/view_from_my_old_home-150x150.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"A vew from Uriahs Victor\'s childhood home, a shed and barn nestled in the jungle\" /></a>\n<a href=\"http://heropress.com/essays/minority-amongst-minorities/neighbourhood_houses/\"><img width=\"150\" height=\"150\" src=\"http://heropress.com/wp-content/uploads/2016/08/neighbourhood_houses-150x150.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"A view of Uriahs Victors childhood neighborhood,, small houses surrounded by jungle\" /></a>\n\n<p>I chose to write on this topic in hopes that there’s someone else like me reading this article someday who’s living in an area where it may seem like there aren’t many career paths.</p>\n<blockquote><p>It doesn’t matter where in the world you are or your complexion; anyone could code.</p></blockquote>\n<h3>How my passion for programming began</h3>\n<p>I was fortunately raised with both parents in a community on my island called Fond St. Jacques which is a part of a bigger town called Soufriere. I grew up doing everything a typical adolescent from my community would be doing: playing football, playing cricket and going to work on my parents farm and occasionally on other farms to earn some money to burn through by drinking with friends ( don’t think about it too hard ) and partying.</p>\n<p>One day I came home to a used computer setup in my room and was extremely ecstatic with the idea that my family now owned one. I spent hours upon hours on this computer messing around with paint but mostly playing Pinball, there was no internet in my community at the time but I was very intrigued by video games, once I got my first taste of unrestricted internet access several months after; my love for video games grew, I spent time reading about them but more time playing them and at that time I had decided that I wanted to be a Game Designer.</p>\n<p>If being a Programmer from a rural community out of the Caribbean sounds different (not impossible) looking back at it now then just imagine how it sounded saying I wanted to be a Game Designer when someone asked me. I spent years with this goal set, I spent days reading about game designing but I always felt lacking, I believed there was always 1 skill Game Designers needed that I did not have and that was being able to draw/design.</p>\n<p>In 2010 life was pretty easy going, I was 15 and still had not done any piece of Web or Desktop Development coding. My Secondary schooling was going pretty good, I was always the top performing IT student so this brought me comfort as I knew I would soon be writing the “CXC” exams soon.</p>\n<h3>Everything changes</h3>\n<p>On October 28th 2010 I woke up during the night to the sound of heavy rains, I looked through one of the windows of my home at the time and saw the trees around my house swaying pretty normal, or so I thought. The morning of October 29 I woke up to the sound of friends saying “Uriahs your mom shop is gone” in our second language (French Creole), this language naturally sounds a bit harsh when used to say various things so I thought they were pulling some kind of prank on me. What I saw after heading to the balcony where my friends were changed my life.</p>\n\n<a href=\"http://heropress.com/essays/minority-amongst-minorities/tomas2/\"><img width=\"150\" height=\"150\" src=\"http://heropress.com/wp-content/uploads/2016/08/tomas2-150x150.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"A neighborhood with muddy water halfway up the sides of the houses\" /></a>\n<a href=\"http://heropress.com/essays/minority-amongst-minorities/tomas/\"><img width=\"150\" height=\"150\" src=\"http://heropress.com/wp-content/uploads/2016/08/tomas-150x150.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"Metal infrastructure and trees sweeping a house away\" /></a>\n\n<p><em>Some Damage done to my hometown (more images could be seen by googling “<a href=\"https://www.google.com/search?q=Hurricane+Tomas+Fond+St.+Jacques+Damage&source=lnms&tbm=isch&sa=X&ved=0ahUKEwiequDphNXOAhVDOCYKHeHrAPwQ_AUICSgC&biw=1242&bih=1510\">Hurricane Tomas Fond St. Jacques Damage</a>”</em></p>\n<p>My friends were right, my mom&#8217;s shop where she sold snacks and food items which generated most of the income for my schooling had completely vanished, no trace of it was left, like it was never there.</p>\n<blockquote><p>This storm had done so much damage that there was no way for anyone from my community to get to school</p></blockquote>\n<p>Roads were completely sliced through by water and eventually I had to move out of my community to live in Soufriere for ease of travelling to school.</p>\n<p>At age 16 I still wanted to be a Game Designer, I had spent the previous 5 years excelling in Information Technology at my Secondary school but had never done any piece of programming, the damages of Hurricane Tomas were still evident and I was still shaken up at how my life had changed, I was no longer living with my parents in my hometown, everything I would not wish for a teenager.</p>\n<p>To this day the damage done to my home town is still visible:</p>\n\n<a href=\"http://heropress.com/essays/minority-amongst-minorities/20160816_132245/\"><img width=\"150\" height=\"150\" src=\"http://heropress.com/wp-content/uploads/2016/08/20160816_132245-150x150.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"Building with storm damage years later\" /></a>\n<a href=\"http://heropress.com/essays/minority-amongst-minorities/20160816_132253/\"><img width=\"150\" height=\"150\" src=\"http://heropress.com/wp-content/uploads/2016/08/20160816_132253-150x150.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"Building with storm damage years later\" /></a>\n\n<p><em>This is the exact same area from one of the previous images. These pictures were taken August 8th 2016 when I visited.</em></p>\n<p>In the Caribbean, at the end of your 5 years of Secondary schooling you are required to write an exam called “CXC” if you wish to pursue higher education. For my academic year we never finished our Information Technology syllabus which touched a bit on Pascal programming, so when it came to writing the Information Technology exam every category was aced, but <strong>I failed the programming section</strong>, even then I still wanted to be a Game Designer and had not yet grown any affection for coding.</p>\n<p>In 2011 I started schooling at Sir Arthur Lewis Community College (SALCC) pursuing an Associate Degree in Computer Systems Engineering which was the only option available which dealt with Technology at that college (there are only two colleges on my island). This was a 2 year degree where the first year students are introduced to both the Hardware and Software side of computing then in the second year choose the path they wish to pursue. This was also around the time I first came across WordPress while fiddling on the internet and <strong>making the mistake of not looking more into what it really was</strong>.</p>\n<h3>Technical Project</h3>\n<p>One year into my Computer Engineering program it finally came the time to choose my path in IT and of course I chose the Software path because I believed if I wanted to be a Game Designer then this was the best path. That remaining year was when I really started to build up my affection for code, there was only one course in the software path that actually dealt with any type of code to some extent called “Programming Methodology”. Programming Methodology was a course tailored to teach you the very basics of programming such as Loops, IF and ELSE statements, Variables and small exercises to help you put those into practice. This entire Programming Methodology course was done with VB6 examples in Visual Studio 2006 so <strong>I was not taught a single line of Web Development code</strong>.</p>\n<p>At this college every student who does Computer Systems Engineering is required to present a “Technical Project” in a typed and physical presentation form, it&#8217;s purpose is to show what you&#8217;ve picked up from the program over the 2 years; without receiving a pass on this Technical Project students would not be awarded their Degree and would need to redo the project until they succeeded. It may sound a bit brutal but I believe this is a good final test and I hope they don’t change this procedure.</p>\n<p>I had known about this requirement for a very long time so I decided to build a video game for my technical project, I knew I could not draw so I decided to use a RPG Maker and ponder ways I could get a pass by presenting to the graders a video game which I did not physically design any of the characters or coded them in. I eventually decided to create an Educational video game and touch on the topic of teaching through entertainment (Edutainment). There was this one course called Data Communications that students always seem to have trouble passing so I thought “Hey, maybe I should create a game showing some basics of Data Communications”.</p>\n<p>During my time learning how to use this RPG Maker and creating this game I found myself using a lot of the logic operators I had learnt about in Programming Methodology, this was all good because in my presentation I could have shown that though I used a RPG Maker, there was actually a lot of programming logic going on under the hood and that I was actually coding.</p>\n<blockquote><p>While working on this project my love for code grew, I was having fun.</p></blockquote>\n<p>By the time I had finished creating this game my passion had already broken down from Game Designing to coding. Thankfully, I was successful with the game which I called “EduCom” and was able to finish college in a perfect 2 years (woohoo!), you can download EduCom here: <a href=\"https://uriahsvictor.com/portfolio/educom-educational-video-game/\">Click here</a></p>\n<p>Fast forward a few months and there I was as an intern from college at a web agency understudying some colleagues who didn’t build desktop apps. Keep in mind that at college I had learnt VB6 to the point where I could have switched over to self-learn VB.NET and I was now sitting in a web agency learning web development, well guess what? I still loved it. I went home each day and practiced it, I used <a href=\"http://codeacademy.com\">http://codeacademy.com</a> (which now redirects to codecademy.com) to learn HTML and CSS and I was even good with jQuery at some point! Life was great, at that time getting employed by the agency was not a big deal for me, I just loved coming to work and understudying the other Developers.</p>\n<blockquote><p>A shock came to me one day when I was told that I had went to the wrong company for my internship.</p></blockquote>\n<p>I remember to this day clearly being told that I was supposed to carry out my internship at this web agency but now I was being told that I went the wrong place. I really liked where I currently was but I actually needed to leave for the company which I was registered to in the school records, <strong>I still wonder what would have happened if I had never corrected that mistake</strong>.</p>\n<p>With 2 months left out of the 3 month long internship program, I was at a new company with very little excitement in me. The silver lining came when I arrived and noticed that there was this 1 developer who was responsible for both building and maintaining desktop applications and websites, two things I really liked doing, so I quickly gravitated towards him and in no time we became friends. I was awed by him and I could safely say just like the previous guys at the web agency that he played a part in me not forgetting my true passion for coding. I say this because at this newly assigned company I became an IT Technician, doing everything Techs usually do such as fixing printers, troubleshooting WIFI networks, fixing computers and even building them too, but even after spending the day as an IT Technician I often spent the night as a Developer. <strong>I never stopped coding</strong>, I often came home fatigued from all the hands on tech work but I pushed myself through CodeCademy’s exercises, I spent time working in Visual Studio building simple apps that did nothing useful but I still liked the feeling of seeing my code come to life.</p>\n<p>At the ending of my internship I had become such a great IT Technician that I got the job. I was excited because heck, who wouldn’t be excited to get a job straight out of college in a country with high unemployment rate?</p>\n<h3>Reality Is Cruel; Immerse Yourself &#8211; Uriahs Victor</h3>\n<p>On September 3rd 2013; two weeks before my birthday was my first day officially on the job. My day was going by normal, until I got a call from my sister, crying. My father had lost his life because of a mishap while working on our family farm. It took me a while to realize what had happened, I didn&#8217;t want to believe it. Might sound strange to you, but video games again came up and helped me through.</p>\n<p><a href=\"http://heropress.com/wp-content/uploads/2016/08/custom_pc.jpg\"><img class=\"alignright wp-image-1255 size-medium\" src=\"http://heropress.com/wp-content/uploads/2016/08/custom_pc-300x225.jpg\" alt=\"Tricked out PC case with lights inside.\" width=\"300\" height=\"225\" /></a>Life went on and after one year I had grown my IT Technician skills even more, I was often tasked with building custom PCs like this.</p>\n<h3>No matter where you are at right now, don’t stop doing what you truly love.</h3>\n<p>The day came when my Developer friend at the company decided it was time for him to leave the job for greater things, and guess who offered to be the new Developer? That’s right, me. With some help from my colleague I got familiar with the different apps and websites the company had under their management, again I came across WordPress but I still did not know much about it on a coding stand point, I spent time at home getting familiar with its backend but what was more unusual to me was its code. I knew how to build static websites with HTML and CSS but I did not know much PHP at the time so I had to quickly learn a fair level of PHP to find myself around and also learn different things about WordPress such as plugins and backing up&#8230; enough to fill in my colleague’s shoes as quickly as I could before he was gone.</p>\n<h3>I am not happy at my job!</h3>\n<p>Two years into the job and things had begun to turn sour for me, I was not happy at my job. One of the main reasons was that I felt underappreciated and overlooked. Though I was the new Developer for the company they never got over the fact that I was also pretty good with computers, so I was often asked to stop whatever software related tasks I was doing to head over to some client’s business to check out a faulty computer or things of that nature. I was unhappy, I felt like I this company did not value the software side of their business nearly as much as the hardware side, couple that with the fact that I was still being paid the same salary as when I was only an IT tech, to now being in charge of the company’s software and still finding myself doing IT Technician related tasks and then being asked by my employer “Why can’t you work on the client apps at home?”, there was no overtime pay offered in my contract, so I used my nights to better myself and also to rest my mind.</p>\n<p>I was still 20 but soon to be 21 at the time and I felt overworked. Having to condition your brain to work on VB.NET apps some of which were not built by yourself requires time to be spent getting familiar with the source code, but often minutes after I would have to recondition my brain to think of reasons why a computer has a certain issue, this was like P90X on the brain, it was a daily thing and I began disliking as weeks and months went by. Time passed and things became sourer, I began contemplating my resignation; I did not like the way I was being treated and it had begun to show, I often only found joy when practicing my code at home, this late night practicing also often caused me to arrive late the next day for work which I compensated for by leaving at late hours.</p>\n<h3>If it doesn’t come bursting out of you, don’t do it.</h3>\n<p>The day came when I decided to resign from my job but something inside me said “Uriahs, give it another shot”, that voice was the bad voice, I was let go from the job the same day I planned to resign.</p>\n<h3>Is Karma real?</h3>\n<p>So there I was, a 21 year old who had no backup plan and no job applications out in the wild but I was happy. I had felt relief that I did not have to deal with working in an environment I didn’t like. I was told by my past colleagues that my replacement had come in the next day and I thought to myself that maybe this company was contemplating letting me go just as long as I was contemplating leaving (lol). Well, let’s just say this replacement only lasted 3 days on the Job then quit after messing up one of the company’s high end clients website, a news publishing website: <a href=\"http://stluciastar.com/\">http://stluciastar.com/</a> built on WordPress which I had been maintaining and making code modifications for when asked.</p>\n<p>I don’t know why the company thought it was ok to call me 3 days after letting me go, asking for my “help” in fixing whatever problem a replacement Developer (who I believe shortly quit after the incident) had done, but after consulting with the WordPress community, it was made clear to me that I should either charge for my services or decline; heck, I was unemployed and still had rent and bills to pay but I instead eventually declined.</p>\n<h3>A new beginning</h3>\n<p>Weeks went by with me just getting used to being out of an office type job to being home, I had been living alone since I had gotten the past job so I also had to get used to having less people around me. I took that time to learn more about WordPress, Udemy pricing scheme didn’t change yet so I bought myself a few WordPress Development courses for $10USD each when they came on sale, such as: WordPress Theme Development with Bootstrap by Brad Hussey, in that one course I learnt more about WordPress than I had learnt in all my time working in my last job(wut?). I began doing freelance work online and locally, there were not many other options on my island to work in software so I started questioning whether I should be sending out applications for new jobs or just do full time freelancing; I had my doubts about the few companies there were, and I actually enjoyed working from home. Time passed and I fell more and more in love with WordPress, I watched tutorials and googled away trying to pick up knowledge, the WordPress codex which I once found intimidating began to look sexy.</p>\n<p>Once I felt I had gathered enough knowledge on WordPress, I thought of a plugin idea and began working on it. I had no immediate help except for the WordPress community populating the codex with all the useful information. I spent a few weeks working none stop on this plugin which I thought did a pretty good task which was to Inform buyers of a downloadable WooCommerce product that there is an update for that product after the shop owner has marked it as updated. After completing the plugin I was ready to submit to the WordPress repository, it brought me joy when I got the e-mail letting me know that the plugin was accepted to the WordPress repository! I love open source so just having a plugin for WordPress which could at least help some people made me feel warm inside.</p>\n<h3>Pirate of the Caribbean</h3>\n<p>Around that time something equally interesting happened. I had completed a short video chat with Ionut and Sabina from <a href=\"http://themeisle.com\">ThemeIsle</a> and found out that I would be part of their WordPress support team for their themes and plugins! Obviously I was happy, I would be amongst like minded individuals, a team who appreciates WordPress as much as I do, a team I could learn from! All without needing to fly over to Romania!</p>\n<h3>Let’s have a drink</h3>\n<p>One day while performing a random Google search for my plugin I saw in the search results a link to WPTavern, I curiously clicked on the link and saw that my plugin (TLD WooCommerce Downloadable Product Update Emails) had been picked as one of the top 3 plugins of the week on WPTavern, my very first plugin and <a href=\"https://wptavern.com/wpweekly-episode-233-recap-of-wordcamp-chicago-2016\">it was mentioned on WPTavern</a>?!</p>\n<blockquote class=\"wp-embedded-content\"><p><a href=\"https://wptavern.com/wpweekly-episode-233-recap-of-wordcamp-chicago-2016\">WPWeekly Episode 233 – Recap of WordCamp Chicago 2016</a></p></blockquote>\n<p><br />\nIn under 1 year I have achieved more than I did in the recent years. It wasn’t easy, many nights were spent awake googling away, many parties were missed so I could save and be able to pay bills. If you like something, do it!</p>\n<blockquote><p>Programming is for anyone and when I notice someone from my island or the Caribbean show interest in coding I never refrain from encouraging them.</p></blockquote>\n<p>I am currently 21 and will be 22 next month, I still have lots to learn, I still have lots to give back to the WordPress community and open-source community on a whole, I currently aid small businesses and non-profits on my Island grow their brand with WordPress. I have plugins and plugin ideas in the pipeline which I am currently not able to complete, but through learning and growing my skills I eventually will.</p>\n<p>It doesn’t matter which part of the world you grew up in, what challenges you’ve faced, nor does it matter your race, all it takes is the internet, passion, patience, practice and of course prayer.</p>\n<p>WordPress has been good to me, if it has been good to you, then helping the WordPress Community in any way possible is the best we could all do.</p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: A Minority Amongst Minorities\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=A%20Minority%20Amongst%20Minorities&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Fminority-amongst-minorities%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: A Minority Amongst Minorities\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Fminority-amongst-minorities%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Fminority-amongst-minorities%2F&title=A+Minority+Amongst+Minorities\" rel=\"nofollow\" target=\"_blank\" title=\"Share: A Minority Amongst Minorities\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/minority-amongst-minorities/&media=http://heropress.com/wp-content/uploads/2016/08/082416-Uriahs-Victor-150x150.jpg&description=A Minority Amongst Minorities\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: A Minority Amongst Minorities\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/minority-amongst-minorities/\" title=\"A Minority Amongst Minorities\"></a></div><p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/minority-amongst-minorities/\">A Minority Amongst Minorities</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 24 Aug 2016 12:00:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Uriahs Victor\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"Post Status: Static site generators versus WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=26180\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"https://poststatus.com/static-site-generators-versus-wordpress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7124:\"<h3>The current state of affairs</h3>\n<p>In 2016, WordPress is far from the only choice for a new website. In fact, website owners have enjoyed a plethora of options (hosted and self-hosted) for many years. WordPress has remained the juggernaut solution for self-hosted websites, with 25% marketshare of the total web, and as the mainstay CMS for small-to-medium businesses with small or low budgets.</p>\n<p>Amongst two groups &#8212; large institutions that need high scalability, and the ever-tinkering developer crowd &#8212; another option is trending positively: the static site generator, also known as a flat-file CMS.</p>\n<p>Don’t get me wrong — the WordPress install base is huge, and the threat posed by static site generators is small. But it’s growing. Post Status editor Brian Krogsgard polled developers <a href=\"http://www.slideshare.net/krogsgard/the-state-of-wordpress-business\">prior to Pressnomics</a>, to assess the threat level posed by various CMSs and publishing platforms; Medium and static site generators were considered more of a threat than any others:</p>\n<p><img class=\"aligncenter size-large wp-image-26181\" src=\"https://cdn.poststatus.com/wp-content/uploads/2016/08/Screen-Shot-2016-08-23-at-9.58.07-AM-752x234.png\" alt=\"Screen Shot 2016-08-23 at 9.58.07 AM\" width=\"752\" height=\"234\" /></p>\n<p>He also wrote in a newsletter to <a href=\"https://poststatus.com/club\">members</a> in November, 2015, “Didn’t I just mention about the appeal of static sites? I really think they’re a big top-end threat,” referring to the <a href=\"https://github.com/department-of-veterans-affairs/vets-website\">launch of vets.gov</a>. Earlier that month, Smashing Magazine christened them <a href=\"https://www.smashingmagazine.com/2015/11/modern-static-website-generators-next-big-thing/\">the next big thing</a>. A number of high profile websites use static site generators, from <a href=\"http://product.voxmedia.com/2015/7/8/8907841/introducing-autotune\">Vox Media</a> to <a href=\"http://kylerush.net/blog/meet-the-obama-campaigns-250-million-fundraising-platform/\">Barack Obama</a>.</p>\n<p>A spate of flat-file CMS options have become strong contenders: <a href=\"https://jekyllrb.com/\">GitHub’s Jekyll</a> is by far the most popular, but it’s joined by <a href=\"http://getgrav.org/\">Grav</a>, <a href=\"http://www.couchcms.com/\">Couch</a>, <a href=\"http://picocms.org/\">Pico</a>, and <a href=\"https://www.staticgen.com/\">more</a>. You can even host your static site on <a href=\"https://pages.github.com/\">GitHub Pages</a> for free, and they’re happy to let you use a custom domain.</p>\n<h3>Historical WordPress advantages</h3>\n<p>The continuing appeal of WordPress has been fourfold:</p>\n<ol>\n<li>The ability to get started very cheaply, without a monthly fee on top of hosting costs.</li>\n<li>The liberty to use a custom domain name.</li>\n<li>A robust ecosystem that provides thousands of free or inexpensive themes and plugins.</li>\n<li>One-step installation facilitated by mainstream web hosts’ embrace of WordPress.</li>\n</ol>\n<p>Since Jekyll and its ilk are mostly open-source, advantage #1 is wiped out. GitHub Pages knocks out advantage #2. WordPress retains the upper hand regarding #3 and #4. Younger projects have a long way to go before they can rival the WordPress community, and they’re still focused on serving fellow developers rather than everyday consumers. Until that changes, big web hosts won’t bother to enable ultra-easy installation.</p>\n<h3>Modern WordPress drawbacks</h3>\n<p>WordPress does have legitimate downsides, especially if you’re already a competent web developer or you’re focused on the highest levels of technical performance.</p>\n<p>Site speed is ever more important in an age of social distribution and mobile browsing, and made more difficult considering site assets and page weights seem to be constantly getting larger. WordPress can be difficult to scale for high levels of traffic, and certain site architecture decisions can get developers in trouble.</p>\n<p>High scalability and smart web performance management with WordPress requires significant development expertise or more expensive managed hosting partners, especially for complex WordPress installs; whereas the inherently static nature of static site generators makes scalability more trivial.</p>\n<p>Finally, security is a concern for some people that choose static site generators. WordPress has opportunities for user input that static site generators do not. It is also a natural target of hackers, simply due to its popularity. And static site generators are almost completely locally stored &#8212; aside from the output itself &#8212; whereas WordPress (potentially outdated, along with underlying themes and plugins) is stored on the server, more vulnerable to attacks.</p>\n<h3>Why WordPress is still winning</h3>\n<p>As I noted amongst its historical advantages, WordPress has an unparalleled ecosystem of plugins, add-ons, and extensions. (For comparison, the <a href=\"http://www.jekyll-plugins.com/\">Jekyll Plugins website</a> only lists fifty-two options at the time of writing.) It’s also relatively easy for non-technical people to install and use WordPress, in part because mainstream hosting companies put in the effort to make it easy, but even prior to such conveniences WordPress <a href=\"https://codex.wordpress.org/Installing_WordPress#Famous_5-Minute_Install\">boasted</a>, &#8220;the famous 5-minute install.&#8221; And static site generators are just not as powerful as traditional content management systems, especially in regard to user input.</p>\n<p>Among the static site generators, Jekyll in particular is working toward feature parity, but it will take a long time. Current ease-of-use tools like <a href=\"http://prose.io/\">Prose</a>, a content editor that integrates with GitHub, and <a href=\"http://cloudcannon.com/jekyll-gui/\">CloudCannon’s Jekyll GUI</a>, which aims to help developers collaborate with clients, are in their infancy in terms of adoption and are still finicky to use.</p>\n<p>It can be tempting to look longingly at the growing ecosystem around static site generators. It&#8217;s also easy to forget just how much you get &#8220;for free&#8221; with built-in WordPress functionality. Static site generators definitely play a role in the modern web, and can be a great choice for certain types of websites. But no static site generator signals the end for WordPress and its continuously strong community.</p>\n<h3>The future — what should you do?</h3>\n<p>Since you’re reading Post Status, it seems fair to assume that you’re part of the WordPress ecosystem, and very likely earn a living from it. Should you be panicking? No, for all the reasons I laid out.</p>\n<p>But any wise professional keeps an eye on the future of their industry. We are seeing a trend, and over time Jekyll and its siblings will gain more marketshare. It’s probably worth your time to try out a few flat-file CMS options, get familiar with how to use and customize them, and perhaps consider what WordPress itself can learn from them.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 23 Aug 2016 20:23:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Sonya Mann\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"Post Status: WordPress 4.6, “Pepper”\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=26067\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"https://poststatus.com/wordpress-4-6-pepper/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:13939:\"<p>WordPress 4.6, “Pepper”, <a href=\"https://wordpress.org/news/2016/08/pepper/\">has been released</a>. It’s named, as always, after a famous jazz musician, and this release is named after <a href=\"https://en.wikipedia.org/wiki/Pepper_Adams\">Park Frederick &#8220;Pepper&#8221; Adams III</a>, a baritone saxophonist and jazz composer.</p>\n<p>The Release Lead for WordPress 4.6 was <a href=\"https://dominikschilling.de/\">Dominik Schilling</a>, known often as Ocean90, and the Deputy Release Lead was <a href=\"https://www.garthmortensen.com/\">Garth Mortensen.</a> There were 272 total contributors to this release. According <a href=\"https://twitter.com/aaronjorbin/status/765631441950703617\">to Aaron Jorbin</a>, 85 of these contributors were first timers, so congratulations to all new WordPress contributors!</p>\n<p>For this release, we did a special episode of the Post Status <a href=\"https://poststatus.com/category/draft\">Draft podcast</a>, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>, <a href=\"https://play.google.com/music/m/Ih5egfxskgcec4qadr3f4zfpzzm?t=Post_Status__Draft_WordPress_Podcast\">Google Play</a>, <a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>, and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Post Status Draft is hosted by Joe Hoyle — the CTO of Human Made — and me, Brian Krogsgard.</p>\n<p>In this episode, Joe and I discuss WordPress 4.6 and deep dive on a few of its features.</p>\n<p><a href=\"https://audio.simplecast.com/44775.mp3\">https://audio.simplecast.com/44775.mp3</a><br />\n<a href=\"https://audio.simplecast.com/44775.mp3\">Direct Download</a></p>\n<h2>About WordPress 4.6</h2>\n<p>Here’s a video overview of WordPress 4.6:</p>\n<div class=\"wp-video\"><!--[if lt IE 9]><script>document.createElement(\'video\');</script><![endif]-->\n<a href=\"https://videos.files.wordpress.com/GbdhpGF3/video-25313e7f01_hd.mp4\">https://videos.files.wordpress.com/GbdhpGF3/video-25313e7f01_hd.mp4</a></div>\n<p>&nbsp;</p>\n<p>Overall, this was a planned iterative release from the beginning, with a goal to fix as many longstanding bugs as possible, and to refine existing features, rather than to focus on a lot of brand new features.</p>\n<p>Folks have been clamoring for a release like this for a long time, and in most respects 4.6 delivered. <a href=\"https://core.trac.wordpress.org/milestone/4.6\">According to Trac</a>, 489 tickets were closed, across 53 components, during the 4.6 milestone. Also, it shipped exactly on time.</p>\n<h2>User facing features</h2>\n<p>WordPress 4.6 has a few user facing features that aren&#8217;t huge functional changes, but nice interface enhancements.</p>\n<h3>Shiny updates</h3>\n<p>No more <em>bleak screen of sadness</em>, as the team working on this termed it. The plugin installation, updates, and delete process is much smoother than it used to be. There&#8217;s a nice video of this <a href=\"https://make.wordpress.org/core/2016/06/02/proposal-more-shiny-updates/\">from the initial proposal</a>:</p>\n<div class=\"wp-video\"><a href=\"https://make.wordpress.org/flow/files/2016/05/Shiny-Plugins.mp4\">https://make.wordpress.org/flow/files/2016/05/Shiny-Plugins.mp4</a></div>\n<p>&nbsp;</p>\n<p>This was the second release where &#8220;shiny updates&#8221; features were a focus. To see some under the hood considerations for developers, there&#8217;s <a href=\"https://make.wordpress.org/core/2016/07/06/shiny-updates-in-4-6/\">more information on that</a> from Pascal Birchler.</p>\n<h3>Native fonts</h3>\n<p>WordPress is leaving Open Sans, which was introduced with the &#8220;MP6&#8221; admin overhaul of <a href=\"https://poststatus.com/meet-wordpress-3-8/\">WordPress 3.8</a>. You may have seen GitHub’s recent change to native fonts. It&#8217;s definitely a trend lately. Matt Miklic <a href=\"https://make.wordpress.org/core/2016/07/07/native-fonts-in-4-6/\">explains the switch</a> from Open Sans to native system fonts in the WordPress admin.</p>\n<p>The declaration of fonts when using system fonts has a good bit of science behind it, and may be useful for those of you who wish to do something similar for your own projects. Marcin Wichary has a really interesting post <a href=\"https://medium.design/system-shock-6b1dc6d6596f#.n2idzpgry\">describing Medium&#8217;s process</a> when they made the switch.</p>\n<p>And if you&#8217;re curious, the new declaration is this:</p>\n<pre>font-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Ubuntu, Cantarell, \"Helvetica Neue\", sans-serif;</pre>\n<h3>Inline link checker</h3>\n<p>WordPress will now automatically detect improperly formatted links, as you write. While this doesn&#8217;t check the validity of any properly written URL, it will ensure the URL you add in an <code>href</code> is properly formatted. So, it will catch if you accidentally type something like <code>htp://w.org</code> or <code>http:/w.org</code> and outline it in red for you to fix.</p>\n<p>If you copy and past a URL into the link editor, but don&#8217;t include <code>http://</code> at all (I do this a bunch), it auto detects and inserts it for you.</p>\n<h3>Browser content caching</h3>\n<p>Yet more efforts have been made to always ensure that you do not lose your content as you write. I followed the <a href=\"https://core.trac.wordpress.org/ticket/37025\">steps in the Trac ticket</a> to see exactly what happens here.</p>\n<p>So I typed the first sentence below, saved a draft, then typed the second paragraph:</p>\n<blockquote><p>What if I start typing and save a draft?</p>\n<p>Then start typing some more, because that&#8217;s what bloggers do. And I chill here for a few seconds, then stupidly just reload this page?</p></blockquote>\n<p>Then I reloaded the page without saving again, and got this notice:</p>\n<a href=\"https://poststatus.com/wordpress-4-6-pepper/#gallery-26067-1-slideshow\">Click to view slideshow.</a>\n<p>And just like that, the content is back, because it was saved in the browser&#8217;s local storage. Pretty cool.</p>\n<h2>Developer features</h2>\n<p>There are several important developer centric features that you should know about.</p>\n<h3>Enhanced meta data registration</h3>\n<p>This is a significant aid to the (pending) REST API meta handling, but also improves other meta data functionality. The <code>register_meta()</code> function allows developers to tell WordPress more about what specific meta data is designed to do. In WordPress 4.6, the arguments for this function have changed, enabling more information to be communicated in the third parameter, which is now an array.</p>\n<p>The <code>show_in_rest</code> key, an experimental key (until the API endpoint goes in), finally solves the issue for the REST API for knowing when to include meta data in the API&#8217;s default responses. It&#8217;s one step of a few that need to be made to better support meta for the API, but it&#8217;s a good step forward.</p>\n<p>For plugin developers not using <code>register_meta()</code>, be sure to learn more about it and the advantages, as there are quite a few. Jeremy Felt describes how to use <code>register_meta()</code> <a href=\"https://make.wordpress.org/core/2016/07/20/additional-register_meta-changes-in-4-6/\">on Make Core</a>.</p>\n<h3>Translation priorities and changes</h3>\n<p>WordPress will now default to the translations from <a href=\"https://translate.wordpress.org\">Translate.WordPress.org</a> community translations, then pull from theme or plugin translation files. A procedure called “just-in-time” translation loading will be utilized, and for plugins and themes distributed through the official repository, <code>load_plugin_textdomain()</code> and <code>load_theme_textdomain()</code> no longer need to be used.</p>\n<p>Commercial plugin authors will still largely follow the same internationalization procedures they always have.</p>\n<p>In a related note, and quite impressively, WordPress 4.6 shipped 100% translated in 50+ languages.</p>\n<h3>Resource hints</h3>\n<p>Joe helped teach me more about resource hints on the podcast, and Aaron did a much better job detailing resource hints than I could, in his <a href=\"https://make.wordpress.org/core/2016/07/26/wordpress-4-6-field-guide/\">excellent field guide</a>:</p>\n<blockquote><p>Resource Hints is a rather new <a href=\"https://w3c.github.io/resource-hints/\">W3C specification</a> that <em>“defines the <a href=\"https://w3c.github.io/resource-hints/#dfn-dns-prefetch\"><code>dns-prefetch</code></a>, <a href=\"https://w3c.github.io/resource-hints/#dfn-preconnect\"><code>preconnect</code></a>, <a href=\"https://w3c.github.io/resource-hints/#dfn-prefetch\"><code>prefetch</code></a>, and <a href=\"https://w3c.github.io/resource-hints/#dfn-prerender\"><code>prerender</code></a> relationships of the HTML Link Element (<code>&lt;link&gt;</code>)”</em>. These can be used to assist the browser in the decision process of which origins it should connect to, and which resources it should fetch and preprocess to improve page performance.</p>\n<p>In 4.6, WordPress adds an API to register and use resource hints. The relevant ticket is <a href=\"https://core.trac.wordpress.org/ticket/34292\">#34292</a>.</p>\n<p>Developers can use the <code>wp_resource_hints</code> filter to add custom domains and URLs for <code>dns-prefetch</code>, <code>preconnect</code>, <code>prefetch</code> or <code>prerender</code>. One needs to be careful to not add too many resource hints as they could quite easily <em>negatively</em> impact performance, especially on mobile.</p></blockquote>\n<p>Resource hints can be very useful for certain situations, and it&#8217;s a technique that I personally need to explore further. Those of you doing advanced performance-driven development will surely be excited about support for this in WordPress.</p>\n<h3>Customizer APIs</h3>\n<p>The <a href=\"https://make.wordpress.org/core/2016/07/06/customize-api-changes-in-4-6/\">Customize API continues to evolve</a> and improve, and Nick Halsey walks through new developer-focused features and changes to the API for WordPress 4.6. Also quite notably, Weston Ruter describes <a href=\"https://make.wordpress.org/core/2016/07/05/customizer-apis-in-4-6-for-setting-validation-and-notifications/\">new APIs for both settings validation and notification management</a> in the customizer.</p>\n<h3>Other developer-centric changes</h3>\n<p><a href=\"https://make.wordpress.org/core/2016/07/08/multisite-focused-changes-in-4-6/\">Multisite changes</a>: Jeremy Felt describes <code>WP_Site_Query</code> and <code>WP_Network_Query</code>, and goes over a few new functions and filters.</p>\n<p>There is now a <a href=\"https://make.wordpress.org/core/2016/07/18/comments-in-4-6-can-now-be-cached-by-a-persistent-object-cache/\">persistent comment cache</a>, allowing more performant comment loading functionality. Rachel Baker, the comments component maintainer, explains further.</p>\n<p>The WordPress HTTP API <a href=\"https://make.wordpress.org/core/2016/07/27/http-api-in-4-6/\">now uses the Requests library</a>, as Ryan McCue describes.</p>\n<p>Aaron Jorbin describes some of the <a href=\"https://make.wordpress.org/core/2016/07/06/bootstrapload-updates-in-4-6/\">lower level WordPress loading priorities</a> and defaults that have changed. He also describes how WP CLI and core have reconciled their differences in <code>wp-settings.php</code>, which makes backward compatability for WP CLI possible now.</p>\n<p>Boone Gorges <a href=\"https://make.wordpress.org/core/2016/07/06/wp_term_query-in-wordpress-4-6/\">describes the introduction of <code>WP_Term_Query</code></a>. He’s the term whisperer. As Joe and I discuss in the podcast, these sorts of changes make for better consistency in WordPress, and provide an improved developer experience.</p>\n<h2>Learn more</h2>\n<p>WordPress 4.6 is the result of hundreds of community members. You can find their names and links to their profiles on <a href=\"https://wordpress.org/news/2016/08/pepper/\">the official release post</a>.</p>\n<p>Also check out the official <a href=\"https://codex.wordpress.org/Version_4.6\">4.6 Codex page</a> that has a lot of handy information and links to source Trac tickets. You can see all closed tickets from <a href=\"https://core.trac.wordpress.org/milestone/4.6\">4.6 on the Trac milestone</a>. View all new functions, classes, methods, and hooks <a href=\"https://developer.wordpress.org/reference/since/4.6.0/\">on the official Developer Reference</a>. And learn more about some of what I discuss above, and other items, on the ever-helpful <a href=\"https://make.wordpress.org/core/2016/07/26/wordpress-4-6-field-guide/\">field guide</a>.</p>\n<p>For the record, WordPress 4.5 was downloaded more than 45 million times. You can <a href=\"https://wordpress.org/download/counter/\">track 4.6 downloads</a> on the page dedicated to the task.</p>\n<p>Thank you to everyone who contributed to WordPress 4.6! I hope you have a <img src=\"https://s.w.org/images/core/emoji/72x72/1f37a.png\" alt=\"?\" class=\"wp-smiley\" /> or <img src=\"https://s.w.org/images/core/emoji/72x72/1f37b.png\" alt=\"?\" class=\"wp-smiley\" /> to celebrate if that&#8217;s your kind of thing, or otherwise <img src=\"https://s.w.org/images/core/emoji/72x72/1f389.png\" alt=\"?\" class=\"wp-smiley\" />  your efforts.</p>\n<h3>Podcast Sponsor: Prospress</h3>\n<p><a href=\"https://prospress.com/?utm_source=post_status&utm_medium=banner&utm_campaign=ps_ads\">Prospress</a> exists to make the world’s best eCommerce platform a little better, because they want to help entrepreneurs prosper with WordPress. They are the creators of WooCommerce Subscriptions, PayPal Digital Goods, and One Page Checkout. Check them out at <a href=\"https://prospress.com/?utm_source=post_status&utm_medium=banner&utm_campaign=ps_ads\">Prospress.com</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 17 Aug 2016 17:21:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"HeroPress: Taking A Chance With WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1228\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"http://heropress.com/essays/taking-chance-wordpress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9627:\"<img width=\"960\" height=\"480\" src=\"http://heropress.com/wp-content/uploads/2016/08/081716-NevenaTomovic-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: WordPress is actually for everyone, and that\'s what\'s fantastic about it.\" /><p>My grandad always used to say “<em>živi se usput</em>”, which translates from Serbian into &#8220;<em>life happens while you are making plans</em>&#8220;. Everyone is in a rush,  planning their next weekend, holiday, career path, children…. Of course you have to exercise, stay fit, look good, relentless pressure is the way of life today. I happen to be one of those people who like making plans and setting goals. <strong>However, WordPress was never in any of my plans, I happen to stumble upon it</strong>. A friend of mine, Emma, a Cambridge philosophy graduate, who spends her time teaching circus arts, said “I stumble through life in general – I think the best people do it”. I think there is a lot of truth in this, sometimes the best things happen while you are busy making other plans. (This sounds a bit like an infomercial!)</p>\n<p>When I spoke to Topher about this essay, he said to me “<em>oh so your story is also about taking chances</em>”. I never thought of my past actions as taking chances; I am one of those people who jump with their eyes closed, rather than take small calculated steps. But, I will tell you how and why I took a chance with WordPress.</p>\n<h3>Before WordPress (BWP)</h3>\n<p>BWP starts for me 6 months ago, because I have only been a WordPresser for the second part of 2016. I am a UCL graduate, I studied Italian and German language and literature. I have always been interested in reading, art, history of art and generally interested in understanding people. I used to go to the National Art Gallery in London with my dad and we would cover an era each time talking about how art changed, how the paintings happen to catch the change in culture and belief system of society. I continued to dedicate myself to art and language throughout my academic life, I wrote my dissertation in German, on an expressionist artist Oskar Kokoschka and for my MA I translated a black comedy in Italian that looks at social strata. I went on to study and work as a conference interpreter working in all four of my languages and getting lots of opportunities to meet different and interesting people.</p>\n<p>I never imagined myself as a 60-hour-workweek girl in an office typing away on my computer. I planned my career to go a different way. I went to Italy to help create and promote a new teaching method called “edutainment”, teaching through entertainment. That’s where I was first introduced to marketing, localization and writing for an online audience.</p>\n<h3>BWP And My Sports Career</h3>\n<p>Apart from being a quintessential bookworm, I am also a covert adrenaline junkie. This actually ties in well with all of my studies. Sports and studies have one common denominator &#8211; it takes a lot of discipline for both. When I was 3 years old I started rollerblading, my mother found the smallest rollerblades (ever made) and bought them for me. I also played ice hockey in a mixed team and in 2014 we won the national championship in the UK. I am a qualified volleyball coach and ski instructor. Currently my sport obsession is with aerial gymnastics, and acro yoga. I like challenging myself both physically and mentally.</p>\n<h3>Never Stop Learning</h3>\n<p>In a recent <a href=\"https://managewp.com/tony-cecala-interview-on-wordpress-managewp-and-learning\">interview with Tony Cecala</a>, which was actually my first official interview for ManageWP, Tony said “never stop learning”, and this stuck with me, because I realized that the most important thing for me in whatever I do is to keep learning something new. At school I enjoyed learning new things, I enjoy trying out new sports and testing myself, and the same applies to work. Any job you do will have some repetitive aspect, and that is understandable, but it’s important for me to be in a position that embraces personal growth. That’s what WordPress has offered me, a combination of learning and support.</p>\n<h3>My Road To WordPress</h3>\n<p>I was first introduced to WordPress, when I moved back home to Serbia. I applied to work at <a href=\"https://managewp.com/\">ManageWP</a>, as “<em>what the hell</em>”, maybe there is a small chance they will call me back. My team lead happens to also play ice hockey and the first interview was us discussing hockey teams and player positions. Shortly after (they did test my skillset), I started working as a PR &amp; Digital Marketer. As part of the Growth team my job was to get acquainted with the WordPress community, introduce people to our product through online and offline methods, write content and establish myself as a product evangelist. I worked in our Customer Happiness Team as well, helping communicate with our customers on a daily basis.</p>\n<p>WordPress was taking a chance for me, because I never thought of myself as an IT type. My boyfriend on the other hand is a software engineer, and so instead of being enthused by his job, I was always put off. He spends hours a day in front of a computer looking at strange symbols (that’s PHP I hear). Now, ironically I can understand a large part of PHP, no thanks to my boyfriend, but to my ManageWP colleagues.</p>\n<blockquote><p>WordPress is actually for everyone, and that’s what’s fantastic about it.</p></blockquote>\n<h3>After WordPress (AWP)</h3>\n<p>Since being at ManageWP and part of the WordPress world, a lot has changed. I now have an online voice. I set up a blog, I was published on Tech.co, FishingBooker, Meks Themes, Devana Tech, Freelancermap and ManageWP. I also spoke at WordCamp Belgrade and it turned out to be one of the most popular talks of the day, I am speaking at WordCamp Split come September. On top of that I have been given an incredible opportunity to be part of the 2017 WCEU Paris organization team. WordPress has taught me how to express myself, in a non academic setting, how to become a better public speaker, and now I will learn how to help organize an event for a whooping 3 000 people. Never planned that!</p>\n<p>WordPress has also offered me security by giving me a chance to do what I am good at. I have been able to dedicate myself to research, to writing and languages. I have also been able to carry on meeting people and travelling. A country like Serbia hardly offers international work opportunities, and WordPress has opened my eyes to a new community; a community that forges friendships across the world, accepts everyone, encourages tolerance, and welcomes rookies with open arms.</p>\n<h3>AWP And More</h3>\n<p>I don’t know of many other communities out there like WordPress, it’s rare to find a place where everyone is accepted and valued. It doesn’t matter if you are a software engineer or a language nerd, there is a place for you in WordPress. (This is the second part of my infomercial!)</p>\n<blockquote><p>The biggest thing that WordPress has taught me is that sometimes in the most unlikely of places you will learn the most valuable lessons.</p></blockquote>\n<p>It means that taking a chance is always worth the risk. Perhaps I wasn’t bred for the IT world, and I am more suited to be in the same room at the National Gallery as the 17th century French paysage painter, Claude, and his English counterpart of the 19th century, Turner. It so happens that I can’t paint, but I can write, and WordPress has created a virtual room in which I fit it.</p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: Taking A Chance With WordPress\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=Taking%20A%20Chance%20With%20WordPress&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Ftaking-chance-wordpress%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: Taking A Chance With WordPress\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Ftaking-chance-wordpress%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Ftaking-chance-wordpress%2F&title=Taking+A+Chance+With+WordPress\" rel=\"nofollow\" target=\"_blank\" title=\"Share: Taking A Chance With WordPress\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/taking-chance-wordpress/&media=http://heropress.com/wp-content/uploads/2016/08/081716-NevenaTomovic-150x150.jpg&description=Taking A Chance With WordPress\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: Taking A Chance With WordPress\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/taking-chance-wordpress/\" title=\"Taking A Chance With WordPress\"></a></div><p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/taking-chance-wordpress/\">Taking A Chance With WordPress</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 17 Aug 2016 12:00:52 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Nevena Tomovic\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"WordPress.tv Blog: How to Get 100 Content Ideas in an Hour: Nicole Kohler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.wordpress.tv/?p=571\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"http://blog.wordpress.tv/2016/08/11/how-to-get-100-content-ideas-in-an-hour-nicole-kohler/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1094:\"<p>If there’s one thing worse than writer’s block, it’s running out of ideas for your blog or business — or not having any to begin with. Luckily, the internet has made getting inspired an easy task, not to mention an incredibly quick one. In this talk, Nicole shares tips, tools, and content “lifehacks” you can use to generate 100 (or more!) content ideas in less time than it takes to settle on a new theme. Filmed at <a href=\"http://wordpress.tv/event/wordcamp-boston-2016/\">WordCamp Boston 2016</a></p>\n<p></p>\n<p><a href=\"http://littleyellowpenguin.com/wp-content/uploads/2016/07/WCBoston-Kohler-FINAL.pdf\">Presentation slides</a></p>\n<p>See more WordCamp videos at <a href=\"http://wordpress.tv/\">WordPress.tv</a>!</p><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptvblog.wordpress.com/571/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptvblog.wordpress.com/571/\" /></a> <img alt=\"\" border=\"0\" src=\"http://pixel.wp.com/b.gif?host=blog.wordpress.tv&blog=5310177&post=571&subd=wptvblog&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 11 Aug 2016 03:02:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Jerry Bates\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"HeroPress: Finding WordPress in Fargo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1211\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"http://heropress.com/essays/finding-wordpress-fargo/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:12318:\"<img width=\"960\" height=\"480\" src=\"http://heropress.com/wp-content/uploads/2016/08/081016-StaceyBartron-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: It may not all pan out, but I\'m along for the ride with WordPress in my backpack & I cannot wait to see where I end up.\" /><p>I am sure most of you are wondering “New phone, who dis?” when it comes to me. Okay maybe not those words exactly, but I know I am a no-name and haven&#8217;t been around very long. I haven&#8217;t created any kick ass plugins (yet), I haven&#8217;t contributed to WordPress core (yet), and I haven&#8217;t developed any themes (yet).</p>\n<p>So why was I asked to write an essay? Maybe it&#8217;s because there are a lot of people out there who are also trying to break into this community, probably somewhat introverted like me who don&#8217;t know how, or why, or what to do. No, I don&#8217;t have all the answers, I don&#8217;t have a set plan, and I am not in the position to dish out advice because I am still trying to figure it out and navigate it the best I can. But maybe, just maybe, this essay will ring true with someone who thinks, “SAMESIES.” and they know they&#8217;re not the only one out there.</p>\n<p>Or maybe it&#8217;s because I am awesome. You guys can be the judge.</p>\n<h3>Let&#8217;s get introduced</h3>\n<p>I am a shy, but not so shy girl, from the great city of Fargo, ND (No, it&#8217;s nothing like the awesome movie or TV show, don&#8217;tcha know) who started Freelancing in March 2016 after working for a local agency for two and half years.</p>\n<p>My story is probably one many have seen. Girl gets job, girl learns a lot, girl&#8217;s eyes are opened to a whole new world, girl works hard but doesn&#8217;t move up, girl applies for remote jobs with no luck, girl decides she can do this by herself, and girl leaves full time job and joins the million other freelancers in the self-employment world.</p>\n<p>Generic sounding, but there is a bit more to it.</p>\n<h3>Let&#8217;s go back in time for a quick second</h3>\n<p>It all started in my parent’s basement when I was 16. Anyone ever heard of Xanga? It was a social blogging platform that was huge in my school. I made graphics using some freeware Photoshop knock off and custom layouts using basic CSS and HTML for Xanga in my free time, because you know, that&#8217;s normal for a 16 year old girl.</p>\n<p>My parents encouraged me to go to school for graphic design at our local technical college and (blah blah blah&#8230;.let&#8217;s fast forward.) 4 years later after I graduated for Graphic Design, while I was working for a local school photography lab designing layouts for school ID cards and yearbooks, I graduated a second time after going back for Web Development and Design.</p>\n<p>I landed a job doing web design in July 2013. In the interview, they asked me if I knew what WordPress was and I answered honestly like any person would in an interview with something along the lines of, “I have heard of it but I have never used it. BUT I am a go getter and love taking on any new challenges so I don&#8217;t doubt I will be able to figure it out.” I dove in and learned a lot of the WordPress basics in a short amount of time.</p>\n<h3>A whole new world</h3>\n<p>Fast Forward to May 2014, we decided as a team to go to WordCamp Minneapolis for the first time. I am an introverted extrovert, so networking is not my thing. After I get to know people, I am good, but the first step to introduce yourself to someone is scary.</p>\n<p>After day one at WordCamp Minneapolis, my eyes were opened to a whole new world (queue Aladdin song). I didn&#8217;t know how my introverted self would do it, but I wanted to be best friends with everyone there. The WordPress community is so friendly, and so welcoming. I left feeling so inspired and wanted to go to every WordCamp that ever was. I went home with a goal of learning everything I can about WordPress.</p>\n<p>Shortly thereafter, I started to dabble in front-end development. Custom post types, short codes, page templates, etc. I looked at how the themes were created, reversed engineered them, and started to mess around with it. If I hit a bump, I researched it, and of course there was a tutorial or someone in the WordPress community had a solution. (Reason #785 why the WordPress community is fantastic, #ThoseSupportForumsTho.)</p>\n<blockquote><p>In November 2015, I started to feel this shift within myself; that I wanted to do more than I could do in my current position.</p></blockquote>\n<p>The company was going in one way and I was going the other. I wanted to grow as a designer and a developer.</p>\n<p>After a few months of indecision, wondering if I should move to Minneapolis and not hearing back from some remote positions I applied for, a former co-worker reached out to me and said she wanted to work with me. After discussing this with some friends, I had another former colleague that said they would hire me to develop their website, so the wheels started to turn in my head.</p>\n<p>Let me just say, freelancing full time was not anything I considered before. My typical response “Me? Run my own business? Say what? HAHAHA, right.” I thought of every reason why I shouldn&#8217;t do it. Lack of steady income, mortgage, self-employment taxes, not having other clients interested in working with me. I could go on and on, really.</p>\n<p>Yet there I was, considering quitting my full time job to work for myself. How else was I going to grow? How else was I going to get my name out there?</p>\n<p>I only had about a full week to decide what I wanted to do and this wasn&#8217;t an easy decision at all. After some sleepless nights and having the same conversation with my husband at least 100 times, who did nothing but encourage me while I talked myself out of it, I came to a decision.</p>\n<blockquote><p>I followed my gut instinct to grab the opportunity that was presented and go for it.</p></blockquote>\n<p>I didn&#8217;t 100% know what I was doing, but I knew I loved WordPress, I knew I had the design chops, and I knew I was great with clients. I was raised with a can-do attitude, so I was going to freelance my little heart out, and on March 5th, 2016, I entered the self-employment world.</p>\n<p>Fast forward to May 2016, I bought my ticket to WordCamp Minneapolis (because duh, it&#8217;s amazing). I then proceeded to buy my ticket to the Prestige Conference, which was taking place two days after WordCamp. I planned on going to both of these conferences by myself (and anyone who knows me on a personal level knows how much of an accomplishment this was for me). Because I was alone, WordCamp was a bit different this year. I didn&#8217;t have coworkers to talk to so I went in there with a mission to network, but my high anxiety and introverted side decided I should sit quietly and take it all in.</p>\n<p>Prestige Conference, for those who aren&#8217;t familiar, is a smaller conference and focused on running your small business. As a noobie freelancer, I needed to know how other like-minded people were running their businesses, how they were succeeding. So, there I was, a full-time freelancer for a whole 3 months, sitting in this conference with some of these big industry names. Intimidating? Yep, just a bit. The speakers left me in awe and I felt so out of my league but I was just happy to be there, learning and absorbing what everyone was saying.</p>\n<p>Topher and Cate DeRosia were also at this conference. Topher came up to me and started chatting and I quickly explained my background. He gave me some super helpful tips and resources for freelancing. I may have not emoted it, but I was elated. I made a connection. Not exactly because I was outgoing, BUT STILL, I NETWORKED!</p>\n<p>A couple weeks later, Topher contacted me to see if I was interested in making blog images for this very blog. Taken aback, but ever so grateful, I accepted. And after communicating over Twitter, Slack, and email for a couple more weeks, he asked if I wanted to write my own essay. Once again, shocked, dumbfounded, and hesitant because who would want to read my story, but after some encouragement, I was writing my essay.</p>\n<h3>Started from a basement now I&#8217;m here</h3>\n<p>So from where I started 12 years ago messing around with graphics, CSS &amp; HTML for Xanga in my parents basement in Fargo, ND, I am back in a basement, my own this time, doing pretty much the same thing. Doesn&#8217;t sound like a big upgrade, but believe me, it is.</p>\n<blockquote><p>I am sure I wouldn&#8217;t be where I am right now if I skipped out on any of the conferences I went to.</p></blockquote>\n<p>Where is my future going? Who knows. I am not a &#8216;go with a flow&#8217; person, but for the first time, I am trying to go with the flow. I am going to be going to more events and plan on going to WordCamp USA so I can take another stab at networking.</p>\n<h3>To sum it up</h3>\n<p>TL/DR version: My story may be generic, but my love for WordPress is anything but generic. Before WordPress I enjoyed doing graphic design and web design, but discovering the WordPress community helped me find that missing spark I needed. It&#8217;s helped me realize my goals and it&#8217;s helped me find my drive and ambition I didn&#8217;t know I had.</p>\n<blockquote><p>The WordPress community is a huge support system in my life and they don&#8217;t even know who the heck I am.</p></blockquote>\n<p>I can honestly say I love my job, I love working with clients, and I am damn lucky to be able to do what I do every day.</p>\n<p>It&#8217;s not all sunshine and rainbows. I still stress about everything that almost stopped me from doing this and I have my moments where I still question why I quit my full-time job. It may not pan out, it may go in a different direction, but I am along for the ride with WordPress in my backpack and I cannot wait to see where I end up.</p>\n<p><em>Special thanks to: My husband for dealing with my indecisiveness, my sister for being my cheerleader when I doubt myself, and my family for supporting my every decision, Topher for taking a couple minutes out of his day to talk to me and everything else that followed, Kelsey and the Enclave team for being my very first client, and everyone else who has supported this venture.</em></p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: Finding WordPress in Fargo\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=Finding%20WordPress%20in%20Fargo&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Ffinding-wordpress-fargo%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: Finding WordPress in Fargo\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Ffinding-wordpress-fargo%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Ffinding-wordpress-fargo%2F&title=Finding+WordPress+in+Fargo\" rel=\"nofollow\" target=\"_blank\" title=\"Share: Finding WordPress in Fargo\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/finding-wordpress-fargo/&media=http://heropress.com/wp-content/uploads/2016/08/081016-StaceyBartron-150x150.jpg&description=Finding WordPress in Fargo\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: Finding WordPress in Fargo\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/finding-wordpress-fargo/\" title=\"Finding WordPress in Fargo\"></a></div><p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/finding-wordpress-fargo/\">Finding WordPress in Fargo</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 10 Aug 2016 12:00:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Stacey Barton\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:10;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"Post Status: Choosing plugins, libraries, and frameworks — Draft Podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=25965\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"https://poststatus.com/choosing-plugins-libraries-frameworks-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1614:\"<p>Welcome to the Post Status <a href=\"https://poststatus.com/category/draft\">Draft podcast</a>, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>, <a href=\"https://play.google.com/music/m/Ih5egfxskgcec4qadr3f4zfpzzm?t=Post_Status__Draft_WordPress_Podcast\">Google Play</a>, <a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>, and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Post Status Draft is hosted by Joe Hoyle &#8212; the CTO of Human Made &#8212; and me, Brian Krogsgard.</p>\n<p>In this episode, Joe and I discuss how we choose plugins, code libraries, and frameworks for our projects.</p>\n<a href=\"https://audio.simplecast.com/44063.mp3\">https://audio.simplecast.com/44063.mp3</a>\n<p><a href=\"https://audio.simplecast.com/44063.mp3\">Direct Download</a></p>\n<h3>Topics &amp; Links</h3>\n<ul>\n<li>How we pick plugins</li>\n<li>Analyzing a plugin on WordPress.org</li>\n<li>Using GitHub</li>\n<li>Picking libraries or drop-in frameworks</li>\n<li>Dealing with updates</li>\n<li>Differentiating between picking tools for our personal or internal projects, versus doing so for clients</li>\n</ul>\n<h3>Sponsor: WooCommerce</h3>\n<p><a href=\"https://woocommerce.com/\">WooCommerce</a> makes the most customizable eCommerce software on the planet, and it’s the most popular too. You can build just about anything with WooCommerce. <a href=\"https://woocommerce.com/\">Try it today</a>, and thanks to the team at WooCommerce being a Post Status partner</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 06 Aug 2016 14:57:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:11;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"HeroPress: The Joy of Giving Back\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1190\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://heropress.com/essays/joy-giving-back/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:8284:\"<img width=\"960\" height=\"480\" src=\"http://heropress.com/wp-content/uploads/2016/08/080316-Juhi-Saxena-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Thanks to my mother; she has always supported me, without her I would not be here.\" /><p>I was born and brought up in a very small town called <a href=\"https://en.wikipedia.org/wiki/Patiyali\">Patiyali</a>. Patiyali is on the banks of the river Ganga. It is in India&#8217;s most populous state, Uttar Pradesh. Patiyali was laid back and idyllic, with no real opportunities in IT or computers. My father never wanted me to go for IT Job because I wouldn&#8217;t get chance to work near my town. He preferred I live closer home.</p>\n<p>My mother supported me and somehow she convinced my father to let me follow my dreams. Thanks to my mother; she has always supported me, without her I would not be here.</p>\n<p>In my college there was choice between Dot Net and Java, I choose Java. I have always been fan of Open Source. I loved Java, I had also started my blog on Java in my college time. After completing my MCA I had joined my first Job as a Java Developer. I did it for 1.5 years.</p>\n<p>I never wanted to quit my job as Java Developer, but I had to because of my sister health issues. Doctors said she would not survive, it was very critical time.</p>\n<h3>How I got into WordPress (Hello WordPress!)</h3>\n<p>Unemployed for 6 months, Java was still on my mind. I could not get any Job. Meantime I had started teaching. I was hopeless, I thought I would never get a chance to work in any IT company again. Then a friend, <a href=\"https://twitter.com/ankitguptaindia\">Ankit</a>, who worked in <a href=\"https://rtcamp.com/\">rtCamp</a>, a company based in Pune told me to look up WordPress and asked me to apply for a QA opening. That lucky day I got call from rtCamp and cleared my interview. Now the challenge was to convince my parents to allow me to go Pune. Pune is in Maharashtra, almost 1000 miles away from my hometown.</p>\n<p>My parents are from a smaller town, they were worried about me living alone in a big city. It was a challenge to convince them to let go.</p>\n<p>Some things they worried about:</p>\n<ul>\n<li>Place to stay: It was too tough to find a place when I had no one in Pune.</li>\n<li>Female Count: My mother was most worried about female count. rtCamp had only two female employees including me. (now they have 7)</li>\n</ul>\n<p>Before my first day, my father and I went to rtCamp&#8217;s address and looked up the office. Convinced the neighborhood where it was located was semi-residential and safe, he felt much better about Pune.</p>\n<h3>But WordPress is just a blogging platform</h3>\n<p>Before joining rtCamp I had known WordPress as only a blogging platform. My friends who worked in MNCs usually dismissed it as a blogging platform that could create only static sites at best. I did not have a very different opinion than my friends.</p>\n<p>Working in rtCamp was fun. I made friends but to be honest I did not find WordPress very interesting for the first six months in the beginning.</p>\n<h3>WordPress community called out to me</h3>\n<p>Then I saw my colleagues involved in the WordPress community as Core contributors and in many other ways. I saw how my company was encouraging people to get involved in community.</p>\n<p>That encouraged me to get involved in with <a href=\"http://make.wordpress.org\">make.WordPress.org</a>. I highly recommend you do that too.</p>\n<h3>First Contribution Core Patch</h3>\n<p>My first contribution was a small patch in the core. I was helped by colleagues and when it was accepted I was thrilled. Now something I did was on millions of websites. It might be a small line or two but still it was on millions of websites.</p>\n<p>In September 2015, I took part in WordCamp Pune. It was my first WordCamp. I met so many wonderful people; <a href=\"http://heropress.com/essays/making-family/\">Topher</a>, <a href=\"http://heropress.com/essays/breaking-the-silence/\">Mahangu</a>, <a href=\"http://heropress.com/essays/finding-hope-darkness/\">Raghavendra Satish Peri</a>, I got to learn so many new things from them.</p>\n<p>I try to contribute (Giving back to community) in every possible way, by giving support, translating, Review themes, and documentation.</p>\n<h3>Theme Review</h3>\n<p>Theme review was the challenge for me as I had no idea about WordPress development so I thought to learn by seeing other people&#8217;s code. It was challenge for me because I am QA (non- WordPress Developer), other people assume that we can not get involved in any code related activity. I learned a lot by reviewing themes, every day I review a theme I learn so many new things. The theme review team is wonderful, there are so many wonderful people like <a href=\"https://twitter.com/KevinHaig\">Kevin Archibald</a>, <a href=\"https://twitter.com/carolinapoena\">Carolina Nymark</a>, <a href=\"https://twitter.com/Kenshino\">Jon</a>, <a href=\"https://twitter.com/nilambar\">Nilambar</a>, who are ready to help you always. I am happy to be part of theme review team.</p>\n<p>I love WordPress, it&#8217;s wonderful, it has wonderful community.</p>\n<h3>Why do I love being part of WordPress?</h3>\n<p>Recognition.</p>\n<p>I have always been crazy for being known for something. In college time when I used to get likes for my blog post or any comment, I used to feel like…&#8230;wow, I can not even express that feeling in words. So that feeling WordPress gives me every time I gets mention in any WP.org posts. It gives me recognition.</p>\n<p><a href=\"https://make.wordpress.org/themes/2016/06/28/thank-you-reviewers-2/\">https://make.wordpress.org/themes/2016/06/28/thank-you-reviewers-2/</a><br />\n<a href=\"https://make.wordpress.org/docs/2016/07/12/summary-for-helphub-meeting-12-july/\">https://make.wordpress.org/docs/2016/07/12/summary-for-helphub-meeting-12-july/</a><br />\n<a href=\"http://make.wordpress.org/core/2015/09/21/week-in-core-sept-13-21-2015/\">http://make.wordpress.org/core/2015/09/21/week-in-core-sept-13-21-2015/</a><br />\n<a href=\"https://wordpress.org/news/2016/02/contributor-weekend-one-hour-video/\">https://wordpress.org/news/2016/02/contributor-weekend-one-hour-video/</a></p>\n<h3>A Thank You Note</h3>\n<p>All this wonderful adventure would not have been possible without someone back in Patiyali, who stood up for me and encouraged me to follow my dreams. My mother.</p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: The Joy of Giving Back\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=The%20Joy%20of%20Giving%20Back&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Fjoy-giving-back%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: The Joy of Giving Back\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Fjoy-giving-back%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Fjoy-giving-back%2F&title=The+Joy+of+Giving+Back\" rel=\"nofollow\" target=\"_blank\" title=\"Share: The Joy of Giving Back\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/joy-giving-back/&media=http://heropress.com/wp-content/uploads/2016/08/080316-Juhi-Saxena-150x150.jpg&description=The Joy of Giving Back\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: The Joy of Giving Back\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/joy-giving-back/\" title=\"The Joy of Giving Back\"></a></div><p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/joy-giving-back/\">The Joy of Giving Back</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 03 Aug 2016 12:00:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Juhi Saxena\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"Post Status: Using Kickstarter to fund open source\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=25896\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://poststatus.com/kickstarter-open-source-project/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:12695:\"<p>Open source is how we create raw ingredients for the digital economy. It&#8217;s a rough, organic, and hugely important process. In fact, open source represented $143 million <a href=\"https://medium.com/@nayafia/open-source-was-worth-at-least-143m-of-instagram-s-1b-acquisition-808bb85e4681\">of Instagram’s $1 billion acquisition</a>. Yet the role of open source as economic infrastructure <a href=\"https://medium.com/@nayafia/funding-digital-infrastructure-8b1bf8b8e4cb\">is perilous at best</a> — the next <a href=\"http://heartbleed.com/\">Heartbleed</a> could be any day. Bridges don&#8217;t collapse often, but sustainably maintained open source projects are few and far between. Unless a project has the backing of a benevolent organization, it’s all too easy to <a href=\"https://twitter.com/danielbachhuber/status/752973741781463040\">fall into a state of disrepair</a>.</p>\n<p>I do my part by volunteering several hours each week to maintain an open source project called <a href=\"https://wp-cli.org/\">WP-CLI</a>. Last November, I launched a Kickstarter project titled “<a href=\"https://www.kickstarter.com/projects/danielbachhuber/a-more-restful-wp-cli\">A more RESTful WP-CLI</a>” to provide a way for me, a <a href=\"https://handbuilt.co/\">self-employed freelancer</a>, to spend a large amount of dedicated time on WP-CLI and the <a href=\"http://v2.wp-api.org/\">WordPress REST API</a>. The funding wrapped up last month, so I thought it might be helpful to provide a retrospective on what worked, what I’d improve upon next time, and where I think this is all headed.</p>\n<h3>We all love #shipping</h3>\n<p>As a very brief summary of how I used the money:</p>\n<ul>\n<li>Over seven months, I spent 226 total hours on WP-CLI (150 of which were funded by the Kickstarter project) and 111 total hours on the WordPress REST API (92 of which were funded by the Kickstarter project).</li>\n<li>I shipped three major versions of WP-CLI, and helped with three releases of the WordPress REST API v2 plugin.</li>\n<li>In each release, I personally introduced dozens of new features to each project, fixed ten times as many bugs, provided code review, answered support questions, and revised documentation.</li>\n</ul>\n<p>There&#8217;s a <a href=\"https://wp-cli.org/restful/\">very complete project landing page</a> if you’d like to go through all of the details.</p>\n<h3>“I’d love to get paid to work on open source too”</h3>\n<p>On the surface, using Kickstarter seems like a great way to fund open source involvement: create a campaign, people give you money, and you get paid to work on your project. It&#8217;s actually fraught with challenges, though. The more appropriate way to think about using Kickstarter for open source is that you&#8217;re creating a one-time project for yourself, and have hundreds of customers to serve.</p>\n<h4>Kickstarter can help freelancers make significant open source contributions</h4>\n<p>It&#8217;s worth highlighting the single most important outcome of the crowdfunding campaign: I was able to spend dedicated time on WP-CLI and the WordPress REST API that I wouldn’t have been able to spend otherwise (or at least in such a concentrated period).</p>\n<p>As a freelancer, I evaluate every hour of my working day as either billable or non-billable. While I&#8217;m fortunate I can already spend a large amount of non-billable time as I please, at the end of the day the time I don&#8217;t spend on billable hours is money out of my pocket. Kickstarter enabled me to consider open source contributions as billable, and rationalize dedicating a large number of hours each week to the projects.</p>\n<p>In hindsight, the timing of the Kickstarter project turned out really well too. Because I didn&#8217;t have any clients when I quit my full-time job, the funds were a helpful cushion during the slow holiday period, and I had something to work on in January.</p>\n<h4>It&#8217;s important to have backers with deep pockets</h4>\n<p>Incorporating higher contribution levels, which I had primed by chatting with prospective backers in advance, meant the funding leapt forward in huge bounds. Every time one of those contributions came in, it moved the needle in a substantial way, and kept the excitement level up. This also helped keep lower level contributors engaged and willing to participate. I can’t imagine how difficult it would be to try and fund a Kickstarter exclusively on sub-$100 contributions.</p>\n<p><a href=\"https://poststatus.com/profiles/ben-welch-bolen/\">Ben Welch-Bolen</a>, who I hadn&#8217;t met until he snagged the top contribution slot, explains:</p>\n<blockquote><p>What attracted us to the WP CLI Kickstarter project was the higher pledge options that had some meaningful exposure for us to his community, and to him as a resource. Plus it was great to give back to a tool we use ourselves and follow closely.</p></blockquote>\n<p>I consider myself fortunate to have an existing audience willing to financially back my open source contributions. Because of my track record, I was able to put my own social capital on the line as collateral, to “guarantee” the project. <span class=\"pullquote alignright\">If you can’t name fifty people who would realistically fund your project, then you’ll need to have a substantial marketing budget (of time or money) to raise awareness.</span></p>\n<h4>Scope in open source is a double-edged sword</h4>\n<p>While I had an established objective for the Kickstarter, I didn’t have a clearly defined scope. This meant that some intermediate implementation details blocked later features. For instance, you can’t use <a href=\"https://github.com/wp-cli/restful\">RESTful WP-CLI</a> to manage menus, because the menu endpoints don’t yet exist in the WordPress REST API.</p>\n<p>At the same time, not having a super defined scope meant I could take the liberty to spend some of the time on what I thought was most useful. WP-CLI package management and the documentation portal essentially launched because I burned out working on the WordPress REST API.</p>\n<h4>Crowdfunding requires a certain type of personality</h4>\n<p>As far as honoring my commitments to my backers goes, I’d consider my Kickstarter a success. I did what I said I was going to do, on the schedule I communicated. I was able to do this, in part, because I’m a very meticulous person. I produce reasonably accurate estimates, keep track of how I spend my time, and over-communicate with stakeholders.</p>\n<p>If this doesn’t sound like you, then crowdfunding might not be a great fit. As a freelancer, you need to know in advance how the work will fit alongside client commitments. As a full-time employee, you need to make sure you&#8217;re capable of completing the project on nights and weekends.</p>\n<p><a href=\"https://poststatus.com/profiles/joshua-strebel/\">Josh Strebel</a>, to whom I&#8217;m thankful for a great deal of early feedback, thinks:</p>\n<blockquote><p>The open source community is primarily reputation based, WordPress especially. Getting a campaign funded on Kickstarter is about trust. Trust and reputation are shades of the same color so to speak. If you build a reputation of trust, launching and promoting a Kickstarter project should be fairly easy as your peers trust you to execute against your stated goals (their money is used for it’s stated intent and appears to achieve the desired outcome). I do not think you can reverse the order, the reputation in the community must be cultivated prior to seeking funds.</p></blockquote>\n<p>One huge challenge with a Kickstarter project is that you have to do all of the work after you receive the money, which can be really difficult for procrastinators. <span class=\"pullquote alignright\">You&#8217;re also faced with dozens of stakeholders to make happy, with your credibility and reputation on the line, so you need to make sure they’re regularly kept in the loop.</span></p>\n<h4>Most of what goes into open source isn’t very sexy</h4>\n<p>Contributing to open source isn’t just cranking out lines of code.</p>\n<p>I spent a huge amount of the funded WordPress REST API time on discussion, code review, and support. These maintenance tasks aren’t very appealing for crowdfunding, and probably wouldn’t make it very far as a part of a Kickstarter project. People want to fund sexy new features, not bug fixes, maintenance, documentation, etc.</p>\n<p>At the same time, this type of work is hugely expensive, and represents a substantial majority of the effort involved in maintaining an open source project.</p>\n<p>Fortunately, <a href=\"https://poststatus.com/profiles/josh-koenig/\">Josh Koenig</a> has a healthy understanding of where open source fits into his business:</p>\n<blockquote><p>We believe that open source software is a crucial part of the internet&#8217;s value proposition to humanity. However, at this stage in the development of our company, investments in open source have to be strategic. Any sustained contribution we make has to be justifiable in terms of hour it helps us improve our platform or grow our business.</p>\n<p>As such our primary code and sponsorship contributions tend to be down the stack, to projects or libraries that we depend on to run our platform. When it comes to WordPress or Drupal, we typically contribute in ways that will have the most impact for our core audience: professional developers. So that means tools and utilities like WP-CLI, Redis or Solr integration, diagnostic tools, etc.</p></blockquote>\n<h4>Simplicity means more time spent on the project</h4>\n<p>On the practical side, offering consulting-time rewards instead of physical swag helped me keep reward costs manageable. Only two-thirds of backers redeemed their rewards, so I spent a total of 41.25 hours on that part of the project.</p>\n<p>As it turns out, <a href=\"https://poststatus.com/profiles/jason-resnick/\">Jason Resnick</a> even appreciated the open-ended approach to rewards:</p>\n<blockquote><p>The best part of the project was the ability to choose my own path, so to speak. Kind of like those Choose Your Own Adventure books when you were a kid. WP-CLI can be used in so many different ways for different tasks, it was awesome to be able to just hop on a call with you and one or two other folks that also wanted to learn the same thing, and get the answers to the specific questions.</p></blockquote>\n<p>It also proved helpful to produce a landing page for the project with the overall goal, links to blog posts and milestones, and over-communication on how I was “spending” the money. In hindsight, I wish I had been more diligent about my progress updates and communication about what I was actually working on.</p>\n<p>My favorite production trick: I used HTML and CSS to produce a graphic in my browser, and took a screenshot of it &#8212; quite possibly the easiest way to create a Kickstarter header image, for you other non-designers.</p>\n<h3>Kickstarter is only the beginning</h3>\n<p>Kickstarter is an amazing platform for funding creativity. The next time I launch a crowdfunding project, I&#8217;ll make sure to:</p>\n<ul>\n<li>Get feedback on the idea from as many people as possible, as a way of generating interest and buy-in.</li>\n<li>Establish a project scope with features people want, while making sure there&#8217;s ample budget for the unglamorous work.</li>\n<li>Keep the rewards rewarding, and as simple to deliver as possible.</li>\n<li>Over-communicate progress, knowing I have hundreds of customers to make happy.</li>\n</ul>\n<p>In the case of WP-CLI, <a href=\"https://runcommand.io/\">runcommand</a> is my new company to pick up where Kickstarter leaves off.</p>\n<p>An increasing number of businesses use WP-CLI as a key part of their infrastructure. Right now, each business has to internalize much of the cost associated with creating WP-CLI-based features. For instance, many web hosts would benefit from offering a web browser interface for running WP-CLI commands. However, there isn&#8217;t yet a great way for them to collaborate and produce a common solution.</p>\n<p><a href=\"https://runcommand.io/\">runcommand</a> provides a platform for these businesses to <a href=\"https://runcommand.io/sparks/\">co-produce a shared open source roadmap</a>, and offload much of the burden of developing and maintaining infrastructural components.</p>\n<p>Thinking about using Kickstarter to fund your open source projects? Have questions about runcommand? I&#8217;d love to hear from you — <a href=\"mailto:daniel@runcommand.io\">daniel@runcommand.io</a> or <a href=\"https://twitter.com/danielbachhuber\">@danielbachhuber</a> on Twitter.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 02 Aug 2016 21:03:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"Daniel Bachhuber\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"Post Status: Scaling WordPress — Draft Podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=25850\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://poststatus.com/scaling-wp-draft/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2270:\"<p>Welcome to the Post Status <a href=\"https://poststatus.com/category/draft\">Draft podcast</a>, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>, <a href=\"https://play.google.com/music/m/Ih5egfxskgcec4qadr3f4zfpzzm?t=Post_Status__Draft_WordPress_Podcast\">Google Play</a>, <a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>, and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Post Status Draft is hosted by Joe Hoyle &#8212; the CTO of Human Made &#8212; and Brian Krogsgard.</p>\n<p><span>In this episode, Joe and Brian talk scaling WordPress, and what to do when you think you might’ve reached WordPress’s limits. From meta data, to users, to traffic management, they break down some of the most common scaling issues.</span></p>\n<a href=\"https://audio.simplecast.com/43493.mp3\">https://audio.simplecast.com/43493.mp3</a>\n<p><a href=\"http://audio.simplecast.com/43493.mp3\">Direct Download</a></p>\n<h3>Topics</h3>\n<ul>\n<li>Posts</li>\n<li>Meta</li>\n<li>Search</li>\n<li>Database</li>\n<li>Users</li>\n<li>Traffic (types of caching)</li>\n</ul>\n<h3>Links</h3>\n<ul>\n<li><a href=\"https://github.com/elastic/elasticsearch\">Elasticsearch</a></li>\n<li><a href=\"https://github.com/10up/ElasticPress\">ElasticPress</a></li>\n<li><a href=\"https://www.elastic.co/guide/en/elasticsearch/reference/current/query-dsl-mlt-query.html\">More Like This Query</a></li>\n<li><a href=\"https://github.com/alleyinteractive/es-wp-query\">Elasticsearch WP_Query</a></li>\n<li><a href=\"https://memcached.org/\">Memcached</a></li>\n<li><a href=\"http://redis.io/\">Redis</a></li>\n<li><a href=\"https://github.com/Rarst/fragment-cache\">Rarst Fragment Cache Plugin</a></li>\n<li><a href=\"https://github.com/humanmade/hm-fragment-cache\">Human Made Fragment Cache drop-in</a></li>\n</ul>\n<h3>Sponsor: iThemes</h3>\n<p><span><a href=\"https://ithemes.com/\">iThemes</a> has a full suite of excellent products to help you level up your WordPress website. From iThemes Security, to BackupBuddy’s new live backups, to Exchange for your next membership site, iThemes has you covered. Thanks to the team at iThemes being a Post Status partner!</span></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 29 Jul 2016 17:55:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Katie Richards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"WordPress.tv Blog: Matt Gibbs: Diving Into Commercial Plugin Development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.wordpress.tv/?p=544\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"http://blog.wordpress.tv/2016/07/28/matt-gibbs-diving-into-commercial-plugin-development/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1207:\"<p>Learn key takeaways from my running a plugin business. Matt Gibbs goes over how to determine whether your plugin idea can sell, how to set the price, deciding on the business model, whether to self-host, and handling support.</p>\n<div id=\"v-9NHU2NND-1\" class=\"video-player\">\n</div>\n<p><a href=\"http://slides.com/logikal16/deck#/\">Slides</a></p>\n<p>From <a href=\"https://wptv.wordpress.com/event/wordcamp-asheville-2016/\">WordCamp Asheville 2016</a></p>\n<p>More <a href=\"https://wordpress.tv/\">WordCamp videos</a></p><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptvblog.wordpress.com/544/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptvblog.wordpress.com/544/\" /></a> <img alt=\"\" border=\"0\" src=\"http://pixel.wp.com/b.gif?host=blog.wordpress.tv&blog=5310177&post=544&subd=wptvblog&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://blog.wordpress.tv/2016/07/28/matt-gibbs-diving-into-commercial-plugin-development/\"><img alt=\"Matt Gibbs: Diving Into Commercial Plugin Development\" src=\"http://videos.videopress.com/9NHU2NND/matt-gibbs-diving-into-commercial-plugin-development-wcavl-2016_std.original.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 28 Jul 2016 05:15:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Jerry Bates\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WPTavern: Cory Miller and Matt Danner Launch New Business Podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=57918\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://wptavern.com/cory-miller-and-matt-danner-launch-new-business-podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2723:\"<a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/03/podcast.jpg?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/03/podcast.jpg?resize=960%2C472&ssl=1\" alt=\"photo credit: Maciej Korsan\" class=\"size-full wp-image-52297\" /></a>photo credit: <a href=\"https://stocksnap.io/photo/IQVHQYS3GL\">Maciej Korsan</a>\n<p>WordPress professionals have demonstrated a decent appetite when it comes to listening to and supporting podcasts on <a href=\"http://iamdavidgray.com/best-wordpress-podcasts/\" target=\"_blank\">a wide variety of topics</a>, including industry news, development, e-commerce, marketing, and startups. Cory Miller, founder of <a href=\"https://ithemes.com/\" target=\"_blank\">iThemes</a>, and Matt Danner, the company&#8217;s COO, are adding a new business podcast to the mix with the launch of <a href=\"http://leader.team/\" target=\"_blank\">Leader.team</a>.</p>\n<p>The <a href=\"http://leader.team/episode-1-introductions-background-backstory/\" target=\"_blank\">first episode</a> introduces the hosts and the goals of the show and is now available on iTunes. Miller and Danner, who often have casual chats about business strategy, decided to start recording their conversations to share with others who might benefit from their mistakes and successes in entrepreneurship.</p>\n<p>&#8220;We&#8217;re going to talk about values, beliefs, philosophies, tools, all kinds of things that we have learned over the years, either accidentally or on purpose, about how to lead and manage teams and grow a business,&#8221; Miller said in the opening episode.</p>\n<p>Leader.team will feature a short (15-25 minute) episode twice a month on Thursdays with practical advice for leaders and managers. The second episode will be available tomorrow, and Miller and Danner have already outlined the topics for the next four episodes with questions that will guide the discussion on the show:</p>\n<ul>\n<li>The Beliefs, Values, Philosophies We Hold Dear</li>\n<li>The Culture We Cherish And Protect</li>\n<li>Finding, Recruiting and Hiring the Best People</li>\n<li>Leading a Hybrid Team of In-Office and Remote Team Members</li>\n</ul>\n<p>While Miller and Danner are not necessarily marketing the show as a WordPress-focused podcast, many of their shared experiences have come from growing one of the longest-running, successful product companies in the WordPress ecosystem. Upcoming episodes will feature big picture business topics that can be applied to many different types of industries. Leader.team episodes have been submitted to both iTunes and Google Play and will also be available on the show&#8217;s <a href=\"http://leader.team/\" target=\"_blank\">website</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 27 Jul 2016 22:19:49 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:108:\"WPTavern: WordPress for Android 5.6 Adds Screen to Invite New Users, Expands Reader to Include Related Posts\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=58328\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:118:\"https://wptavern.com/wordpress-for-android-5-6-adds-screen-to-invite-new-users-expands-reader-to-include-related-posts\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2114:\"<p><a href=\"https://apps.wordpress.com/2016/07/27/wordpress-for-android-version-5-6/\" target=\"_blank\">Version 5.6</a> of the WordPress for Android app was released today with expanded features for WordPress.com sites. The previous release <a href=\"https://wptavern.com/wordpress-for-android-5-5-debuts-new-visual-editor-adds-user-management\" target=\"_blank\">added user management capabilities</a> under a new ‘People’ menu and 5.6 introduces the ability to invite new users.</p>\n<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/07/invite-new-users.png?ssl=1\"><img src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/07/invite-new-users.png?resize=281%2C500&ssl=1\" alt=\"invite-new-users\" class=\"aligncenter size-large wp-image-58332\" /></a></p>\n<p>This release also adds a related posts section to posts found in the Reader. It appears directly underneath likes on posts and pulls in three related articles from the WordPress.com community of sites.</p>\n<p>Version 5.6 adds the ability to customize the notification sound for new activity from the WordPress app. A handful of other small changes are also included in 5.6, as detailed in the release post:</p>\n<ul>\n<li>Post list: Posts in the middle of being uploaded will be disabled and shown a progress indicator. A publish button is added on drafts.</li>\n<li>“View Site” and “View Admin” will now open the device browser.</li>\n<li>A comment is automatically approved when you reply to it.</li>\n</ul>\n<p>If you use the app to manage both WordPress.com and self-hosted sites, you will notice a growing discrepancy between the site management screens and options available for each. Self-hosted site owners still cannot use the app to manage themes or users, and the gap is widening for each release. Version 5.6 expands features for WordPress.com users, while the capabilities for self-hosted sites fall further behind. We have requested a comment from Automattic&#8217;s mobile engineers regarding the roadmap for managing self-hosted sites and will update when we receive a response.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 27 Jul 2016 20:19:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"WPTavern: IncludeWP: A Directory That Caters to WordPress Frameworks\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"https://wptavern.com?p=58222&preview_id=58222\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"https://wptavern.com/includewp-a-directory-that-caters-to-wordpress-frameworks\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3745:\"<p>Earlier this year, the WordPress plugin directory review team <a href=\"https://wptavern.com/the-wordpress-plugin-directory-will-no-longer-accept-frameworks\">reminded developers</a> that frameworks are not allowed in the directory. WordPress core doesn&#8217;t have a built-in way to support plugin dependencies which creates extra hassle for users.</p>\n<p>Seeing an opportunity, Vova Feldman, founder of Freemius, created <a href=\"https://includewp.com/\">IncludeWP</a>, a directory specifically catered to listing WordPress theme and plugin frameworks.</p>\n<img class=\"wp-image-58242 size-full\" src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/07/IncludeWPFrontpage.png?resize=1007%2C690&ssl=1\" alt=\"IncludeWPFrontpage.png\" />IncludeWP Front Page Displaying Theme and Plugin Frameworks\n<p>Frameworks are listed using their public GitHub repositories. Visitors can sort frameworks by stars, forks, issues, or name. Selecting a framework displays information including, how many sites it&#8217;s on and the number of plugins and themes hosted on the official directory that are using it.</p>\n<img class=\"wp-image-58259 size-full\" src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/07/IncludeWPSinglePageView.png?resize=1014%2C664&ssl=1\" alt=\"IncludeWPSinglePageView.png\" />IncludeWP Framework Single Page View\n<p>To identify which plugins and themes are used by frameworks, Feldman collaborated with Luca Fracassi of <a href=\"https://addendio.com\">Addendio</a>. &#8220;We realized that we can leverage the WordPress.org APIs and SVN to automatically identify plugins and themes associated with frameworks on WordPress.org,&#8221; Feldman said. &#8220;So we decided to join forces.&#8221;</p>\n<p>Fracassi developed a framework identification system and ran it against WordPress.org. The data was exposed via a custom API endpoint that allowed Feldman to display it on IncludeWP. &#8220;We leveraged Fracassi&#8217;s endpoint to fetch the plugins and themes data from WordPress.org and present it under the framework’s page,&#8221; Feldman said.</p>\n<p>Like the frameworks listed on IncludeWP, the code powering the site is open source and <a href=\"https://github.com/Freemius/IncludeWP\">available on GitHub</a>. &#8220;I’m preaching about code reusability,&#8221; Feldman said.</p>\n<p>&#8220;The least I can do is provide the option for other developers to reuse our code for their projects. By reusing this code base, everyone can easily create a similar category type listing mini-site for GitHub repos.&#8221;</p>\n<p>Developers interested in having their frameworks listed need to fork the <a href=\"https://github.com/Freemius/IncludeWP\">IncludeWP repository</a> on GitHub, add the framework as a .php in the src/frameworks folder, and submit a Pull Request. However, in order to be listed, frameworks must meet the following guidelines.</p>\n<ul>\n<li>The framework must be GPL Licensed.</li>\n<li>The framework must have a public repository on GitHub</li>\n<li>Complete each field in the src/frameworks area</li>\n<li>Add a reference to the plugin or theme&#8217;s slug if it&#8217;s hosted on WordPress.org</li>\n<li>Have a short description</li>\n</ul>\n<p>Feldman says he doesn&#8217;t plan on generating revenue through the site and considers IncludeWP as one of many contributions back to the WordPress community.</p>\n<p>IncludeWP is a great resource for developers whose frameworks are spread across GitHub who are looking for ways to generate more exposure. It&#8217;s also an excellent way to see what&#8217;s available in the WordPress ecosystem. Take a look around <a href=\"https://includewp.com/\">IncludeWP</a> and let us know what you think in the comments.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 27 Jul 2016 15:07:37 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"HeroPress: 16 Little Things That Grew Into Big Things (My Life in a Bunch of Words)\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1177\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"http://heropress.com/essays/16-little-things-grew-into-big-things/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:33897:\"<img width=\"960\" height=\"480\" src=\"http://heropress.com/wp-content/uploads/2016/07/072616-16-2-little-things-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pill quote:WordCamp was not a conference, it was a sharing of ideas. It was not a convention, it was a place to build actual relationships.\" /><p>I suppose I’ve always had the “entrepreneurial spirit.” My first taste of being in business likely occurred prior to this, but the first time I *remember* really enjoying building my own business was in the fifth grade.</p>\n<h3>Little Thing #1</h3>\n<p>For Christmas, I had gotten a new handheld electronic game. I suspect that most readers here will not remember these, but the one I had gotten was the race car game. It was a game with a button that slid only left and right, the goal to be to dodge the oncoming LEDs with the LED you controlled with the slider. It was a simple game but fun. I brought it to school and started charging people .25 per game to play. I averaged $9.00 a day. That’s a lot to a fifth grader. I learned about profit and expenses (batteries do, after all, cost money). I learned about friendly competition when a friend of mine and classmate brought his electronic handheld football game to school and charged .50 per game. I learned about volume sales (my game would last about a minute or two whereas the football game lasted substantially longer). I also learned about charging what the market would bear (I couldn’t get .50 per game but I could do .25 all day long). And lastly, I learned about “The Man” and how something that is going so well can go away in the blink of an eye when the school, after about a month of my enterprise, decided that these games were too much of a distraction to “real learning” and shut both myself and my competitor down.</p>\n<blockquote><p>Little did the school know that I learned more with my business experience in that short time than I did my whole fifth grade year</p></blockquote>\n<p>(it was my worst experience in elementary school, yet one of my most formative). When all was said and done, though, I had made a couple hundred dollars from a game that cost about $40 (which I hadn’t even paid for). Not a bad return.</p>\n<h3>Little Thing #2</h3>\n<p>In High School economics class, we learned how the stock market worked. We split the class into several groups and formed “corporations.” The members of these corporations then bought stock with real money. This money went to buy product that we would sell to the student body over a period of a couple weeks. I had been asked to be a member of the one corporation due to a previous simulation in which I had almost successfully beaten another team by coordinating an uprising against them (the other team was far more powerful) by secretly putting several of the smaller, less powerful teams together to try to take out the big team. It almost worked. Almost.</p>\n<p>This team asked me to be part of this new corporation because they were impressed. We decided that the thing we were going to sell to the student body was going to be candy. I invested $9.00 into the company. Of the members of this newly formed team, I invested the most. We talked about what types of candy to buy. It mostly involved peanut butter cups and skittles as I recall.</p>\n<p>I don’t remember what the other corporations sold. It didn’t matter. It was not true competition because we each were exclusive with our products. During breaks, lunch, and after school, we all had our tables set up in the quad and sold our goods. Our corporation slaughtered all the others. It wasn’t even close.</p>\n<p>At the end of it all, we determined the stock value based on costs of goods sold and profit left over. We sold our stocks for what they were worth. My $9.00 had turned into about $75.00 in the two weeks. I made, far and away, more money than anyone else in the class (and according to the teacher, more than anyone ever had in that simulation). Making money was easy, and it was what I was meant to do. Or so I thought.</p>\n<h3>Little Thing #3</h3>\n<p>Back to Fifth Grade. At the time, my best friend, Jack, had introduced me to Basic programming. My dad worked at a local University and as a result, the head of the Math &amp; Computing Department granted me a student account on the mainframe (their department was right across from my dad’s “Modern Languages” Department). It was here that I learned that a simple Basic statement such as “10 goto 10” could actually take down a campus-wide system as these mainframes were really not built to do multi-tasking. The joy of an endless loop. I hate to admit that there were times that I would laugh maniacally as other students in the lab would start literally banging their keyboards because nothing was happening. To all of you, I most humbly and heartily apologize. I was a jerk. I blame Jack.</p>\n<blockquote><p>None the less, I had been bitten by the programming bug.</p></blockquote>\n<p>I expanded my knowledge beyond causing others brain damage for fun and actually started to program useful things. My dad hired me at .50 an hour (which I’m pretty sure came out of his own pocket) and I worked on programs that would quiz his students. It’s also probable that he did it to keep me out of trouble.</p>\n<p>My brain wrapped itself around programming rather quickly and, as a general rule, every day after school, you’d find me back up in one of the University labs hacking away. It wasn’t a bad life. I liked it a lot. My favorite lab was the one right outside the server room. I got to know the students who kept the systems up. I remember when they got some new storage. I want to say it was a drive that could store 20 megabytes. It was literally as big (and heavy) as a washing machine. Oh. . . the good ol’ days.</p>\n<h3>Little Thing #4</h3>\n<p>I believe it was during the summer between Eighth Grade and Ninth Grade (circa 1980-81) that a representative from a company called Commodore came and demonstrated this great new personal computer. It was better than a TRS80 and far more affordable than the Apple ][. It had color and a whopping 5 KB of RAM. That is pretty impressive. All you needed to do was hook it up to your TV. I don’t remember what I paid for it, but I knew this was the machine for me, so I ponied up with my hard-earned money for the computer that looked like nothing more than a keyboard and a tape drive. Before I knew it (well . . . four to six weeks later), I was a programming fool from the comfort of my own home. I could get used to this. It was a few months later that I had saved up enough for a 300 baud modem (If you don’t know what 300 baud is, let me explain: It’s SLOW) and learned how I could hook up to my account at the college. It was my first taste of remote work and I knew that, one day, it was going to be the life I’d be living. The world would just have to catch up (ya, I was just a scosche cocky back then).</p>\n<p>A year later, I upgraded to a Commodore 64 and purchased my first Commodore 1541 5.25” floppy drive. I learned about sprite graphics and created a game based on the Saturday Night Live character, “Mr. Bill.” The game totally sucked, but suffice it to say, Mr. Bill died a LOT at the hands of Sluggo. A LOT.</p>\n<h3>Little Thing #5</h3>\n<p>Between my Junior and Senior years of high school, I was going to take a trip to Europe. I knew that Europe was no place to take my computers, and what I really needed was to make memories. I had always envied my sister’s camera and decided that it was time for me to dive into 35mm photography, so I sold my whole computer setup and purchased my first 35mm camera; a Canon AE1-Program with a couple of lenses and some books and accessories. I quickly learned how to actually use the thing and gained a basic understanding of the math behind the exposure you want. During that trip, I shot as many rolls of film as I could afford and discovered that maybe a life in photography was what I really wanted.</p>\n<p>I came back, my senior year, where I was the head photographer for the yearbook. I was rather proud of that yearbook and I put a lot of time and effort into it. So much so, that the yearbook staff felt obligated to give me an award. As mentioned earlier, in my younger years, I was sort of a jerk, so I cannot remember what the award was. At the time it meant a lot to me, though.</p>\n<p>I loved photography and I loved technology. If only there was some way to combine photography with technology. . . Maybe one day.</p>\n<h3>Little Thing #6</h3>\n<p>After high school, I went to about one semester of College. I say, “about,” because I think the only class I regularly attended was the photography class I was taking. I really enjoyed the class and the teacher. But most of all, I enjoyed the full access to the dark room where I was the head know-it-all and all the other students came to me for assistance. My ego was riding pretty high around that time.</p>\n<h3>Little Thing #7</h3>\n<p>After deciding to drop out of college (much to the chagrin of my dad &#8211; did I mention he was a University Professor?), I knew I needed to make money. I applied for (and got) a job with a company called Lifetouch National School Studios. Many of you might be familiar with this company. They specialize in school photography. I worked there for two school years, the first being an assistant and general runner and then the next year I did a lot of darkroom work. I was in my zone. I got to be good friends with a guy named Gene who was the world’s biggest Raiders fan and even got me a press pass a couple years later to shoot from the sidelines.</p>\n<blockquote><p>During that game, I met people like Howie Long, Bo Jackson and Bob Golic.</p></blockquote>\n<p>I also met James Garner who got to stand by the bench because, well, he was James Garner. Incidentally, he was exactly what you’d have expected him to be. Gene also introduced me to the world of Santa Claus mall photography; possibly the worst job I ever had. No, I was not the Santa. I was the photographer. The problem was never the kids. It was always the parents. You try telling parents that their kid is hysterical, will never calm down, and will never smile for Santa because he or she is scared to death of the man with the beard. Or, maybe, try to find something to clean up the pee on the floor because some parent made their kid wait in line for two hours while he had to go to the bathroom (usually the two hours was because of a number of the aforementioned parents living in their dreamland of a smiling child). Or, having a parent make you tell their child that Santa has gone home for the day (because the parents waited until after the mall closed before they decided to get in line). All true stories. Ya &#8211; I only did it one Christmas. Ironically, I lasted longer than most.</p>\n<h3>Little Thing #8</h3>\n<p>I quickly realized that I needed to be making more money and that commissioned sales was where I needed to be. I applied for (and got) a job at a company called Circuit City. They sold electronics of all sorts. I originally wanted to work in their Camera Department, only to discover that they didn’t have one. So, it was Small Electronics for me, where I quickly became Assistant Manager of the department.</p>\n<p>After cutting my teeth in electronics, I figured out that where I really wanted to be was in the Video Department. It’s where the money was. So I put in for a transfer and that’s where I got to be good friends with Gregg Franklin. Gregg and I forged a strong friendship and discovered that neither one of us ever really had a desire to work for “The Man,” so we decided to look for business opportunities. This was around 1987 or 1988.</p>\n<h3>Little Thing #9</h3>\n<p>In 1989, Gregg and I decided to venture off from Circuit City and we bought a little camera store for $10,000.00. It had been around for a while and, honestly, neither one of us did much due diligence. Had we done so, we would have discovered the reputation the owner of the store had. We spent the next two years working on re-branding, building up a local reputation of supporting schools and professional photographers in the area, and eventually became a reputable business in town. The local photographers would come and chat for hours on end with us and we became friends with many who remain our friends to this day. During this time, we built a darkroom and did a lot of custom work.</p>\n<p>Additionally, a friend from school had started his own company in which he built custom PCs. It was time for me to return to the world of computing, where, after purchasing an XT PC running MS-DOS 2.0 (I believe), and a piece of database software called Q&amp;A, I developed a fully operational Point of Sale system. It was my first foray into data mining. I had finally figured out a way to combine my love of photography with my love for computing. It wasn’t what I initially imagined, but it would do.</p>\n<p>During the time of the camera store, I also started my own WWIV BBS called “The Dragon’s Tavern”, a precursor to the Internet. It had software and games (can you say, “Global Thermal Nuclear War?). At one point, I was the only one in the area with a BBS and ONE GIG of storage space. Modem tech had advanced and I got myself a USRobotics 14.4 Courier HST modem. I was the king of the local BBS world. WWIV was an open source BBS platform and I spent a lot of time writing mods for it in Turbo C++. I met people from all over the world and spent hours on the phone with some of them as we worked through programming issues and ideas. It was my first experience with remote collaboration.</p>\n<p>The camera store lasted a couple of years, but we suffered a bit from trying to do too much too fast, along with a failing economy, and we realized that our model was not really sustainable. Rather than getting buried under a mountain of debt, we made the choice to shut the place down.</p>\n<p>From there Gregg and I tried our hands at a few things, the most significant being a sign company (we had actually been running it as a side business from the camera story for some time, to help bolster our income). To be honest, I didn’t like that job that much. Gregg got to have all the fun doing the creative work, then he, our alcoholic partner who showed us the ropes, and myself would go and install them. Vinyl cutting was fun and the tech behind it still fascinates me, but it didn’t take long for us to learn that we were not the right fit with the third partner, so Gregg and I split from him.</p>\n<h3>Little Thing #10</h3>\n<p>Fast forward a couple years. Gregg and I had been doing our own things separately for a while, trying to find our place in life. Owning and shutting down a couple of businesses does make you realize that you’re not as perfect as you think you are and may even be a bit of cause for some soul searching. I cannot speak for Gregg, but I know that for myself, that was the case.</p>\n<p>I was burnt out on photography.</p>\n<blockquote><p>Doing something for a couple of years for others and none for yourself sort of takes the passion out of it.</p></blockquote>\n<p>Running a free BBS was not exactly a business model that worked. I think it was around 1995 that I discovered Netcom. It was one of the first real internet providers. I bit. I was hooked. It was *like* a BBS but SO much more! The world had opened up to me and I saw my vision of one day becoming a remote worker come that much closer. Before long, a feeling had returned that I had not had in awhile: the desire to learn something new in technology. I wanted to gain an understanding of how the back end of this wondrous new tool worked. I knew it was the future, and it was within my grasp. It had been a while since I had been that excited about anything.</p>\n<p>It was then that Gregg and I reconnected. Gregg had told me that some other mutual friends of ours were about to embark on starting a regional Internet Service Provider, servicing schools and running a digital technology called ISDN. They had invested in the equipment but needed someone to run it. They had asked Gregg, and when I expressed interest, we formed a partnership and got to work. During this time, I learned about routers, IP traffic, DNS, collaboration with people on a global level, scalability, building departments and efficiently servicing customers through no more than email and a telephone connection. I learned about the value of good documentation and I learned how to deal with big, huge companies and their lawyers. I learned all of these things and yet, I wouldn’t say that any of those shaped my future and my life and business operating philosophy more than the epiphany I had once I hired our first employee.</p>\n<p>Until this point, I had always been about making money and a name for myself. It was ALWAYS about the money for me. Always. But I remember that moment like it was yesterday. That moment I looked at the empty desk of our first employee and realized that we were embarking on something great. We were building a company that would help sustain the lives of others and their families. If all went well, it wouldn’t be just a few. It would be many.</p>\n<blockquote><p>In the blink of an eye, it went from being about me and what I could take home, to being about them.</p></blockquote>\n<p>To being about us. All of us. That one moment changed everything for me.</p>\n<h3>Little (ok BIG) Thing #11</h3>\n<p>In 2003, my wife and I decided to move to Wisconsin from sunny Southern California. I was going to continue to work remotely with the ISP we had built up to over 40 employees and my wife Jessica was going to also work remotely with the Electronic Funds Transfer company she had worked to build up while in California (she was their first employee). Wisconsin was a nice break from the rat race of Southern California. We bought a house, set up our office and before I knew it, I discovered that the people back home at the ISP didn’t understand the concept of remote work. I was a shareholder of a company that had no use for me sitting a couple thousand miles away. Sure, from time to time they’d call me, but overall, out of sight meant out of mind where I was concerned.</p>\n<p>We moved to a pretty small town where we were happy to have high speed internet, but there was not a lot of demand for a network engineer or software programmer. I had, once again, found myself somewhat without a professional purpose.</p>\n<p>Soon after our first year there, we found out that Jessica was pregnant. Our main purpose in moving to Wisconsin was to start a family, but Jessica had always had issues carrying a pregnancy to full term. It was heartbreaking to deal with multiple miscarriages, but we had found a doctor in Green Bay (2.5 hours away) who thought he might be able to narrow down the issue. He was right, and nine months (and two weeks) later, we were introduced to our son, Eli. Hard to believe it’s been 11 years. And while I was struggling to find my place professionally, there was no doubt that I knew my place personally, as a father.</p>\n<blockquote><p>I was 38 and suddenly felt it was what I was meant to do.</p></blockquote>\n<p>I attempted to work for a local computer place during this time, but that simply didn’t take. I had, for a long time, said that employment may not be for me and certainly, in that situation, I was proven right. I am not, and never have been, a “Yes” man, I would tell people. I needed to reinvent myself and I needed to figure out my place.</p>\n<p>This time put a lot of strain on my marriage to Jessica. She was the main bread winner and while she was appreciative of the fact that I was really good with taking care of Eli and doing things around the house, she felt the pressures of being responsible for the family’s financial well-being. “Just find something &#8211; anything,” she’d say. She wanted me to find something that made me happy. She knew that while I loved being a father, I also felt the pressure to contribute to our stability. I struggled. A lot.</p>\n<h3>Little Thing #12</h3>\n<p>During the short time that I worked for the computer company, we moved again. This time, we bought the home of one of the city’s founders. It was on the river and while the place needed work, it was on about 3 acres of land and was a pretty nice place. I had my eye on the house next to it which was a big Victorian (and at one point, part of the same property). It was owned by a couple of empty-nesters and I knew that owning the house we had just purchased would put us in a prime position to buy it when it became available. It was my five year plan.</p>\n<p>Two years later, I was approached by our neighbor. We bought the house and moved in. We still had not been able to sell the first house that we bought and it was sitting empty. We were about to have two empty houses. I had been doing tech work as I could, but still was without a purpose. Fortunately, Jessica was still plugging away. Throughout it all, she was supportive of my desire to find something. I admit, there were those moments where I was just happy to be a dad (that’s my way of saying I might have gotten a little lazy looking for an income).</p>\n<p>In the new house for a bit, I was talking to one of my friends back in California. He was going through some pretty major life changes and was looking for his own purpose. I remember asking him what he’d like to do and he said that he enjoyed going to motorcycle swap meets, buying parts and then selling them on Ebay. And just like that, a business was born. He needed a new start. I needed something to do &#8211; a way to make money. And I knew Ebay and tech really well. It seemed like a match made in heaven.We moved him into the empty first house that we had and ran the business out of that house for a while. We made contacts and started buying larger and larger lots, liquidating them almost as fast as we were getting them. We were starting to make a little bit of money, but we kept turning that money into bigger lots, which meant we needed more storage, which meant it was time to get office space. Our specialty was Harley Davidson parts and it only took a short time for me to go from only knowing that most Harleys had two wheels to being able to identify the part, year and bike it came from; to know its value; and to have an idea on its demand. I became a tougher negotiator and walked away from a deal or two that just didn’t feel right. The biker world was definitely a world I never imagined myself within, but I certainly, for the first time in my professional life, actually felt like I was part of a community.</p>\n<p>Soon after we started that company, though, the company Jessica had been working for shut its doors, literally overnight. She was not making money, in an industry where there was no local demand, and I was trying to grow a company. For those wondering, that is not a sustainable personal financial model. The housing market crashed, and I was spending nights doing database patient record merging at the local hospital.</p>\n<blockquote><p>Before we knew it, we were flat broke. We literally lost almost everything.</p></blockquote>\n<p>The two empty houses were taken by the banks and we were just fighting to keep the house we were in. It was also about this time that Jessica announced that she was pregnant with Brenna. It was the only good news we had at the time. I was 42 and, for the first time in my adult life, had to actually go to my parents and ask for help. I honestly don’t know where I’d be today if I didn’t have them.</p>\n<p>The company we had was starting to see dwindling sales. When the economy crashes, people suddenly learn to live with that little ding in their gas tank or that other non-critical noise their bike may be making. Ebay started raising their fees and our business model became unsustainable.</p>\n<h3>Little Thing #13</h3>\n<p>With money quickly dwindling away in our bank account, I suddenly had this wonderful idea to start making money off of our competitors on Ebay. They had an affiliate program and I needed to figure out a way to leverage that. But how?</p>\n<blockquote><p>It was then that I discovered WordPress.</p></blockquote>\n<p>Like many, I had always thought of it as a blogging platform and nothing more. But then I discovered a plugin that would read in a feed from Ebay and worked within WordPress. It took me about an hour to set up a WordPress site and another minute to figure out how to install the plugin. The next two days was spent populating categories, and a little over a month later, I got my first direct deposit from Ebay. This could work. But even more importantly, for the first time, I saw that WordPress could be so much more than a blogging platform.</p>\n<p>It wasn’t much longer before I was starting to develop websites for others. My design skills have always lacked, so to start, it was mostly out of the box themes, but as I got more seasoned, I learned more and more about the power of WordPress.</p>\n<p>Eventually, we closed down the motorcycle liquidation business.</p>\n<blockquote><p>We tried our hand at running a Renaissance Faire booth (along with touring the country), but that, too, was not really sustainable.</p></blockquote>\n<p>I even drove a truck with staging equipment for Fox Sports a couple of times. Anything to pay the bills.</p>\n<h3>Little Thing #14</h3>\n<p>During one of my driving trips, I had been talking to Gregg. Turns out he had been doing WordPress development for a while and he was looking for some help. I was not a good designer, and I had barely dipped my feet into being a developer, but Gregg was willing to teach me everything he knew. Every morning, I’d wake up, Gregg and I would get on a call and he’d explain really cool ways to customize WordPress. We’d strip a theme down to the bones and build it up. We’d find frameworks and build them out. We’d bang our heads over CSS (something, I think, neither of us ever really were able to wrap our minds around), and we had work. Lots of work.</p>\n<blockquote><p>Though financially ruined, Jessica and I were finally starting to see some light.</p></blockquote>\n<p>I had finally found something I really liked and she had finally found herself with a position working for another company. We had lost all our homes except the one in which we lived and had depleted all our bank accounts and college funds, yet we were hopeful. We had our two kids, a roof over our heads and work which generated income.</p>\n<p>Most of the work Gregg and I did was working with agencies. We liked it that way. Neither of us really enjoyed pounding pavement, so it was nice to have people who specialized in sales do that part of the lifting. But despite the fact that we were getting busier, we knew that we needed to work on passive income possibilities.</p>\n<h3>Little Thing #15</h3>\n<p>In 2012, Gregg brought up the idea of me going to WordCamp San Diego. Now, I hate conferences and conventions. This sounded to me about as far from fun as I could get. He offered to pay for the badge if I paid for my plane ticket. Not knowing *really* what a WordCamp was, I figured it was a fair deal. It was only after I spoke with Jessica about going that I realized the cost of the ticket. I tell people that I still feel like I got the better end of the deal.</p>\n<blockquote><p>That trip to WordCamp San Diego changed everything for me.</p></blockquote>\n<p>I had always believed that businesses could succeed while also being part of a community that supported and built each other up. For the first time in my adult life, I got to witness it first hand. I had a blast! WordCamp was not a conference, it was a sharing of ideas. It was not a convention, it was a place to build actual relationships. It was a business event, educational event, and social event all in one package. I knew I was in the right place (finally).</p>\n<blockquote><p>44 years old and I finally found my place.</p></blockquote>\n<p>But how could I actively participate? Part of being in a community is that desire and need to give back. I was green and hardly knew anything.</p>\n<h3>Little Thing #15(a)</h3>\n<p>One of the people I met while in San Diego in 2012 was Stephen Carroll. He had developed this really cool tool called DesktopServer; a tool Gregg and I used almost every day during our development days. Gregg was having an issue with a site we were building and Stephen offered to help us figure it out. I was blown away that someone would give up their time so freely with no interest in remuneration. He just wanted to help. Stephen and I spoke a little bit, but he mostly focused on helping Gregg get through the issue he had. He was kind and generous, and I liked him immediately.</p>\n<h3>Little Thing #16</h3>\n<p>In 2013 Gregg and I were working together on a project and, as often happened, the conversation turned back to what we could do for some passive income. He and I came up with an idea for a theme we wanted to build. It would be unlike anything anyone had seen. Robust, clean code, efficient. In other words, it was a theme that was above our skill levels, over our heads, and somewhat out of reach. We needed a developer with a skill that far exceeded our own. Gregg said it: “We need someone like Stephen.”</p>\n<p>I totally agreed with Gregg and so the call was placed. Gregg was to get in touch with Steve and see if he’d be interested in helping us out. It was a good plan.</p>\n<p>An hour later, Gregg called me back to let me know the result of the conversation. Steve was, indeed, anxious to work with us (if pressed slightly, I think he would tell you that he was anxious to work with Gregg since he only really knew me through Facebook). But what he wanted was for US to help HIM at ServerPress. He wanted to simply code while we handled the rest. I contacted him directly to ask him some questions, set up a path for the company under the new structure and the rest, as they say, is history.</p>\n<hr class=\"ttfmake-hr\" />\n<p>This past June marked three years since we re-formed the company and it’s been a thrill ride to say the least. Since then, we’ve grown the company by over 400%, I’ve had the opportunity to travel the country and speak at several WordCamps (2014 saw me at over 20) and I actually look forward to Mondays every bit as much as I look forward to weekends. ServerPress, LLC is a company that’s respected within the WordPress Community, and it has afforded me the ability to help financially sustain my family.</p>\n<p>In 2013 Jessica, Eli, Brenna, and I moved to Milwaukee where we bought an older home (117 years) with the purpose of restoring it, building it out (and up), and fostering to adopt sibling groups (you can read about it on my blog, <a href=\"http://twotofive.us\">http://twotofive.us</a>).</p>\n<blockquote><p>We currently have six foster kids which puts us at a family of 10.</p></blockquote>\n<p>None of this would have been possible without all the little things, a couple of big things, and WordPress (the most important of which, is its Community).</p>\n<p>While we’re still digging ourselves out of the mess of a few years ago, that light is getting brighter every day.</p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: 16 Little Things That Grew Into Big Things (My Life in a Bunch of Words)\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=16%20Little%20Things%20That%20Grew%20Into%20Big%20Things%20%28My%20Life%20in%20a%20Bunch%20of%20Words%29&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2F16-little-things-grew-into-big-things%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: 16 Little Things That Grew Into Big Things (My Life in a Bunch of Words)\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2F16-little-things-grew-into-big-things%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2F16-little-things-grew-into-big-things%2F&title=16+Little+Things+That+Grew+Into+Big+Things+%28My+Life+in+a+Bunch+of+Words%29\" rel=\"nofollow\" target=\"_blank\" title=\"Share: 16 Little Things That Grew Into Big Things (My Life in a Bunch of Words)\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/16-little-things-grew-into-big-things/&media=http://heropress.com/wp-content/uploads/2016/07/072616-16-2-little-things-150x150.jpg&description=16 Little Things That Grew Into Big Things (My Life in a Bunch of Words)\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: 16 Little Things That Grew Into Big Things (My Life in a Bunch of Words)\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/16-little-things-grew-into-big-things/\" title=\"16 Little Things That Grew Into Big Things (My Life in a Bunch of Words)\"></a></div><p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/16-little-things-grew-into-big-things/\">16 Little Things That Grew Into Big Things (My Life in a Bunch of Words)</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 27 Jul 2016 12:00:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Marc Benzakein\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"WP Mobile Apps: WordPress for Android: Version 5.6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://apps.wordpress.com/?p=3488\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://apps.wordpress.com/2016/07/27/wordpress-for-android-version-5-6/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3187:\"<p>Hello WordPress users! <a href=\"https://play.google.com/store/apps/details?id=org.wordpress.android\" target=\"_blank\">Version 5.6 of the WordPress for Android app</a> is now available in the Google Play Store.</p>\n<h1 id=\"related-posts-in-the-reader\">Related Posts in the Reader</h1>\n<p><strong>Discover relevant work from the WordPress community.</strong> A section of related posts will now appear just underneath Likes on a post:</p>\n<p><img src=\"https://cldup.com/uI3GXFyyfOu/WFX8pk.png\" alt=\"Related Post Screenshot\" /></p>\n<h1 id=\"custom-notification-sound\">Custom Notification Sound</h1>\n<p><b>You&#8217;ve got activity!</b> With 5.6, you&#8217;ll be able to customize your notification sound:</p>\n<p><img src=\"https://cldup.com/uI3GXFyyfOu/LBsHX3.png\" alt=\"Custom Notification Sound\" /></p>\n<h1 id=\"invite-users\">Invite New Users</h1>\n<p><strong>A cordial invitation.</strong> Invite users to your site from the People management screen, designate their roles, and customize a message to send to them:</p>\n<p><img src=\"https://cldup.com/uI3GXFyyfOu/9fEtji.png\" alt=\"Invite Users\" /></p>\n<h1 id=\"other-changes\">Other Changes</h1>\n<p>Version 5.6 also comes with a few other changes and fixes:</p>\n<ul>\n<li>Post list: Posts in the middle of being uploaded will be disabled and shown a progress indicator. A publish button is added on drafts.</li>\n<li>&#8220;View Site&#8221; and &#8220;View Admin&#8221; will now open the device browser.</li>\n<li>A comment is automatically approved when you reply to it</li>\n</ul>\n<p>You can track our development progress for the next release by visiting <a href=\"https://github.com/wordpress-mobile/WordPress-Android/milestones/5.7\">our 5.7 milestone on GitHub</a>.</p>\n<h1>Beta</h1>\n<p>Do you like keeping up with what’s new in the app? Do you enjoy testing new stuff before anyone else? Our testers have access to beta versions with updates shipped directly through Google Play. The beta versions may have new features, new fixes — and possibly new bugs! Testers make it possible for us to improve the overall app experience, and offer us invaluable development feedback.</p>\n<p>Want to become a tester? <a href=\"https://play.google.com/apps/testing/org.wordpress.android\">Opt-in</a>!</p>\n<h1>Thank you</h1>\n<p>Thanks to our GitHub contributors: <a href=\"https://github.com/0nko\">@0nko</a>, <a href=\"https://github.com/aforcier\">@aforcier</a>, <a href=\"https://github.com/bummytime\">@bummytime</a>, <a href=\"https://github.com/daniloercoli\">@daniloercoli</a>, <a href=\"https://github.com/hypest\">@hypest</a>, <a href=\"https://github.com/khaykov\">@khaykov</a>, <a href=\"https://github.com/kwonye\">@kwonye</a>, <a href=\"https://github.com/maxme\">@maxme</a>, <a href=\"https://github.com/mzorz\">@mzorz</a>, <a href=\"https://github.com/nbradbury\">@nbradbury</a>, <a href=\"https://github.com/oguzkocer\">@oguzkocer</a>, <a href=\"https://github.com/theck13\">@theck13</a>, <a href=\"https://github.com/thomasleplus\">@thomasleplus</a> and <a href=\"https://github.com/tonyr59h\">@tonyr59h</a>.</p><img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=apps.wordpress.com&blog=108068616&post=3488&subd=apps&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 27 Jul 2016 06:51:53 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Maxime\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"WPTavern: Easily Hide WordPress’ Blogging Features With the Disable Blogging Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"https://wptavern.com?p=58111&preview_id=58111\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"https://wptavern.com/easily-hide-wordpress-blogging-features-with-the-disable-blogging-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2643:\"<p>WordPress strikes a good balance by offering users the ability to publish dynamic content via posts and static content via pages. However, if you&#8217;d like to use WordPress primarily as a static content management system without the features related to blogging, check out a new plugin developed by <a href=\"https://profiles.wordpress.org/factmaven/\">Fact Maven Corp</a>. and <a href=\"https://profiles.wordpress.org/ethanosullivan/\">Ethan Jinks O&#8217;Sullivan</a> called <a href=\"https://wordpress.org/plugins/disable-blogging/\">Disable Blogging</a>.</p>\n<p>Disable Blogging hides a number of features including:</p>\n<ul>\n<li>Posts, Comments, and items related to blogging from the admin menus.</li>\n<li>Comments from pages.</li>\n<li>Blog related widgets.</li>\n<li>Pingbacks, Trackbacks, and XML-RPC header links.</li>\n<li>Biographical info and Admin Color schemes on the user profile page.</li>\n<li>Press This Bookmarklet.</li>\n<li>Posts via email.</li>\n<li>Howdy, help tabs, and query strings from static resources.</li>\n</ul>\n<p>To really get a sense for what it&#8217;s like to use WordPress without its blogging capabilities, I activated the plugin on a fresh install.</p>\n<img class=\"alignnone size-full wp-image-58148\" src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/07/DisableBloggingOnFreshInstall.png?resize=1025%2C579&ssl=1\" alt=\"DisableBloggingOnFreshInstall\" />Disable Blogging Enabled on a Fresh Install\n<p>There are two things that immediately stand out during testing. The first is that logging in takes users to their profile page instead of the Dashboard. Second, the Dashboard and the link to it are gone.</p>\n<p>I found the removal of the Dashboard creates a jarring experience that&#8217;s different from what users might expect. It&#8217;s usefulness to display widgets with site specific information, even for sites based on pages, is a huge benefit and therefore, its removal should be reconsidered.</p>\n<p>The nice thing about Disable Blogging is that it doesn&#8217;t permanently remove features or data. Regaining access to WordPress&#8217; blogging capabilities is as simple as deactivating the plugin.</p>\n<p>Browsing, using, and navigating WordPress with the blogging features hidden is an interesting experience that I encourage you to try for yourself. I tested <a href=\"https://wordpress.org/plugins/disable-blogging/\">Disable Blogging </a>on a fresh install of WordPress 4.5.3 and didn&#8217;t encounter any problems. The next time you or a client wants an easy way to disable WordPress&#8217; blogging capabilities, give this plugin a shot.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 27 Jul 2016 02:27:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"WPTavern: TechCrunch Hacked by OurMine, Attackers Target Weak Passwords\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=58081\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"https://wptavern.com/techcrunch-hacked-by-ourmine-attackers-target-weak-passwords\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3051:\"<p>TechCrunch is the latest victim in OurMine&#8217;s summer hacking rampage. The site, which is powered by WordPress and hosted via WordPress.com VIP, was <a href=\"http://webcache.googleusercontent.com/search?q=cache:https://techcrunch.com/2016/07/26/ourmine-team-important-message/\" target=\"_blank\">hacked this morning</a> and defaced with a message from the attackers who identify themselves as an &#8220;elite hacker group.&#8221;</p>\n<p>TechCrunch&#8217;s news ticker was updated to display: &#8220;Hello guys it’s OurMine Team, we are just testing TechCrunch Security, don’t worry we never change your passwords. Please contact us.&#8221; OurMine gained access to a contributor account and posted a similar message.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/07/techcrunch-hacked-by-ourmine.png?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/07/techcrunch-hacked-by-ourmine.png?resize=1025%2C523&ssl=1\" alt=\"techcrunch-hacked-by-ourmine\" class=\"aligncenter size-full wp-image-58085\" /></a></p>\n<p>According to a <a href=\"https://www.engadget.com/2016/07/26/ourmine-techcrunch-compromise/\" target=\"_blank\">report from Engadget</a>, TechCrunch&#8217;s sister site, the hackers gained access via a contributor&#8217;s weak password, not by exploiting a vulnerability in WordPress or the site&#8217;s plugins. TechCrunch was able to regain control of the site within minutes and delete the content created by the attackers in the admin.</p>\n<p>OurMine is the same group that <a href=\"http://gizmodo.com/mark-zuckerberg-hacked-on-twitter-and-pinterest-because-1780735073\" target=\"_blank\">hacked Mark Zuckerberg&#8217;s Twitter, Pinterest, and LinkedIn accounts</a> after he used the same password for multiple sites. Bad password security can make even the most secure websites vulnerable to these types of attacks. Although OurMine is primarily targeting high profile individuals and publications, WordPress sites are constantly the target of brute force attacks.</p>\n<p>Security plugins like <a href=\"https://wordpress.org/plugins/wordfence/\" target=\"_blank\">Wordfence</a>, <a href=\"https://wordpress.org/plugins/better-wp-security/\" target=\"_blank\">iThemes Security</a>, and <a href=\"http://bruteprotect.com/\" target=\"_blank\">Jetpack&#8217;s Brute Protect module</a> can help deter brute force attacks, but it&#8217;s virtually impossible to eliminate the human factor in poor password selection or the practice of using the same password for multiple online services. WordPress site owners, especially those who run publications that have many users with permissions, are especially vulnerable to attacks that target bad password security.</p>\n<p>Although WordPress warns users about weak passwords, it doesn&#8217;t force them to create a strong one. Site owners who want to make this a requirement can use a plugin like <a href=\"https://wordpress.org/plugins/force-strong-passwords/\" target=\"_blank\">Force Strong Passwords</a> for extra security.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 26 Jul 2016 19:35:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"WPTavern: WooCommerce Releases Square Integration to Sync Online and Offline Purchases and Inventory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=58049\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:111:\"https://wptavern.com/woocommerce-releases-square-integration-to-sync-online-and-offline-purchases-and-inventory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3478:\"<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/07/woocommerce-logo.jpg?ssl=1\"><img src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/07/woocommerce-logo.jpg?resize=1025%2C466&ssl=1\" alt=\"woocommerce-logo\" class=\"aligncenter size-full wp-image-56606\" /></a></p>\n<p><a href=\"https://woocommerce.com/\" target=\"_blank\">WooCommerce</a>, which powers more than 37% of all online stores, announced today that the plugin now integrates with the millions of offline stores that use <a href=\"https://squareup.com/\" target=\"_blank\">Square</a> for payment processing. The new <a href=\"https://woocommerce.com/products/square/\" target=\"_blank\">Square for WooCommerce</a> extension tracks and syncs payments and inventory for products sold via online and offline stores.</p>\n<p>Before agreeing to work with Square on building an integration for WooCommerce inventory management, the Woo team verified customer demand via its ideas board where the feature <a href=\"http://ideas.woothemes.com/forums/133476-woocommerce/suggestions/3771433-integration-with-square\" target=\"_blank\">received more than 900 votes</a>. Prior to today&#8217;s extension release, those who managed stores in online and offline environments had to perform manual updates to ensure accuracy of the current inventory. Manually tracking inventory between stores is a tedious, never-ending task, especially for larger operations. This is why Square integration was the most-requested feature in WooCommerce history.</p>\n<p>After store owners connect a Square account to WooCommerce, they can perform a manual sync from WooCommerce to Square or back the other way. This will sync SKU&#8217;s, categories, details, and images for products that have been set up on either platform.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/07/square-woocommerce-sync.png?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/07/square-woocommerce-sync.png?resize=620%2C345&ssl=1\" alt=\"square-woocommerce-sync\" class=\"aligncenter size-full wp-image-58063\" /></a></p>\n<p>The ability to accept payments with WooCommerce using Square means store owners need only update products once and push changes to either store when ready to sell online or offline.</p>\n<p>&#8220;WooCommerce and Square have a close working relationship around this integration, where we&#8217;re working together to on-board new merchants, receive their feedback, and adjust the integration to make sure the initial version is the best it can be,&#8221; said Matt Cohen, product lead for WooCommerce.</p>\n<p>When asked if Automattic gets a percentage of Square&#8217;s fee based on the volume of sales it drives through its payment system, Cohen said that the companies have an agreement in place to promote the extension on WooCommerce.com and in Square&#8217;s catalog. He would not elaborate on the terms of the agreement. However, with WooCommerce powering more than a third of all online stores, it would be surprising if Automattic did not secure a custom volume rate.</p>\n<p>Square customers who want to automatically connect their online and offline stores can find the new <a href=\"https://woocommerce.com/products/square/\" target=\"_blank\">Square for WooCommerce</a> extension on WooCommerce.com. Current Square customers can use their existing account details to configure their stores to accept payments with Square and start syncing inventory.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 26 Jul 2016 14:39:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"WPTavern: Automattic Will Continue to Use React.js in Calypso Despite Patent Clause\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=58065\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"https://wptavern.com/automattic-will-continue-to-use-react-js-in-calypso-despite-patent-clause\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3234:\"<p><a href=\"https://developer.wordpress.com/calypso/\">Calypso</a> is an application <a href=\"https://ma.tt/2015/11/dance-to-calypso/\">developed by Automattic</a> that is built entirely with JavaScript using the <a href=\"https://nodejs.org/en/\">Node</a> and <a href=\"https://facebook.github.io/react/\">React</a> libraries. <a href=\"http://react-etc.net/\">React, etc</a>., a site that covers news related to the React library, recently <a href=\"http://react-etc.net/entry/your-license-to-use-react-js-can-be-revoked-if-you-compete-with-facebook\">published an article</a> highlighting how a license to use it in projects can be revoked.</p>\n<p>React contains a <a href=\"https://github.com/facebook/react/blob/master/PATENTS\">patent clause</a> that allows Facebook to revoke the license if certain conditions are met. The clause has raised concerns that Automattic could have its license revoked for Calypso if it competes directly with Facebook.</p>\n<p>Not long after the public release of Calypso, Paul D. Fernhout created <a href=\"https://github.com/Automattic/wp-calypso/issues/650#\">an issue</a> on the <a href=\"https://github.com/Automattic/wp-calypso\">project&#8217;s GitHub page</a>. Among a number of other reasons, Fernhout suggested that React be replaced with <a href=\"http://mithril.js.org/\">Mithril</a>, an alternative JavaScript library that doesn&#8217;t contain a clause.</p>\n<p>Paul Sieminski, General Legal Counsel for Automattic, <a href=\"https://github.com/Automattic/wp-calypso/issues/650#issuecomment-235086367\">responded to the ticket</a> explaining why the company will continue to use React in its products.</p>\n<p>&#8220;Automattic looked at the legal issues with Facebook&#8217;s patent license on React,&#8221; Sieminski said. &#8220;The termination provisions of the patent license aren’t ideal, but are not a blocker to using React as part of Calypso.&#8221;</p>\n<p>&#8220;The termination provisions don’t apply to the right to use the code &#8211; just the license included in the &#8216;PATENTS&#8217; file. This license gives React users permission to use Facebook&#8217;s patents on React. Facebook&#8217;s intentions in including this additional license are admirable. As they say <a href=\"https://code.facebook.com/posts/1639473982937255/updating-our-open-source-patent-grant/\">here</a> &#8211; &#8216;[t]his grant was designed to ensure that developers can use our projects with confidence.\'&#8221;</p>\n<p>According to Sieminski, &#8220;The companies with the greatest concern are those that have large patent portfolios and engage in offensive patent litigation, especially against Facebook.&#8221;</p>\n<p>&#8220;Automattic isn’t in that boat, and has no plans to be, so we’re comfortable using React under its current license,&#8221; he said.</p>\n<p>Considering <a href=\"http://www.vox.com/2014/5/9/5699960/this-court-decision-is-a-disaster-for-the-software-industry\">how complex patent laws are</a>, developers using React are encouraged to seek legal advice from a reputable lawyer to determine if your use case violates Facebook&#8217;s patent clause.</p>\n<p>Has the clause kept you from using React in your projects? Let us know in the comments.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 26 Jul 2016 08:05:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:11:\"\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"HeroPress: Defining Success\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://heropress.com/?p=1170\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"http://heropress.com/defining-success/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6404:\"<img width=\"960\" height=\"480\" src=\"http://heropress.com/wp-content/uploads/2016/07/072516-defining-sucess-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"You\'ll be happiest when you define success by the number of lives you touch for the better.\" /><p>When I first started HeroPress I assumed we&#8217;d get at <em>least</em> 1000 page views per day. How many WordPress developers are there in the world? Tens of thousands? Hundreds of thousands? What about bloggers? Users? Millions of them? Surely even a tiny tiny fraction of that would make for thousands of page views, right?</p>\n<p>I&#8217;m writing this on a warm Sunday afternoon in July. HeroPress operates on GMT, so we&#8217;re about 20 hours into the day. Want to know how many page views we&#8217;ve had so far today?</p>\n<p><img class=\"alignnone size-full wp-image-1171\" src=\"http://heropress.com/wp-content/uploads/2016/07/Selection_634.png\" alt=\"16\" width=\"178\" height=\"73\" /></p>\n<p>And that&#8217;s pretty average for a Sunday. Only once in the history of HeroPress have we had a 1000+ page view day. It was very exciting.</p>\n<p>There was a time when the (apparently) low traffic on HeroPress.com bothered me. I even thought about shutting it down a few times. Why bother if so few people read?</p>\n<p>The reason it bothered me is that I was measuring success by numbers. Page views, repeat visitors, even number of concurrent readers on a Wednesday . It was all about the numbers. How many people pull up the site in the browser? That&#8217;s what I wanted.</p>\n<h3>Shifting Perspectives</h3>\n<p>My perspective first started to shift when I went to WordCamp Pune. A young woman came up to me with tears in her eyes, shook my hand, whispered &#8220;Thank you&#8221; and slipped back into the crowd.  I didn&#8217;t see her again, but I&#8217;ll never forget her.</p>\n<p>People introduced themselves and told me their story with shining eyes, full of excitement.</p>\n<p>That trip was a huge boost for my spirits, but I still watched the numbers.</p>\n<h3>Stories That Need To Be Told</h3>\n<p>Typically I seek out HeroPress contributors. People rarely think their own story is interesting, I usually have to show them. In the months that followed Pune however, several people came to me and said &#8220;I have a story, and I really need to share it, can I share it on HeroPress?&#8221; So far I&#8217;ve accepted all of those, so you&#8217;ve read them.</p>\n<p>Their stories burned in their hearts, and they needed other people to know. To know there are people out there who want to help them learn, grow, and have a better life. That there are second, third, and fourth chances.</p>\n<p>Comments from people both on the site and in person let me know that it worked. People find hope in the essays. Not just happy feel-good, but actual hope, that maybe there&#8217;s something better out there for them too.</p>\n<h3>Casting a Wider Net</h3>\n<p>I recently visited WordCamp Europe in Vienna. I was truly surprised by how many people had heard of HeroPress, and even knew my name. Story after story came to me from a dozen different cultures about how HeroPress stories give people confidence to try new things, talk to people outside their culture, or try to use WordPress to make a better life.</p>\n<p>It was humbling to me to hear those individual stories. People whose lives had been been changed by their contact with our community, inspired by HeroPress essays.</p>\n<h3>Defining Success by Different Numbers</h3>\n<p>I still define success by numbers, but it&#8217;s not page views anymore. I&#8217;d be lying if I didn&#8217;t say it&#8217;s a little about stats, because countries matter to me. A wide net matters to me.</p>\n<p>The numbers I <em>really</em> watch these days are the number of people who tell me HeroPress means something to them. I don&#8217;t keep an actual tally, but as long as I keep hearing from even one person that they&#8217;ve been made better by what&#8217;s on this site I consider it a success.</p>\n<p>I don&#8217;t know if we&#8217;ll ever get huge readership, and at this point I&#8217;m not sure I care. What has HeroPress meant to you? I&#8217;d love to hear in the comments.</p>\n<h3>And You?</h3>\n<p>How do you define success in what you do? Is it number of sales? Number of support tickets answered? Page views?</p>\n<p>I&#8217;d like to suggest that you&#8217;ll be happiest when you define success by the number of lives you touch for the better.  Sure, that might be measured by a stat somewhere, but always remember the real value is in the sparkle in their eyes, and the joy in their hearts.</p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: Defining Success\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=Defining%20Success&via=heropress&url=http%3A%2F%2Fheropress.com%2Fdefining-success%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: Defining Success\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fdefining-success%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fdefining-success%2F&title=Defining+Success\" rel=\"nofollow\" target=\"_blank\" title=\"Share: Defining Success\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/defining-success/&media=http://heropress.com/wp-content/uploads/2016/07/072516-defining-sucess-150x150.jpg&description=Defining Success\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: Defining Success\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/defining-success/\" title=\"Defining Success\"></a></div><p>The post <a rel=\"nofollow\" href=\"http://heropress.com/defining-success/\">Defining Success</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 25 Jul 2016 00:28:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"HeroPress: How WordPress (literally) turned me into a brand new person\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1147\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"http://heropress.com/essays/wordpress-literally-turned-brand-new-person/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:35034:\"<img width=\"960\" height=\"480\" src=\"http://heropress.com/wp-content/uploads/2016/07/071916-new-person-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: It\'s fair to say that without the support of the WordPress community I wouldn\'t be the person I am today - literally.\" /><h3>In the beginning&#8230;</h3>\n<p>I&#8217;ve always been a geek. When I was in the third grade, I wanted to grow up to be an Egyptologist (or maybe a Marine Biologist; I changed my mind often). My dad built custom computers for a living, and early on, he taught me how to build and wire a computer from spare components.</p>\n<p>I built my first web page when I was eleven years old; basic HTML, tables for layout, animated GIFs, and all. My first true web site that actually had more than one page was a Star Trek: Voyager fan site. For that site, I learned how to use frames to make a site that looked like a Star Trek computer interface, and I found Javascript snippets that allowed me to change content in one frame when a new page loaded in another frame.</p>\n<p>As I learned more and more about the web, I was hooked. I started learning about PHP, and realized I could make header and footer files, so that I didn&#8217;t have to edit every web page on my site when I added a new page.</p>\n<h3>Discovering WordPress</h3>\n<p>And then, about 12 years ago, I installed WordPress for the first time. Blogging was this brand new thing that lots of other geeks were doing, and so I jumped on the bandwagon. I was 19 years old, living with my mom, working a low-paying job at a book store, and going to school part time. Ya know, basically living the dream.</p>\n<p>WordPress was just about a year old at this point. There were no plugins or themes; you hacked core if you wanted to change the look of your blog. It was like the Wild West.</p>\n<p>And I loved it.</p>\n<p>Really, I enjoyed the process of changing the layout of my blog, editing the &#8220;theme&#8221; to make it look how I wanted. I got more of a kick out of that, than I did actually writing about myself.</p>\n<p>Fast forward a few years; I left the book store I&#8217;d been working at behind, and started working as a Pharmacy Technician. I loved that job, but it was stressful. I got yelled at by patients when their doctor didn&#8217;t call in their prescription, and somehow it was my fault their copay went up when their insurance changed in the new year.</p>\n<blockquote><p>Blogging became sort of a catharsis; a way to vent when I got home about everything that stressed me out during the day.</p></blockquote>\n<p>It also helped me find community. I followed and commented on a ton of other pharmacy blogs. The pharmacy blogging community was, and still is, a really tight-knit group. I made friends in the WordPress Forums. I made friends from all over the world and all walks of life.</p>\n<p>In 2009, I moved here to New York, from where I&#8217;d grown up, in the Washington, DC area. I&#8217;d only been to New York a couple of times before; once on a school field trip, and once to see a comedy film at the Staten Island film festival.</p>\n<p>But I needed a change of scenery from the non-stop politics of the DC beltway, and after that trip to New York, I had decided that I wanted to move here.</p>\n<h3>My first WordCamp</h3>\n<a href=\"http://heropress.com/wp-content/uploads/2016/07/nyc.jpg\"><img class=\"size-medium wp-image-1165\" src=\"http://heropress.com/wp-content/uploads/2016/07/nyc-300x241.jpg\" alt=\"New York City, my home for a little over five years.\" width=\"300\" height=\"241\" /></a>New York City, my home for a little over five years.\n<p>Fairly soon after I got to New York, I learned that there was going to be this event called &#8220;WordCamp,&#8221; where you could spend two whole days learning about WordPress and meeting other people from the WordPress community. And tickets were only $40, including a t-shirt and lunch on both days!</p>\n<p>Now, I&#8217;d just moved to New York. I was working in a retail job, and I was renting a room in an apartment in Washington Heights (the upper end of Manhattan).</p>\n<blockquote><p>There were nights I ate popcorn for dinner because I didn&#8217;t get paid until Friday. I was lucky if I had ramen.</p></blockquote>\n<p>So, as you might imagine, even $40 for something like this was hard to come by.</p>\n<p>And then, I heard that if you volunteered at WordCamp, you could get a free ticket! For anybody  who knows me, it&#8217;ll come as no great shock that I spent most of the weekend volunteering. I&#8217;d only signed up to help with folding t-shirts the night before, and to help with registration on both mornings.</p>\n<p>But I ended up spending most of the event walking from room to room, making sure everything was running on time.</p>\n<p>By the end of Saturday, I was exhausted, but I was hooked.</p>\n<p>I&#8217;m an introvert; socializing doesn&#8217;t come easy for me. But volunteering at WordCamp gave me a purpose in talking to people. My common interest with other attendees made it easy to strike up conversation.</p>\n<p>After lunch on Sunday, my feet had finally given out, and I&#8217;d collapsed in a chair in our registration area.</p>\n<p>And finally, Sunday afternoon, as WordCamp was ending, and everybody was coming down from the high generated by all of the weekend&#8217;s excitement, I found out that there was going to be another WordCamp in Boston a couple of months later.</p>\n<p>For those two months, I scrimped and saved, begged and borrowed, every penny I could, and just barely managed to come up with enough to take the bus up to Boston for the weekend. I made even more friends, from even more places. They didn&#8217;t need any more volunteers, so I actually spent the weekend attending sessions!</p>\n<p>Over the course of that weekend, I found myself talking with people in the hallways a lot. And I guess I sounded like I knew what I was talking about, because a lot of those conversations involved me giving advice about people&#8217;s sites, what plugin to use to solve a problem, stuff like that.</p>\n<p>And I realized a couple of things:</p>\n<p>A. I knew way more about WordPress than I realized, and</p>\n<p>B. I really loved being able to help people.</p>\n<h3>Wanderlust</h3>\n<p>Over the next couple of years, I went to half a dozen WordCamps, in Philadelphia, Baltimore, Chicago, New York again.</p>\n<p>I became hooked on traveling. Every few months, I visited a new city for the first time. I used WordCamp as an excuse to visit my older brothers in Minneapolis. I volunteered or spoke at almost every WordCamp I went to. And I ended up becoming one of the lead organizers for WordCamp NYC in 2012 and 2014.</p>\n<p>By that time, I&#8217;d also moved on from working in a pharmacy to working at the Apple Store. I eventually moved to the Genius Bar, where, even though it wasn&#8217;t WordPress, I got to help people solve tech problems.</p>\n<p>It was a job I enjoyed a lot more, one that payed a decent amount better, and made it easier to travel to far off places&#8211;which at this point, I already knew I couldn&#8217;t get enough of.</p>\n<p><strong>I wanted to travel the world.</strong></p>\n<p>It became an obsession, really. I spent hours online reading stories about people traveling around, working odd jobs here and there to make their way from country to country. And then, I found out, since I was under 30, I was eligible for something called a &#8220;Working Holiday&#8221; visa in Australia. Basically, it lets you move there for up to a year and work to pay your way, with the only caveat being you could only work for the same company for up to 6 months.</p>\n<p>So again, I scrimped and I saved, and planned for over a year. The visa itself cost almost $500, but that was nothing compared to the total cost of picking up roots and moving halfway around the world. It certainly wasn&#8217;t cheap, but I was lucky enough to be in a position in life that allowed me to do it. For that whole year, I didn&#8217;t go out to the movies. I rarely ate out, even at fast food. Foolishly or not, I took some money out of my 401k, so that I&#8217;d have enough money to get me through until I could get set up down under.</p>\n<blockquote><p>And when I had enough money, I bought a one way ticket from New York to Australia.</p></blockquote>\n<p>My finger hovered over that &#8220;purchase&#8221; button for what seemed like hours, but was probably just a few minutes. After I clicked, a wave of emotion hit me like a tsunami:</p>\n<a href=\"http://heropress.com/wp-content/uploads/2016/07/fruitstand.jpg\"><img class=\"size-medium wp-image-1164\" src=\"http://heropress.com/wp-content/uploads/2016/07/fruitstand-300x225.jpg\" alt=\"I worked at the iconic glass cube on Fifth Avenue in New York (we often called it the Fruit Stand). This was taken on my last morning of work before setting off for the great unknown.\" width=\"300\" height=\"225\" /></a>I worked at the iconic glass cube on Fifth Avenue in New York (we often called it the Fruit Stand). This was taken on my last morning of work before setting off for the great unknown.\n<p>&#8220;Wow, I&#8217;m really doing this!&#8221;</p>\n<p>&#8220;Wait, am I really doing this?&#8221;</p>\n<p>&#8220;Oh, crap, I&#8217;m really doing this.&#8221;</p>\n<p>A few months later, I said goodbye to my job at the Apple Store. I&#8217;d worked there for nearly 4 years, and some of my coworkers were my closest friends. My last day was the iPhone 6 launch.</p>\n<p>Apple has a tradition of &#8220;clapping out&#8221; employees on their last day, and at the end of my final shift, I was no exception. My coworkers gathered in the hallway outside the backroom, cheered for me, hugged me&#8211;I was in tears. It really hadn&#8217;t hit me until this moment that I was leaving almost everything and everyone I knew behind.</p>\n<p>I did have a few stops on my way out of the country. I wanted to visit my family in Minnesota one more time before leaving. Also, WordCamp San Francisco, which I&#8217;d been asked to help run volunteers for, was happening a couple of weeks before I was due to leave. So I decided to spend a few weeks in California.</p>\n<h3>The first WordCamp that changed my life</h3>\n<p>Most of the people who ran WordCamp San Francisco worked at Automattic, the company that runs WordPress.com, Jetpack, Akismet, and more. And I&#8217;d been wanting to work for Automattic ever since my very first WordCamp, when I first met people who worked there.</p>\n<a href=\"http://heropress.com/wp-content/uploads/2016/07/wcsf.jpg\"><img class=\"size-medium wp-image-1166\" src=\"http://heropress.com/wp-content/uploads/2016/07/wcsf-300x227.jpg\" alt=\"I was too busy making sure everything was in place for volunteers at WCSF, but I did manage to take one photo during lunch.\" width=\"300\" height=\"227\" /></a>I was too busy making sure everything was in place for volunteers at WCSF, but I did manage to take one photo during lunch.\n<p>I arrived in San Francisco about a week before WordCamp, and spent the week working out of Automattic&#8217;s offices there, making sure everything was in place for the weekend. I got to talk to even more Automatticians, and since I was in charge of volunteers for the weekend, I got to boss a lot of them around.</p>\n<p>I had a rare opportunity to spend a lot of time with the people who worked there. An experience made even more rare by the fact that, since pretty much everybody at the company works from home&#8211;wherever that may be&#8211;it&#8217;s not very often that that many employees are in one place.</p>\n<p>By the end of the weekend, more than one of them encouraged me to submit an application to work for Automattic.</p>\n<blockquote><p>And I could feel in my bones that it was where I was supposed to be. So that very night, I polished up my resume, and sent it in by email.</p></blockquote>\n<p>But the application process takes time&#8211;WordCamp ended, and I had a plane to catch.</p>\n<h3>Out into the great unknown</h3>\n<p>Before I left the US altogether, I visited a few friends in San Diego, and even attended one last WordCamp&#8211;the smallest one to date, with only about 50 attendees&#8211;WordCamp Ventura. It was one last opportunity to see and make friends before leaving a continent behind.</p>\n<p>I boarded a plane at LAX at about 9:00 on a Tuesday night. I should have been exhausted, but I was so excited, I had energy to burn. Sitting there on the tarmac, waiting for takeoff, I reflected on how far I&#8217;d come, and how far I was about to go, and even though I had a 12-hour overnight flight ahead of me, I didn&#8217;t sleep a wink.</p>\n<p>As luck would have it, the best flight deal I could find from the US to Australia had a layover in Fiji, for just under 24 hours. When I booked the flight, I checked, and it turned out making the layover 5 days instead of one only added about $100 to the cost of the flight. I found accommodation at a hostel right on the beach for about $8/night, and that included a free ride to and from the airport.</p>\n<p>I was like &#8220;$150 side trip to Fiji for 5 days? Sign me up!&#8221;</p>\n<p>I got to the hostel about 6:00 in the morning, long before my bed was ready; check-in was normally at 1pm, I was told.</p>\n<blockquote><p>Being awake for 36 hours finally had caught up to me, so I collapsed in a hammock outside in the shade, and finally went to sleep.</p></blockquote>\n<a href=\"http://heropress.com/wp-content/uploads/2016/07/fijitime.png\"><img class=\"size-medium wp-image-1155\" src=\"http://heropress.com/wp-content/uploads/2016/07/fijitime-300x225.png\" alt=\"The view from the hammock I slept in while waiting for my bed to be ready.\" width=\"300\" height=\"225\" /></a>The view from the hammock I slept in while waiting for my bed to be ready.\n<p>They managed to get my bed ready a couple hours early, and so at 11:00, I dragged my feet and my suitcase over to the building I&#8217;d be sleeping in for the next few days, and slept until just after dusk.</p>\n<p>I spent the next few days lounging in hammocks, taking swims in the ocean, and exploring the tiny town of Nandi just outside of the airport. I took day tours, and spent an afternoon relaxing in mud baths, then getting a deep tissue massage that seemed to go on forever. One day, a bunch of people from the hostel took a bus all the way across the island&#8211;about a 2 hour journey&#8211;to watch a Rugby tournament that some of the hostel&#8217;s staff members were playing in. Our team didn&#8217;t win, but it was fun to watch, so we didn&#8217;t care.</p>\n<p>We spent the nights sitting around a fire, singing songs, and drinking Kava&#8211;a somewhat intoxicating drink that tasted like dirt, but made you happy and carefree.</p>\n<p>Those five days seemed like a lifetime, but they did finally end, and I had another plane to catch.</p>\n<h3>Back to reality</h3>\n<a href=\"http://heropress.com/wp-content/uploads/2016/07/operahouse.png\"><img class=\"size-medium wp-image-1157\" src=\"http://heropress.com/wp-content/uploads/2016/07/operahouse-300x225.png\" alt=\"When I first laid eyes on the Sydney Opera House, I stood in wonder for what felt like hours. \" width=\"300\" height=\"225\" /></a>When I first laid eyes on the Sydney Opera House, I stood in wonder for what felt like hours.\n<p>So, after one last flight, this one, mercifully only about 5 hours, I finally landed in Australia, Sydney to be exact. As corny as it sounds, I&#8217;d fallen in love with the city after watching Finding Nemo.</p>\n<p>I had spent so much time planning the &#8220;getting to Australia,&#8221; part of my journey, that I didn&#8217;t really have any solid plans for what to do after I got there.</p>\n<p>The first order of business was finding a long-term place to stay, and the second was finding a job.</p>\n<p>I had originally planned to transfer to an Apple Store in Sydney. But, as happens in large companies, I got caught in a quagmire of bureaucracy, and didn&#8217;t actually have a job waiting for me when I got to Australia. I met with managers at the store, and they were excited to have me come aboard, but there was a lot of red tape to get through.</p>\n<p>And so a couple of months went by, and my savings were rapidly depleting.</p>\n<blockquote><p>For a couple of weeks, just to pay my rent and buy some food, I spent hours every day as a street performer in one of the popular shopping areas in Sydney.</p></blockquote>\n<p>I&#8217;d gone to the Aussie equivalent of Best Buy, bought an amp and a microphone, and connected it all to my phone playing some Karaoke tracks.</p>\n<p>It was summertime, and just before Christmas, so there were lots of shoppers out and about, and in a giving mood. The Saturday before Christmas, I took in $300 in about 4 hours. It was really fun, and I made a lot of friends in other buskers, and some of our regular fans, but I couldn&#8217;t keep it up forever.</p>\n<h3>Finally, a paycheck&#8230;</h3>\n<p>Just as my savings were about to run out, and it looked like I might have to borrow money to head back to the States, I heard back from Apple. They wanted me to start working at the store in a couple of weeks. On that very same day, I got an email from Automattic. Over the previous few weeks, I&#8217;d interviewed with a hiring manager, and done a small project, and that day, they asked me to start a 6 week trial as a Happiness Engineer.</p>\n<p>I&#8217;d gone from having no jobs, singing on the street just so I wouldn&#8217;t be living on the street, to having two full time jobs at the same time, and raking in the dough.</p>\n<p>And so, I would wake up early in the morning, and spend a couple hours answering WordPress support tickets, then walk to the Apple Store and work a full 8 hour shift, and still come home and spend a few more hours working on tickets. I didn&#8217;t take a day off for over a month.</p>\n<p>But, six weeks into my trial, I found out I was going to be passed on to Automattic&#8217;s CEO&#8211; a guy you might have heard of, named Matt Mullenweg&#8211;for the final interview. I had to ping him every day to ask if he was available, and after about a week, we chatted for hours-six long, but engaging hours, about everything from Karaoke, to what books I liked, to my traveling around the world.</p>\n<blockquote><p>And at the end of the chat, Matt offered me the job. I would start full time at Automattic in a couple of weeks.</p></blockquote>\n<p>And so, I gave my notice at Apple, and to celebrate, in the long weekend I had before starting at Automattic, I took a trip to the Great Barrier Reef.</p>\n<a href=\"http://heropress.com/wp-content/uploads/2016/07/kangaroo.jpg\"><img class=\"size-medium wp-image-1156\" src=\"http://heropress.com/wp-content/uploads/2016/07/kangaroo-300x243.jpg\" alt=\"The kangaroos at the sanctuary were quite friendly! As long as you had food to offer them, anyway.\" width=\"300\" height=\"243\" /></a>The kangaroos at the sanctuary were quite friendly! As long as you had food to offer them, anyway.\n<p>I had to fly up to Brisbane, then take an all day tour bus to a town hear the coast. We stopped at tourist traps along the way, including a sanctuary for kangaroos, koalas, emus, and more. That evening, we finally got to a small coastal town, with a population of <em>maybe</em> a few hundred.</p>\n<p>The next day, the winds were too high on the seas for us to safely take a boat out. Instead, our tour guide took us to the top of a cliff overlooking the beach that night.</p>\n<p>There were no cities for miles around, and I saw the entirety of the Milky Way in the sky for the first time in my life. That had a profound effect on me; it really hit home just how insignificant we really are in the universe.</p>\n<p>The next day, we took a boat out to the reef, and I got to snorkel for a few hours. I did what Finding Nemo had made me want to do; watch see turtles play and look for &#8220;annemenenennones.&#8221;</p>\n<p>And I found Nemo!</p>\n<h3>On my own for the first time&#8230;</h3>\n<p>Once I got back to Sydney, it was time to buckle down, and get to work. I had to buy, then set up my new computer. I went through some more training, settled into a routine, and attended my team&#8217;s weekly chats, which were at midnight, thanks to the time zone difference.</p>\n<p>That didn&#8217;t stop me from exploring, though.</p>\n<a href=\"http://heropress.com/wp-content/uploads/2016/07/outback.jpg\"><img class=\"size-medium wp-image-1154\" src=\"http://heropress.com/wp-content/uploads/2016/07/outback-300x246.jpg\" alt=\"40,000 feet over the Australian outback, on my way to Bali, it seemed like I was over an alien planet.\" width=\"300\" height=\"246\" /></a>40,000 feet over the Australian outback, on my way to Bali, it seemed like I was over an alien planet.\n<p>Easter weekend, I took a side trip to Bali, Indonesia; flying there was actually cheaper than most destinations within Australia!</p>\n<p>I traveled inland to a small town near the center of the island named Ubud. And while I was there, I stayed in a treehouse (albeit, a treehouse with wifi and air conditioning).</p>\n<p>Every night, I got a full body oil massage for about $15 USD. I went to a monkey forest reserve, and spent hours playing with the monkeys. One even climbed up on my shoulder to grab a piece of fruit I was offering it.</p>\n<p>A month or so later, I went to a WordCamp in Brisbane. Since I could work from anywhere, I rented an AirBNB for the month there, and had an apartment all to myself, for the first time in my life.</p>\n<h3>A moment in crisis</h3>\n<p>It&#8217;s funny how living in a place by yourself is a completely different mentality from sharing one with family or roommates.</p>\n<p>What I didn&#8217;t know was just how much it would affect me.</p>\n<p>You see, I&#8217;d been struggling with something all my life; something I&#8217;d kept hidden from everybody around me, sometimes even from myself.</p>\n<p>Growing up, I always knew I was different somehow. It wasn&#8217;t until my teenage years that I was able to put a name to it, though.</p>\n<p>All my life, I was told I was a boy, by family, by friends, by society. I believed it, too. After all, if everyone calls you something for long enough, you tend to end up believing it&#8217;s true.</p>\n<p>But, in my heart, I knew I was different. I was really a girl.</p>\n<blockquote><p>I&#8217;d find out later that this was called being transgender.</p></blockquote>\n<p>Looking back, I can see signs that I wasn&#8217;t what everyone thought I was from my earliest memories, but it wasn&#8217;t until puberty hit that everything really started feeling wrong. My body wasn&#8217;t growing the way it was supposed to.</p>\n<p>The teen years are known for being a pressure-filled, anxiety-ridden period in anybody&#8217;s life.</p>\n<p>Mine was that way for the same reasons as most teenagers, but also because I had to hide who I really was. At the time, all I knew about trans people was what you saw on Maury and Jerry Springer, and the occasional transphobic jokes in TV shows and movies.</p>\n<p>I didn&#8217;t want to be one of those caricatures, so I buried my feelings deep down into myself, so that eventually, even I believed they weren&#8217;t real.</p>\n<p>But, every once in a while, they&#8217;d resurface. And I&#8217;d bury them back down because I was afraid. I was afraid that roommates would see me for the impostor that I felt like. Or that they&#8217;d be disgusted. I could never let my guard down.</p>\n<p>When I moved into that first apartment of my own, though, a couple of things happened:</p>\n<p>First, I was able to let my guard down. There was nobody around to worry about seeing me.</p>\n<p>More importantly, though, I came across a Facebook post of a former coworker who had transitioned earlier in the year.</p>\n<p>She&#8217;d originally made a big post on Facebook announcing that she was transitioning, but it happened during a time when I wasn&#8217;t really looking at Facebook, and by the time I was looking again, I had missed the post, and she had changed her name and profile image, so that I didn&#8217;t put two and two together.</p>\n<p>But in June, for the first time since transitioning (that I saw anyway), she posted a picture of herself. I practically did that double-take that they show in cartoons: &#8220;Is that who I think it is?&#8221;</p>\n<p>And so, I spent that evening reading back through all of her posts from the last six months. She talked about the feelings she&#8217;d had since she was a kid, and how she came to terms with them.</p>\n<blockquote><p>I sat there for hours, until the sun came up. At some point&#8211;I don&#8217;t know when&#8211;I started sobbing. Everything she was saying punched me in the gut like a prize-fighter.</p></blockquote>\n<p>These were the same feelings I&#8217;d suppressed all of these years&#8211;to a tee.</p>\n<p>I&#8217;ve heard before that when you&#8217;re transgender, before you can accept yourself and start to transition, two things need to happen:</p>\n<p>First, you need to realize you <strong>can</strong> do it.</p>\n<p>Then, you need to realize that <strong>you</strong> can do it.</p>\n<p>I already knew that it was possible to transition. Back when I worked in the pharmacy, I filled lots of hormone prescriptions for trans women.</p>\n<p>But reading my friend&#8217;s posts helped me realize that transitioning was something I could do. That I needed to do.</p>\n<p>I was in crisis mode. I was half a world away from everyone I knew, my family, my friends.</p>\n<p>I was scared. I wanted to go home, but I still had about four months to go until I came back to the US.</p>\n<h3>Starting a new journey, while already on another one</h3>\n<p>I wanted to go home early. Several times, I&#8217;d gone to booking sites, and held my finger over the purchase button with a different kind of trepidation than I&#8217;d had when I originally bought my ticket to Australia.</p>\n<p>But I&#8217;d already agreed to speak at a WordCamp in Pune, India in September, so if I went home early, it would mean cancelling that (and letting down one of my coworkers who&#8217;d worked hard to get me invited and approved to go in the first place).</p>\n<p>So, I carried on. I found a therapist that would talk with me online, to help me through all of the anxiety and depression I was going through. By the time we finished a couple of sessions, I was absolutely certain that transitioning was right for me.</p>\n<p>I muddled through the rest of my time abroad. I didn&#8217;t really go out much and explore the cities I had left to visit, though I did some. I&#8217;d started chatting with my friend whose posts had led to my own epiphany. Both she and the therapist I was talking to helped me through the worst of the homesickness.</p>\n<p>I kept working, and eventually, the trip to India came. I had a weekend in Pune, a month in Mumbai, then back home to the US. I enjoyed India a lot. I met a lot of people at WordCamp, who treated me like a rockstar for working at Automattic. And oh yeah, Topher (ya know, the guy who runs this site?) was there, too. <img src=\"https://s.w.org/images/core/emoji/2/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /></p>\n<h3>Finally back home</h3>\n<p>After those final few weeks in India, September 30th finally came, and I was glad to be heading back home to the US. I&#8217;d spent the last few months making plans, and one of them was to tell my family.</p>\n<a href=\"http://heropress.com/wp-content/uploads/2016/07/overgreenland.jpg\"><img class=\"size-medium wp-image-1162\" src=\"http://heropress.com/wp-content/uploads/2016/07/overgreenland-300x225.jpg\" alt=\"The view from the plane over Greenland, as I was finally on my way back home.\" width=\"300\" height=\"225\" /></a>The view from the plane over Greenland, as I was finally on my way back home.\n<p>After two 9.5 hour flights from Mumbai to Paris, then Paris to Minneapolis, I was home. I wanted to tell my family (who I knew would be supportive) right away.</p>\n<p>But every time I tried, my throat closed up and my eyes started to well up with tears.</p>\n<p>Once I told them, there would be (in my mind, anyway) no going back. It took a few days, but I ended up telling them one at a time&#8211;via text message, so that I could say everything I wanted to say without stumbling.</p>\n<p>Of course, my family accepted me for who I was, like I knew they would. But I still had to tell the rest of the world. So many people at work and in the WordPress community knew me already, so doing it under the radar wasn&#8217;t going to happen. And really, I&#8217;d spent my whole life hiding this part of me, and I didn&#8217;t want to hide anything any longer than I had to.</p>\n<p>So, I made another plan to tell my coworkers, my WordPress friends, then everybody else.</p>\n<h3>The second WordCamp that changed my life</h3>\n<p>As it turned out, WordCamp US was coming up in December, just about a week before my birthday. I thought that would be the perfect opportunity to tell a small group of people, just so they would have my back in case anybody acted like a jerk when I later posted online that I&#8217;d be changing my name.</p>\n<p>I&#8217;d already worked with my HR at work to come up with the right language for a blog post on our internal updates blog. And I would later use almost the same text when I posted to Facebook and my blog.</p>\n<p>So WordCamp came, and I pulled over the few people that I wanted to talk to, and started telling people.</p>\n<p>I told that small group of 5 during the community summit before WordCamp. Every single one of them told me they were happy for me, and thanked me for trusting them enough to tell them first.</p>\n<p>And so, that was that. I&#8217;d already scheduled the blog posts (both internal at work and my own blog) and the Facebook post to go out a few days after WordCamp.</p>\n<p>Or so I thought.</p>\n<blockquote><p>What I didn&#8217;t realize is just how much I&#8217;d missed my friends from the WordPress community.</p></blockquote>\n<p>I made new WP friends while traveling in Australia and India, for sure, but most of my friends were in Europe and the US, so WordCamp US was my first opportunity to see most of them.</p>\n<p>I saw people I hadn&#8217;t seen in over a year, sometimes longer, and I didn&#8217;t want to pretend with them anymore. And so, I started pulling them aside, one at a time.</p>\n<p>Every single one of them pretty much had the same three responses:</p>\n<p>&#8220;Congratulations on finally being able to be yourself,&#8221;</p>\n<p>&#8220;If you need to talk to someone, let me know,&#8221; and</p>\n<p>&#8220;If anybody gives you trouble, I&#8217;ll punch them.&#8221; (Thankfully that one didn&#8217;t become necessary.)</p>\n<p>Every time I told someone, and they reacted that way, I felt happier and happier. By the end of the weekend, when I&#8217;d planned to tell 5 people, I ended up telling several hundred; who knew I had that many WordPress friends?!</p>\n<p>The community I&#8217;d surrounded myself made me feel loved, and I knew what I was doing was right.</p>\n<p>A few days later, the blog and Facebook posts went out, and all of my friends and coworkers who weren&#8217;t at WordCamp finally knew.</p>\n<p>And I felt free.</p>\n<h3>And it&#8217;s all thanks to WordPress</h3>\n<p>Discovering WordPress opened up a whole new world for me. It started me on a whirlwind journey that nobody could&#8217;ve known where it would eventually take me.</p>\n<p>I look back at myself&#8211;when I started using WordPress&#8211;and I&#8217;m amazed. It&#8217;s hard to imagine that I was once that 19 year old kid, with a low paying job, living at home with a single parent, struggling to make ends meet, and just going through the motions of life without really living.</p>\n<p>Now, I&#8217;ve got an amazing job, friends and family that love me for who I am, and I can finally live my life without pretending to be someone I&#8217;m not.</p>\n<blockquote><p>Twelve years ago, I could never have imagined that I&#8217;d end up working for a company, and part of a community, that was full of so many accepting people. A community that placed a priority on making sure that all were welcome.</p></blockquote>\n<p>It&#8217;s fair to say that without the support of the WordPress community, I wouldn&#8217;t be the person I am today&#8211;literally.</p>\n<p>And to think it&#8217;s all because I started a blog over a decade ago.</p>\n<p><small>All photos in this post were taken by Amy Lane, and are licensed under a <a href=\"http://creativecommons.org/licenses/by-sa/4.0/\" rel=\"license\">Creative Commons Attribution-ShareAlike 4.0 International License</a>.</small></p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: How WordPress (literally) turned me into a brand new person\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=How%20WordPress%20%28literally%29%20turned%20me%20into%20a%20brand%20new%20person&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Fwordpress-literally-turned-brand-new-person%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: How WordPress (literally) turned me into a brand new person\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Fwordpress-literally-turned-brand-new-person%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Fwordpress-literally-turned-brand-new-person%2F&title=How+WordPress+%28literally%29+turned+me+into+a+brand+new+person\" rel=\"nofollow\" target=\"_blank\" title=\"Share: How WordPress (literally) turned me into a brand new person\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/wordpress-literally-turned-brand-new-person/&media=http://heropress.com/wp-content/uploads/2016/07/071916-new-person-150x150.jpg&description=How WordPress (literally) turned me into a brand new person\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: How WordPress (literally) turned me into a brand new person\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/wordpress-literally-turned-brand-new-person/\" title=\"How WordPress (literally) turned me into a brand new person\"></a></div><p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/wordpress-literally-turned-brand-new-person/\">How WordPress (literally) turned me into a brand new person</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 24 Jul 2016 20:45:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Amy Lane\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"HeroPress: How to Learn WordPress Without Doing It on Your Own\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1138\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://heropress.com/essays/learn-wordpress-without-doing-it-on-your-own/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9757:\"<img width=\"960\" height=\"480\" src=\"http://heropress.com/wp-content/uploads/2016/07/071316-following-your-dream-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pullquote: There\'s nothing that will spur you on more in life than following your dream\" /><p>Wait, what?</p>\n<p>Okay, the headline might be a bit confusing, but bear with me. It all makes sense, I promise.</p>\n<p>Let&#8217;s start somewhere else, though.</p>\n<p>Hi, I&#8217;m Madalin Milea, and I am a technology professional based out of Rennes, France. I&#8217;m self-employed, a WordPress enthusiast, collaborating with <a href=\"http://www.codeinwp.com/blog/\">CodeinWP</a> (one of the top blogs about WordPress), and a member of the support team at <a href=\"http://themeisle.com/\">ThemeIsle</a>. I also maintain my own blog at <a href=\"http://madalinm.com/\">M.Online</a>, writing about a variety of topics such as blogging, WordPress and programming.</p>\n<p><img class=\"alignnone size-large wp-image-644\" src=\"http://madalinm.com/wp-content/uploads/2016/06/Screen-Shot-2016-06-17-at-5.59.05-PM-1024x580.png\" alt=\"Screen Shot 2016-06-17 at 5.59.05 PM\" width=\"810\" height=\"459\" /></p>\n<p>But I didn&#8217;t start like that. I studied Management and Economics for three years. It seemed like a sensible option, but while I knew I was gaining some useful skills, I also wanted more. I had a feeling I wasn&#8217;t yet on the right track.</p>\n<p>So I went right back to square one and started out on a new path &#8211; programming; a field that had always had a magical allure for me, something I&#8217;d always dreamed of doing but never thought possible.</p>\n<p>I obviously needed to learn a lot about WordPress, programming, and all things related before I could collaborate with companies like ThemeIsle, or before anyone would even hire me as a freelancer, for that matter.</p>\n<p>So how do you do that? How do you go from studying Economics and being a phone center technician (which I used to do), to a WordPress developer?</p>\n<p>Well, WordPress and programming in general are very interesting fields. First off, the way &#8220;mastering those fields&#8221; works is unheard of when compared to other fields. For example, if you want to be a doctor, you have no way of obtaining the necessary education on your own, through blog posts or whatever. You need to go to school. With programming, you very well <em>can</em> be self-taught, right from the start, all the way to being an expert.</p>\n<p>But maybe this is not the best path to take after all&#8230; Maybe you&#8217;re better off not learning everything all on your own? I mean, I found the amount of info available out there on the web rather overwhelming. There&#8217;s just soooo much stuff. Where does one start?</p>\n<h2>How to begin pursuing a new skill</h2>\n<p>I, for instance, decided to look for some online courses that could help me learn in a more easy-to-grasp way. So, after several hours of searching, I stumbled upon some <a href=\"https://www.udemy.com/\">Udemy</a> courses on sale over at <a href=\"https://deals.creativebloq.com/\">Creative Bloq Deals</a>.</p>\n<p>At first, they seemed interesting, but after a few days, I felt quite discouraged. It all seemed too complicated, I thought I&#8217;d never manage to learn anything. For a moment, I worried that I would never become a programmer. But I&#8217;m certainly not the one to give up easily, so I asked around for other ideas.</p>\n<p>One <a href=\"http://ionutn.com/\">friend of mine</a> recommended the <a href=\"https://teamtreehouse.com/\">Treehouse</a> courses and told me that there&#8217;s two weeks of free trial available (with full access). That seemed fair enough, so I gave it a go.</p>\n<p>Long story short, it turned out to be a brilliant decision, and looking back, perhaps one of the best career decisions I&#8217;ve ever made. After only two weeks, I was already fascinated by the courses and the team running them.</p>\n<p>It was during this time that I found my enthusiasm for WordPress and developed my skills. The Treehouse course structure really made things easy to follow. I was really taken with the whole experience.</p>\n<p>In just one year, I&#8217;ve learned PHP, JavaScript, CSS, and HTML. This has helped me to grow my new career as a freelancer, and allowed me to feel comfortable with things like creating themes, websites, and even plugins. This gives me a great feeling of satisfaction.</p>\n<p>In hindsight, I could have started with random free info that&#8217;s available on countless websites, but it wouldn&#8217;t have given me a natural step-by-step progression that a structured course does.</p>\n<p>So my message is this:</p>\n<blockquote><p>Even if you set out to learn a new skill on your own, you don&#8217;t actually need to be on your own the whole time.</p></blockquote>\n<p>Get guidance from someone or someplace that really knows what they&#8217;re doing!</p>\n<p>And please don&#8217;t get me wrong, I&#8217;m not saying that Udemy courses aren&#8217;t any good, but in my case, Treehouse has just turned out to be perfect, considering my newbie level. I want to thank the team (especially Zac Gordon and Nick Pettit, my favorite teachers) for their wonderful work.</p>\n<h2>&#8220;Can I make the move?&#8221;</h2>\n<p>You might be at that point when you just can&#8217;t decide what you want to do with your life, or maybe all your previous ideas or your parents&#8217; ideas don&#8217;t seem all that exciting anymore.</p>\n<p>That&#8217;s alright.</p>\n<p>You can always pivot. <em>Change</em> really isn&#8217;t as hard as you might think if you&#8217;re motivated and hard working. There&#8217;s nothing that will spur you on more in life than following your dream. Whether you&#8217;d love to be a web developer, write mobile apps, computer games or start your own award winning blog, you can do it.</p>\n<p>There are so many resources out there, some you pay for, but many are free. You can easily find a wealth of knowledge or even just people willing to share their expertise.</p>\n<p>Once you find the right route for you, like I did, you&#8217;ll be full of motivation, and it&#8217;s this motivation that will get you there. The thought of a new career doing what you love will inspire you to put in a couple of hours each evening after work mastering a new skill.</p>\n<p>Over the years I&#8217;ve learned a lot. These days, my areas of expertise include WordPress development, team management, programming and SEO. It&#8217;s my desire to learn more that has always pushed me forward. Every day, I expand my knowledge and hone my skills as a problem solver and effective developer.</p>\n<p>You always have to remember that nothing is easy, but when you overcome obstacles, you get a huge sense of achievement. For me, it&#8217;s so frustrating when I just can&#8217;t understand something. It would be easy to give up and think it&#8217;s simply beyond me, but if you persevere, the sense of achievement when you have that &#8220;A-ha!&#8221; moment is incredible. Just in the last year, I gained a set of skills that seemed pretty much impossible to me before.</p>\n<p>So again, whatever skill you want to master, don&#8217;t set out to do it on your own. Find quality sources of information, and don&#8217;t stop until you stumble upon something that fits.</p>\n<p><strong>What&#8217;s your dream career? Have you taken the first steps to make it a reality?</strong></p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: How to Learn WordPress Without Doing It on Your Own\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=How%20to%20Learn%20WordPress%20Without%20Doing%20It%20on%20Your%20Own&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Flearn-wordpress-without-doing-it-on-your-own%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: How to Learn WordPress Without Doing It on Your Own\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Flearn-wordpress-without-doing-it-on-your-own%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Flearn-wordpress-without-doing-it-on-your-own%2F&title=How+to+Learn+WordPress+Without+Doing+It+on+Your+Own\" rel=\"nofollow\" target=\"_blank\" title=\"Share: How to Learn WordPress Without Doing It on Your Own\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/learn-wordpress-without-doing-it-on-your-own/&media=http://heropress.com/wp-content/uploads/2016/07/071316-following-your-dream-150x150.jpg&description=How to Learn WordPress Without Doing It on Your Own\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: How to Learn WordPress Without Doing It on Your Own\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/learn-wordpress-without-doing-it-on-your-own/\" title=\"How to Learn WordPress Without Doing It on Your Own\"></a></div><p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/learn-wordpress-without-doing-it-on-your-own/\">How to Learn WordPress Without Doing It on Your Own</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 24 Jul 2016 20:45:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Madalin Milea\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"HeroPress: Making Family\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1101\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"http://heropress.com/essays/making-family/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:19284:\"<img width=\"960\" height=\"480\" src=\"http://heropress.com/wp-content/uploads/2016/07/070615-family-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pullquote: The longer we\'re a part of the WordPress community the more I realize we\'re not making friends, we\'re making family.\" /><p>It&#8217;s not uncommon for me to ask someone to write a HeroPress essay and have them respond with &#8220;Why me? I&#8217;m not really on the periphery of anything. WordPress didn&#8217;t really help me overcome any hardship&#8221;. Almost every time I help them realize what an impact WordPress has made on their life, and how it has enabled them.</p>\n<p>It took me quite a while to walk that path myself. I was a web developer for 15 years before I started working with WordPress, and if I hadn&#8217;t found WordPress I&#8217;d still be a web developer, and making a good happy living.</p>\n<p>While WordPress as a technology made my career more pleasant, and certainly easier, the thing that has changed my life, and the life of my family, is unquestionably the WordPress community.</p>\n<h3>Who I Am</h3>\n<p>Another common requirement for writing a HeroPress essay is that you need to write to an audience. Who is this message for? This essay is for people like me. Read on and see if you&#8217;re like me.</p>\n<p>People call me Topher, and for the new folks, I manage this little site. I&#8217;ve often said that everyone is on the periphery of something. I don&#8217;t <em>feel</em> like I&#8217;m on the periphery of anything. I&#8217;m an educated white American man. That right there puts me smack in the middle of most things. But if I had to pick something a little different I&#8217;d have to say it&#8217;s the way I was brought up.</p>\n<a href=\"http://heropress.com/wp-content/uploads/2016/07/topher_homestead.jpg\"><img class=\"wp-image-1104\" src=\"http://heropress.com/wp-content/uploads/2016/07/topher_homestead.jpg\" alt=\"Photo of the foundation of a house with a trailer next to it in a clearing in the forest.\" width=\"400\" height=\"267\" /></a>The shed we started in is in the top right, then we stayed in that trailer for a summer. The largest thing is the foundation of the house.\n<p>In 1979 my parents sold almost everything they had and moved 100 miles north. They bought a little plot of forest in the middle of a very large plot of forest and put up a tent and we moved in. Then we built a little shed, and my dad, my uncle, and I moved into that while mom and my sisters moved back to the city for a few months. We cleared the land and started building a house.</p>\n<p>When it came time to hook up to the electrical grid we were told it would be $20,000 for the hookup. That&#8217;s nearly $70,000 at today&#8217;s rate. My dad simply said no. We didn&#8217;t get connected to the electrical grid for another 15 years.</p>\n<p>If you&#8217;d like to read more of that story <a href=\"https://topher1kenobe.com/category/my-story/\">I did a nice long series on my own blog</a>.</p>\n<h3>How I Got Here</h3>\n<p>I taught myself to type in high school because it was way better than writing all that stuff by hand. When I got to college and it came time to write a paper I found that the library had a typewriter I could use.  It was an old IBM Selectric with a little motor that spun and hummed the end entire time.</p>\n<p>One day a guy said to me &#8220;Why don&#8217;t you use The Computer?&#8221;.</p>\n<p>&#8220;We have a computer?&#8221; I asked.  He showed me where the IBM 286 with WordPerfect was and I spent about a week learning everything I could about it. Soon I was typing papers for other people at a penny a word. That&#8217;s about $2 a page.</p>\n<p>Then one day someone donated a new computer to the college.  It was a Microsoft Xenix server, with 5 dumb terminals. <em>Five</em> people could use it at the same time! It also had something called &#8220;email&#8221;.  It wasn&#8217;t on any network, so we could only email people in that room. But we loved it. Everyone swapped emails.</p>\n<p>Fast forward a couple years and I went to a different school which ALSO had a server. This one was a giant VAX/VMS system. The machine was about the size of an old Volkswagen bug. There were terminals all over campus. You could send an electronic message to someone who was almost a mile away! It was amazing, and I was enthralled.</p>\n<p>In my 4th year of college I was told that we could soon be connected to The Internet. I&#8217;d never heard of that, so I started learning. I found out that it would be just like what we had, but we could send emails to other schools! And people all over the world. It was AMAZING.</p>\n<p>To try to keep a long story short(er) I moved through telnet, <a href=\"https://en.wikipedia.org/wiki/Gopher_(protocol)\">Gopher</a>, and finally the web.</p>\n<p>One day a friend came to me and said &#8220;Hey, look what I made!&#8221;.  It was a web page. With his own content on it! He said &#8220;It&#8217;s really easy, you should try it!&#8221; I told him no, it looked far too complicated. He said it really wasn&#8217;t, and showed me.</p>\n<p>That afternoon I learned every HTML tag there was. All 40 of them. And I started making web pages. Page after page. I made lists of interesting websites, and connected them all together. I built an unofficial website for my college. I joined the local Freenet, even though I didn&#8217;t have a computer of my own, and started building pages for them, for my city. It became an obsession.</p>\n<p>Eventually I talked the college into paying me to build them a real website. Here&#8217;s a screenshot:</p>\n<p><img class=\"aligncenter size-full wp-image-1106\" src=\"http://heropress.com/wp-content/uploads/2016/07/cornerstone_college_website_lynx.png\" alt=\"Screenshot of Cornerstone College\'s web site in Lynx in a terminal window,\" width=\"484\" height=\"316\" /></p>\n<h3>Leveling Up</h3>\n<p>After college I took a 6 month contract building an intranet website for Kellogg&#8217;s (the cereal people). It was their first internal website, and I had to make sure there was backward compatability for Netscape 1.0. It was still all plain HTML though.  CSS hadn&#8217;t been invented yet.  If there was back-end scripting to be done it was CGI in perl.</p>\n<p>Fast forward to 1998 and I was working in my office with some co-workers and one of our designers came into the room. He said &#8220;I have a contract to build a site for a realtor, but I need someone who knows PHP&#8221;. No-one said anything, so I said &#8220;I&#8217;ll do it!&#8221;.</p>\n<blockquote><p>That night I went home and learned PHP.</p></blockquote>\n<p>I built the site and got paid. Let&#8217;s just say I&#8217;m glad it&#8217;s not around anymore.</p>\n<p>I started taking more PHP jobs, getting better and better. A new thing became popular on the web called &#8220;web logging&#8221;, basically keeping a journal on the web.  People soon shortened it to &#8220;blogging&#8221;, which confused all the old people.</p>\n<p>I tried some blog software, but it was crazy hard to set up. One platform even required an Apache module of its own. I decided blogging wasn&#8217;t for me, and probably wouldn&#8217;t be going very far.</p>\n<h3>Enter WordPress</h3>\n<p>In 2003 I was working as a PHP/MySQL developer at a radio station attached to a college (the very same at which I started so long ago). I was teaching a class called <em>Intro To Web Development</em>. I&#8217;d recently heard about WordPress and tried it out. I wasn&#8217;t very impressed. I could build that. I required each student to have a project for the year, and I took one for myself. Build something better than WordPress.</p>\n<p>What I came up with wasn&#8217;t better than WordPress, but it was good enough that I used it as my main blogging software for 10 years. Looking back, I really wish I had become involved in the community then. Where would I be now?</p>\n<h3>Spinning Off Into Chaos</h3>\n<p>In 2010 I had been doing side work non-stop for several years. I did the math and realized that I was wasting a LOT of time and money going to my day job every day. Literally tens of thousands of dollars being lost by going there 5 days a week.</p>\n<p>I quit.</p>\n<p>I went freelance and the work poured in. I took a contract that used WordPress and was pretty impressed by its blogging abilities. It was still a chore to make any other kind of site with it, but I was able to bend it to my will. I loved that WordPress took care of permissions and user management for me. I quickly found out that most of the &#8220;WordPress developers&#8221; out there didn&#8217;t really know PHP. I had a huge advantage.</p>\n<p>I used WordPress occasionally until 3.0 came out.  <strong>Everything changed</strong>.</p>\n<p>Custom Post Types made practically anything possible! It was literally breathtaking. I hadn&#8217;t been so excited since the early days of web development, when a new browser version meant major new web technology.</p>\n<p>Everything in my life began to change rapidly as well. I went from freelancing to being CTO in a startup to being a WordPress VIP developer at a major agency to trying something cool (HeroPress) to writing documentation. 5 different job changes in 6 years. <a href=\"http://catewerks.com/our-jump-to-freelancing/\">It was pretty stressful for my family</a>.</p>\n<p>There was something consistent through most of the last 6 years though.</p>\n<h3>You</h3>\n<p>My first experience with The Community was when I went looking for a Theme Framework.  I found Startbox, by a guy named Brian Richards. I found out he lived only a few miles from my house! He answered SO MANY QUESTIONS. I wouldn&#8217;t be the WordPress developer I am today without him.</p>\n<p>We formed a local WordPress meetup, and one of the first things he said was &#8220;We need a WordCamp&#8221;. What&#8217;s a WordCamp? He told me all about it and said he wanted to pull one together in only 4 months.  I thought he was CRAZY, but sure enough he did it, and <a href=\"https://2013.grandrapids.wordcamp.org/\">WordCamp Grand Rapids</a> was born.</p>\n<p>I was hooked. I couldn&#8217;t wait until NEXT year when we could have another one!</p>\n<p>Then I learned they happen all over the place! ALL THE TIME!</p>\n<p>My first Away WordCamp was Austin in April 2014, and it felt like it changed everything. I mustered up the courage to approach Siobhan McKeown and ask her about writing docs. 15 minutes later (literally) I had admin rights to work on the Plugin Handbook. I spent the next 6 months finishing it.</p>\n<p>I met Shayda Torabi, Chris Lema, Shawn and Kay Hesketh. I met for the first time my own co-workers at XWP.</p>\n<p>And my father died.</p>\n<p>My sister called on a quiet Sunday morning at sunrise and told me he was gone. My dear brother Luke Carbis cried with me. I&#8217;m crying now as I write this.</p>\n<h3>More of You</h3>\n<p>I was surprised to learn soon after that XWP wanted me to go to WordCamp Miami. I didn&#8217;t expect <em>two</em> WordCamps in one year! I met David Bisset, Karim Marucchi, Joe Hoyle, and dozens of other people who are now solid friends.</p>\n<p>Then another, I found out I was going to WordCamp San Francisco! I met Rocio Valdivia, Julie Kuehl, Dave Rosen, Shane Pearlman, Jake Goldman, and more and more and more.</p>\n<p>It was at that WordCamp that someone nominated me to be XWP&#8217;s WordCamp Outreach person. Dave Rosen looked at me with a sparkle in his eye and asked &#8220;Would you like that?&#8221;. That moment was the true beginning of HeroPress. That&#8217;s where he started thinking &#8220;What if?&#8221;</p>\n<h3>HeroPress</h3>\n<p>Until HeroPress WordPress was a tool to further my career. I&#8217;d made some dear dear friends, but maybe I would have made dear friends without WordPress. Dave Rosen came to me and told me he wanted me to do something great for WordPress. He told me it was my journey to discover. He wanted a business, a new product that would change everything.</p>\n<p>He also sent me a picture.</p>\n<p>It was a narrow alley in India. I don&#8217;t know what city. In the center of the alley was a small child, maybe 3 years old, getting a bath. His or her mother was pouring water to rinse.</p>\n<p>&#8220;I want to help that child&#8221; Dave said. &#8220;I want to make a world where that child has the ability to make a good healthy living, without having to leave home.&#8221; The child was looking right at the camera.</p>\n<p>Right at me.</p>\n<p>Dave also made available to me a WordPress agency. &#8220;If you need to build anything, use them, I have them on retainer&#8221; he said. They were from Kolkata. I got to know one person there, a young man named Jeet. We spent months together trying to come up with something great to do for WordPress. I learned about his family, and he learned about mine. He got married in that time.</p>\n<p>One day Jeet let go of some frustration. He was trying to get enough work for his agency to stick together.  It was really a group of friends who had been freelancing, and they wanted to make it work as a team. But he couldn&#8217;t get good work.  There was plenty of work for &#8220;cheap labor from India where they work for almost nothing&#8221;.  But that doesn&#8217;t work for actual grown up developers feeding families. He asked <em>me</em> how to get good work.</p>\n<blockquote><p>I felt helpless. I&#8217;d never been to India. I wasn&#8217;t any good at business really. What do I know?</p></blockquote>\n<p>So I set out to find someone who DID know. Someone who&#8217;d made a successful WordPress business in India.</p>\n<p>That&#8217;s where the core idea of HeroPress started. That&#8217;s why HeroPress essays now need an audience. It&#8217;s about connecting people to each other to share wisdom.</p>\n<p>I lost track of Jeet not long after the <a href=\"https://wptavern.com/heropress-fails-to-attract-backers-cancels-kickstarter-campaign-ahead-of-deadline\">HeroPress Kickstarter</a> failed, and I&#8217;ve been looking for him ever since. If anyone knows where to find Soumyajit Saha, I&#8217;d love to know.</p>\n<h3>Failure</h3>\n<p>The Kickstarter failed. My job situation was uncertain. Jeet never got his advice. The kid in the alley would certainly never get a good job. That&#8217;s ridiculous of course, but I could still see those eyes.</p>\n<p>Then people started saying things like &#8220;HeroPress is such a good idea, please don&#8217;t let it die.&#8221; People who couldn&#8217;t afford to give more than they had, or any at all.  People said &#8220;I couldn&#8217;t afford to give any money, but I have time, if you need anything done, I&#8217;ll do it&#8221;. Dozens of them.</p>\n<p>I started thinking about how I could make it work. If I gave up on video, and went with plain text, how hard could it be? What could it cost besides hosting? I decided to go for it.</p>\n<p>I emailed Dave and asked permission but he didn&#8217;t write back. He was busy on something else at the time. I asked again.  Nothing.</p>\n<p>So I did it anyway.</p>\n<p>I found Rarst and asked him if he&#8217;d do his presentation in text form, and he said yes. We published. It was breathtaking.</p>\n<p>Then I thought &#8220;I should have another, right? Umm&#8230; next week?&#8221; So I tracked down Saurabh Shukla, who had given so much great advice on how to talk to people from other cultures. &#8220;Sure!&#8221; he said. Then I needed another. For about the first 3 months I got contributors merely days, sometimes hours before publish time.</p>\n<p>Failure turned to success. Text is BETTER than video. It&#8217;s cheaper, faster, more accessible.</p>\n<p>It&#8217;s not a viable business. No-one&#8217;s making their living from it. From the viewpoint of the original goal, it has been a failure. From the eyes of everyone who talks to me about it, I can see it&#8217;s a success.</p>\n<h3>Making Family</h3>\n<p>In the spring of 2014 I went with my wife and two children to WordCamp Chicago. We all made new, wonderful friends. My children know people from all over the world, some of them that I don&#8217;t even know, because of WordPress. My wife now has dear friends she talks to all the time because of that WordCamp.</p>\n<p><a href=\"http://heropress.com/wp-content/uploads/2016/07/wordcamp_dinner.jpg\"><img class=\"alignright wp-image-1122\" src=\"http://heropress.com/wp-content/uploads/2016/07/wordcamp_dinner-300x169.jpg\" alt=\"Some family being silly at dinner\" width=\"400\" height=\"225\" /></a>We were hooked. We decided to go to another WordCamp. Then another. We went to Chicago, Dayton, North Canton, Milwaukee, Miami, Orlando, Tampa, Virginia Beach, St. Louis, Kansas City, Columbus, and WordCamp US.</p>\n<p>Without my family I went to Pressnomics and WordCamp Pune.</p>\n<p>At every one of these places we made more friends. More people with whom we still stay in touch and to whom we have become close. Some of them we saw over and over at WordCamps all year, and traded stories of travel and family and life.</p>\n<blockquote><p>The longer we&#8217;re a part of the WordPress community the more I realize we&#8217;re not making friends, we&#8217;re making family.</p></blockquote>\n<p>Family from India, Ukraine, England, Argentina, Nepal, Lebanon, Sri Lanka, and literally hundreds of other countries.</p>\n<p>WordPress didn&#8217;t rescue me from anything. The code shaped my career sure, but what has changed me is you. The lives of myself and my family will forever be better because of you.</p>\n<p>Thank you.</p>\n<div class=\"rtsocial-container rtsocial-container-align-right rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: Making Family\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=Making%20Family&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Fmaking-family%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: Making Family\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Fmaking-family%2F\" rel=\"nofollow\" target=\"_blank\"></a></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Fmaking-family%2F&title=Making+Family\" rel=\"nofollow\" target=\"_blank\" title=\"Share: Making Family\"></a></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/making-family/&media=http://heropress.com/wp-content/uploads/2016/07/070615-family-150x150.jpg&description=Making Family\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: Making Family\"></a></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/making-family/\" title=\"Making Family\"></a></div><p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/making-family/\">Making Family</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 24 Jul 2016 20:45:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Topher DeRosia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"HeroPress: WordPress, Where I Found What I Didn’t Know I Was Missing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1088\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"http://heropress.com/essays/what-i-didnt-know-i-was-missing/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:13262:\"<img width=\"960\" height=\"480\" src=\"http://heropress.com/wp-content/uploads/2016/06/062916-ididntknowiwasmissing-2-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Banner: The incredible thing about WordPress is the diversity of what you can pursue.\" /><div class=\"rtsocial-container rtsocial-container-align-left rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: WordPress, Where I Found What I Didn&#8217;t Know I Was Missing\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=WordPress%2C%20Where%20I%20Found%20What%20I%20Didn%27t%20Know%20I%20Was%20Missing&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Fwhat-i-didnt-know-i-was-missing%2F\" rel=\"nofollow\" target=\"_blank\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-twitter-count\"></span></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: WordPress, Where I Found What I Didn&#8217;t Know I Was Missing\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Fwhat-i-didnt-know-i-was-missing%2F\" rel=\"nofollow\" target=\"_blank\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-fb-count\"></span></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Fwhat-i-didnt-know-i-was-missing%2F&title=WordPress%2C+Where+I+Found+What+I+Didn%26%238217%3Bt+Know+I+Was+Missing\" rel=\"nofollow\" target=\"_blank\" title=\"Share: WordPress, Where I Found What I Didn&#8217;t Know I Was Missing\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-linkedin-count\"></span></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/what-i-didnt-know-i-was-missing/&media=http://heropress.com/wp-content/uploads/2016/06/062916-ididntknowiwasmissing-2-150x150.jpg&description=WordPress, Where I Found What I Didn\'t Know I Was Missing\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: WordPress, Where I Found What I Didn&#8217;t Know I Was Missing\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-pinterest-count\"></span></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/what-i-didnt-know-i-was-missing/\" title=\"WordPress, Where I Found What I Didn&#8217;t Know I Was Missing\"></a></div><h3>Backstory</h3>\n<p>My grandparents used to have a photograph that showed me as a child, just old enough to start walking; and in it I was trying to climb onto this little cement horse sculpture they had in their yard.</p>\n<p>For as long as I can recall I&#8217;ve always had an interest in horses, and it was always believed that my primary career path in life would somehow revolve around riding or training horses.</p>\n<p>I had the first chance to work around horses when I was nine, my parents wouldn&#8217;t pay for riding lessons but I was given the green light to volunteer at a handicapped riding facility near our home. So I would go there a few times each week to lead the horses around and assist the riders. I was in heaven.</p>\n<p>After some months of this my parents finally conceded to riding lessons, then buying a horse and things seemed to be on course for a career in horses for me.</p>\n<p>When I was 14 years old, we had moved to our own little property where we could keep our own horses. I would have been entering the 9th grade that fall, but instead I proposed to my parents that I should drop out of school and start a horse business instead; and surprisingly they agreed.</p>\n<p>For the next 6 years, I would spend a significant amount of time learning how to build, maintain and improve my own website for that business; it started with a basic WYSIWYG website builder but I quickly learned I needed to dig directly into the code to achieve what I wanted. I broke things and learned how to fix by poking at them with a stick, possibly the most ineffectual method of learning but this was before Google contained all the answers to all the questions..</p>\n<h3>What about *WordPress*?</h3>\n<p>Bear with me, I&#8217;m getting to that point! It&#8217;s now 2005 and I&#8217;m packing up my truck and horse trailer with a reasonable amount of belongings and one of my horses to drive 2000 miles from southern Wisconsin to the Seattle, Washington area. The next step in my journey will be as working-student for a year, which is just a fancy way of saying I&#8217;ll be doing hard physical labor for gruelingly long hours in exchange for a few hours of one-on-one instruction when the trainer has time.</p>\n<p>I wanted to learn more about Classical Dressage, and with few options in my immediate location, began looking outside the Midwest until I found a small facility in the Pacific NorthWest that was teaching what I wanted to learn.</p>\n<p>So where does WordPress fit in here? From the time I started working at the farm, I had to maintain an online blog and post to it daily. I chose WordPress as my blogging platform, possibly it was a choice of complete chance. But **that was my introduction to WordPress**, the requirement to maintain a simple online blog every day.</p>\n<h3>Momentum</h3>\n<p>Every day, I blogged, and slowly I decided I wanted to do more with my blog. So I began exploring plugins and themes, and then how I could break and fix them to suit my own needs.</p>\n<p>People I knew in the horse community would hire me from time to time to work on their site or build them one, and I was doing this in HTML and CSS until I got started with WordPress; and soon I was converting everyone I could to a WordPress site.</p>\n<h3>Distractions</h3>\n<p>There were a lot of other things going on in my life at this time unrelated to WordPress and websites as I continued to search for what I really wanted to do with my life.</p>\n<p>I returned from Washington and began giving riding lessons in my area. I wrote and published a book about working with horses, &#8220;Centered Self, Centered Horse.&#8221; Despite the outward successes I was having, my career path with training horses was really just reaching its peak before fizzling out.</p>\n<a href=\"http://heropress.com/wp-content/uploads/2016/06/exhibition.jpg\"><img class=\"wp-image-1090 size-medium\" src=\"http://heropress.com/wp-content/uploads/2016/06/exhibition-277x300.jpg\" alt=\"Erica Franz, in costume, on a rearing horse\" width=\"277\" height=\"300\" /></a>One of the last times I exhibited my horses, this was at a fundraiser for a therapeutic riding facility.\n<p>I began practicing Therapeutic Massage to help bring in additional income, sadly my arms would only hold out for a few years before severe chronic tendonitis forced me to quit altogether.</p>\n<p>The economy in the gutter and I felt this might be a good time for me to pursue higher education, so I went to college for my Bachelor of Fine Arts degree.</p>\n<p>School was a welcome distraction as my involvement with the horse community became less satisfying. I felt more at odds every day with the common methods used to train and ride horses until I decided I needed a full break from all-things-horses.</p>\n<p>Even through all of this, I was still plugging away with WordPress, freelancing and slowly gaining more and more clients.</p>\n<h3>The Big (little) Change</h3>\n<p>In 2013, a freelance client I had just started working with wanted to use a very specific WordPress theme &#8211; Marketer&#8217;s Delight.</p>\n<p>It&#8217;s funny when you think back to something small that can completely change the course you&#8217;re on. But it was this tiny thing that I believe began a full-stop to the path I was travelling at that time and helped re-route me to where I am today.</p>\n<p>Marketer&#8217;s Delight, at that time, was a skin for the Thesis framework. So as I was working with it I would pop into the forum support to ask a few questions about whether certain functionality was supported out of the box, and Alex was looking to hire someone to help with forum support.</p>\n<p>On a lark, I sent him an email. I loved working with Marketer&#8217;s Delight and felt I&#8217;d enjoy helping others in the forum as they navigated their way through customizing the theme for their own site.</p>\n<p>And that was it, I joined Kolakube and worked in the support forum for about 3 months.</p>\n<p>After that opportunity I realized some very important things. 1) I love figuring things out and finding out what the cause of a problem is, and 2) I really love helping people.</p>\n<h3>Taking a chance at a random opportunity</h3>\n<p>I had continued to freelance while working in the support forum, but after that time I really wanted to work with another support team again.</p>\n<p>I wasn&#8217;t yet actively looking at job openings or submitting resumes to any companies; but opened up Twitter and one of the few people I was following at the time had retweeted a link to a job opening for OptinMonster.</p>\n<p>I worked with creating &#8220;optins&#8221; with OptinMonster on a few of my clients&#8217; sites so was already somewhat familiar with the product and and really enjoyed using it.</p>\n<p>Of course there was some immediate self-doubt about whether I was really qualified for the position because customer support wasn&#8217;t a field I had been pursuing for a long time or had a long history of experience in.</p>\n<p>&#8220;Ah, the worst that can happen is they actually respond with a &#8216;no&#8217;.&#8221;</p>\n<a href=\"http://heropress.com/wp-content/uploads/2016/06/resume.jpg\"><img class=\"size-medium wp-image-1093\" src=\"http://heropress.com/wp-content/uploads/2016/06/resume-213x300.jpg\" alt=\"Erica Franz\' resume, mostly blurred out\" width=\"213\" height=\"300\" /></a>Not a resume to be easily forgotten.\n<p>So I got to work putting together a resume to submit that I felt would convey both my personality and highlight my motivation.</p>\n<p>I actually listed the following as a skill-set in my resume:</p>\n<p>&#8220;Owner of unicorns,<br />\nslayer of dragons,<br />\nrider of lightning&#8221;</p>\n<p>Long story short, <strong>I got the job!</strong></p>\n<h3>Time flies when you love what you do</h3>\n<p>It&#8217;s been a year and a half now that I&#8217;ve been working not only with OptinMonster, but also with Soliloquy and Envira Gallery plugins which are part of the same company (AwesomeMotive).</p>\n<p>I work with the really great, diverse team of people, who feel more like family.</p>\n<p>In the short time I&#8217;ve worked at AwesomeMotive, I&#8217;ve learned so much and grown a lot with respect to my knowledge and skills in development even. I gained confidence to begin writing my own plugins and have some published now in the WordPress Plugin Repository.</p>\n<p>This last fall I was promoted to Head of Customer Happiness and have the honor to oversee support for thousands of customers.</p>\n<h3>Reflection</h3>\n<p>Sometimes it&#8217;s difficult to look ahead and see clearly where your destination will be.</p>\n<p>If you had asked me 10 years ago what I would be doing today, customer support or a career largely built on WordPress would not have been part of my answer.</p>\n<p>But in all the little paths I&#8217;ve travelled that eventually got me here, what I&#8217;ve always been looking for was a place where I fit.</p>\n<p>Since I first began writing a little daily blog in WordPress, to today working every day with this amazing team of incredibly skilled individuals, has been this comforting feeling that the world is right and my place in it correct.</p>\n<p>The incredible thing about WordPress is the diversity of what you can pursue. WordPress is more than a blog, more than a website or online store.</p>\n<p>WordPress is people coming together, sharing their own unique sets of skills and personalities to make something greater than could be achieved by any one person alone.</p>\n<p>WordPress allows me to learn and grow as a person every day. It challenges me to think about problems from completely different perspectives as I work with individuals from around the world who share with me their experience and thoughts.</p>\n<p>I doubt I would have a similar opportunity without WordPress; and really without each and every person who is using, extending and contributing to it. My gratitude for WordPress is really my gratitude for <strong>you</strong>, the person reading this story about my journey, because we are all helping support each others journey <strong>through</strong> WordPress.</p>\n<p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/what-i-didnt-know-i-was-missing/\">WordPress, Where I Found What I Didn&#8217;t Know I Was Missing</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 24 Jul 2016 20:45:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Erica Franz\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"HeroPress: My Road to WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1038\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"http://heropress.com/essays/my-road-to-wordpress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:17070:\"<img width=\"960\" height=\"480\" src=\"http://heropress.com/wp-content/uploads/2016/06/roadtowordpress-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Banner: WordPress showed me that everything is possible is you invest enough time and effort.\" /><div class=\"rtsocial-container rtsocial-container-align-left rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: My Road to WordPress\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=My%20Road%20to%20WordPress&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Fmy-road-to-wordpress%2F\" rel=\"nofollow\" target=\"_blank\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-twitter-count\"></span></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: My Road to WordPress\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Fmy-road-to-wordpress%2F\" rel=\"nofollow\" target=\"_blank\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-fb-count\"></span></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Fmy-road-to-wordpress%2F&title=My+Road+to+WordPress\" rel=\"nofollow\" target=\"_blank\" title=\"Share: My Road to WordPress\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-linkedin-count\"></span></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/my-road-to-wordpress/&media=http://heropress.com/wp-content/uploads/2016/06/roadtowordpress-150x150.jpg&description=My Road to WordPress\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: My Road to WordPress\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-pinterest-count\"></span></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/my-road-to-wordpress/\" title=\"My Road to WordPress\"></a></div><p>What do you want to do for living? Depending on where you stand in life, this question can either be the most easiest or an incredibly tough one to answer. When you are ten or fifteen this question is exciting and it has the power to open a whole box of wishes and dreams that seem to just be waiting to be realized.</p>\n<p>Well, with 25 and a university degree in civil engineering in my pocket, that was probably the most unpleasant question you could have asked me. This was not like I imagined it to be. The feeling was wrong. Instead of being eager to finally put the acquired knowledge into practice, I somehow felt like I&#8217;ve just spent the last 6 years of my life for nothing. There was zero enthusiasm in picturing me working in civil engineering field&#8230;not now&#8230;not ever.</p>\n<h3>Life is perfect&#8230;well almost <img src=\"https://s.w.org/images/core/emoji/2/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /></h3>\n<p>The year was 2009 and some big events are underway in my life. First, on April 4th I turned 25. OK, that doesn&#8217;t sound like much now, but for me, then, it surely was:). In May I got married to Marko. By the way, he is helping me write this and he won&#8217;t let me write epics about him, but otherwise I certainly would:). In June I finished my studies and in September I officially moved to Germany to live with my husband. Somehow, it still sounds strange when I say &#8220;my husband&#8221;, soo serious <img src=\"https://s.w.org/images/core/emoji/2/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /> .</p>\n<p>When I recall these events now I can see what a great year that was. Still, there was this big question mark hanging above my head; what am I going to do for living? Beside having a major in a field I had no intention of pursuing a career, I now had another barrier&#8230; german language. If you&#8217;ve ever heard German talking you probably know it doesn&#8217;t sound like a piece of cake thing to learn:).</p>\n<p>The first year in Germany I spent learning the language and working some part time jobs in restaurants, hotels and even giving dancing lessons. It was fun, new country, new language, new people. I even applied for a couple of jobs related to civil engineering, but luckily didn&#8217;t get them due to insufficient German knowledge.</p>\n<h3>Why study something you don&#8217;t want to do?</h3>\n<p>I guess this question might have crossed your mind at least once by now. To better describe the whole thing I need to give a bit more insight into my background and life prior to meeting Marko.</p>\n<p>I was born in Kotor, Montenegro that was then a part of Yugoslavia. Kotor is a relaxed small town on the coast and in my memory it imprinted itself as a great place to be a child. Most people that heard of Kotor, probably visited it on board of one of one of the large cruising ships that stop there daily.</p>\n<p>Unfortunately, in the beginning of 90&#8217;s terrible things started to happen all over Yugoslavia, the country started to fall apart and my family decided to move to Croatia that have just announced independence from Yugoslavia. We ended up on the small island Losinj, another tourist destination, where I lived with my parents until I was 18 and was time to go to college.</p>\n<p>Although spending childhood in such beautiful small towns like Kotor and Losinj may seem like living in paradise for many people, there is always another side of the coin. For me that other side were missing options. It was like, there is a way how things work here and you have to get used to it. The sooner you forget about some unconventional ideas about your future the better <img src=\"https://s.w.org/images/core/emoji/2/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /> . And I&#8217;ve had a lot of those. I was interested in playing piano, dancing, design and so on. It was all acceptable as a hobby, but no one really considered those to be a serious occupation option.</p>\n<p>Well, with time, I forgot about many of them as I tried to fit in and as a result I ended up studying civil engineering for the sole reason that it is, among maybe 3-4 other studies, traditionally considered &#8220;a good choice&#8221; in this country.</p>\n<h3>Nothing without a support</h3>\n<p>As people say, &#8220;better ever than never&#8221;. I don&#8217;t know and don&#8217;t want to know what my life would be like if I&#8217;ve forced myself to follow the path I had in front of me at that time, but I guess forcing yourself to do anything long term is receipt for failure.</p>\n<blockquote><p>I figured out that &#8220;a good choice&#8221; doesn&#8217;t mean much if you&#8217;re not satisfied with it.</p></blockquote>\n<p>It is a common saying that there are always alternatives, but sometimes it is really hard to see them. Especially if you live in an environment that doesn&#8217;t want or is afraid to see them. Moving to Germany to live with Marko changed my views and I started to open myself to new opportunities.</p>\n<p>Although Marko originally comes from the same small island my family moved to in the 90&#8217;s, we first met in 2006 when he was already living in Germany. His way of thinking is quite unconventional by Croatian standards and although he also tried to ignore his own urges for some time, he dropped out of &#8220;a good choice&#8221; college just before the finish line and went to Germany to work as a musician.</p>\n<p>He inspired me to rethink my options and supported me from the day one no matter what choice I make. All at once my choice was clear.</p>\n<h3>Let&#8217;s Design</h3>\n<p>I always wanted to do something creative and design was my wish for a long time although I&#8217;ve never done anything even remotely like it. Marko and I sat down, I told him what I&#8217;d want and he was like; great, take your time, start learning and sooner or later it will pay off.</p>\n<p>So, I started browsing all over the net trying to find good sources that I can learn from. First I actually started creating logos, but very soon I was hooked on web design. I started learning HTML/CSS and even enrolled myself in the online based web design course that turned out to be a waste of time as the concepts that they taught were 10 years behind the times. However, persistence does pay off and within a year I was ready to try selling my first template.</p>\n<p>Themeforest was an obvious choice, but the quality was not there yet. When I look at those first templates, they make me laugh, but you have to start somewhere:). Anyway, the templates got better, got accepted and I started to feel comfortable in what I was doing.</p>\n<h3>WordPress all the way</h3>\n<p>The year was 2012, I&#8217;ve had a couple of templates and a couple of small clients behind me, but with all these CMS solutions growing, HTML templates seemed like a dead end. In the meantime Marko and I decided to try to build a business selling only finished templates instead of developing custom websites for clients.</p>\n<blockquote><p>Our goal was to build a business that is independent of the place of living.</p></blockquote>\n<p>The way I got introduced to WordPress wasn&#8217;t very romantic and there is nothing really inspiring in that story. We were looking for a bigger market that could make our plan work and growing sales themes on Themeforest led us to one conclusion&#8230; WordPress.</p>\n<p>I didn&#8217;t know anything about it and was quite reluctant to start learning it, but Marko can be quite stubborn:). He was like, &#8220;common it can&#8217;t be that hard&#8221;, although at that time he didn&#8217;t have any knowledge of it what so ever:) However, that kept me going and the more I learned about WordPress the more I liked the whole idea behind it.</p>\n<h3>Community of like minded people</h3>\n<p>From my very first steps with WordPress I was pleasantly surprised how helpful people in the WordPress community can be. Complete strangers were ready to take their precious time and help a beginner learn some basic concepts. This is something I&#8217;ve never experienced before and that is one of the greatest values of being a part of such a community.</p>\n<p>In 2013 we launched our own site <a href=\"http://www.anarieldesign.com\">Anariel Design</a> where we offered our HTML template as well as the first theme or two. Here again complete strangers, that run a very popular site <a href=\"http://tympanus.net/codrops/\" target=\"_blank\">Codrops</a>, help us promote the site at the very beginning. In the meantime we got to know them in person so they are not strangers anymore :). Thank you Manoela and Pedro!</p>\n<p>2014 was a turning point when, out of the blue, we got an email from <a href=\"https://twitter.com/philip_arthur\" target=\"_blank\"> Philip Arthur Moore</a> ( work for Automattic at the time ) asking if we&#8217;d like to sell our themes on WordPress.com. It was such honor for me to be invited. It was like an ultimate confirmation that I&#8217;m doing something right an that was finally something I actually enjoyed doing. Thank you Philip!</p>\n<h3>When You Least Expect It</h3>\n<p>2013 had its dark side as I was going through a series of panic attacks that seemed to start out of nothing. It was completely confusing as everything was going great in my life and then all of a sudden such a horror. I even ended up in a hospital for 2 days cause I felt as if I was having a heart attack so they kept me to do some tests.</p>\n<p>Marko helped me analyze the situation and I discovered how much baggage I&#8217;ve been carrying around for a long long time. Things I&#8217;ve never talked about. Things I was ashamed or afraid of. Things I should have straighten out a long time ago, but didn&#8217;t. Opening up helped me a lot and it got better with time.</p>\n<p>At the time the panic attacks started happening I got a gift, cute small teddy bear. It may sound funny or strange, but this teddy bear we named Bubi helped me calm down in my worst hours. Especially when Marko wasn&#8217;t at home. In the meantime Bubi became our lucky charm and he&#8217;s now with us where ever we go.</p>\n<p><img class=\"aligncenter size-full wp-image-1042\" src=\"http://heropress.com/wp-content/uploads/2016/06/bubi.png\" alt=\"Small plush teddy bear on a stump wearing a Santa hat\" width=\"895\" height=\"360\" /></p>\n<h3>A Glance at the Future</h3>\n<p>The last two years were really a joyride. We achieved our goal of running a business that doesn&#8217;t tide us to a certain location. In 2014 Marko took a long needed break from music to learn WordPress and beside doing the business side of things he became an awesome support agent:).</p>\n<p>We are now working from a home office or from where ever we find ourselves at the moment. We like to attend WordCamps whenever we can and meet new people. There are so many interesting stories as most of these people lead unconventional lives.</p>\n<blockquote><p>No one knows what the future brings and how my life will be in a year or in five years.</p></blockquote>\n<p>However, WordPress showed me that everything is possible if you invest enough time and effort. It helped me grow confidence in myself and in other people. That is something that no one can take away and that is what I&#8217;m most thankful for.</p>\n<hr />\n<h3>Thank you note</h3>\n<p>With every project you, me or anyone else ever started there is always someone who knows something you don`t. Someone who can help you out when you get stuck, someone from whom you can always learn something new.<br />\nSo, in this last part i&#8217;d like to thank all the people that helped me on my way:</p>\n<ul>\n<li>First thanks Topher DeRosia for inviting me to write the essay and go out of my comfort zone <img src=\"https://s.w.org/images/core/emoji/2/72x72/1f609.png\" alt=\"?\" class=\"wp-smiley\" /></li>\n<li>special thanks to Marko for all the help &amp; support, without you I wouldn&#8217;t manage all this</li>\n<li>Big thanks to <a href=\"https://twitter.com/photomatt\" target=\"_blank\">Matt Mullenweg</a> &amp; <a href=\"https://twitter.com/mikelittlezed1\" target=\"_blank\">Mike Little</a> and to all that are contributing to WordPress</li>\n<li><a href=\"https://twitter.com/philip_arthur\" target=\"_blank\"> Philip Arthur Moore</a> ( you are my &#8220;hero&#8221; <img src=\"https://s.w.org/images/core/emoji/2/72x72/1f609.png\" alt=\"?\" class=\"wp-smiley\" /> ), <a href=\"https://twitter.com/sixhours\" target=\"_blank\">Caroline Moore</a>, <a href=\"https://twitter.com/DavidAKennedy\" target=\"_blank\">David A. Kennedy</a>, Ola Laczek, <a href=\"https://twitter.com/mendezcode\" target=\"_blank\">Ernesto Méndez</a>, <a href=\"https://twitter.com/jacklenox\" target=\"_blank\">Jack Lenox</a>, <a href=\"https://twitter.com/karmatosed\" target=\"_blank\">Tammie Lister</a>, <a href=\"https://twitter.com/fklux\" target=\"_blank\">Fränk Klein</a> &amp; all Automatticians &#8211; I learned so much from you, thanks a bunch <img src=\"https://s.w.org/images/core/emoji/2/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /></li>\n<li>Thanks to all volunteers and organizers of the WordCamps, you are doing a great job :). Special thanks to <a href=\"https://twitter.com/eblagonic\" target=\"_blank\">Emanuel Blagonic</a> &amp; all other Croatian organizers and volunteers for organizing amazing WordCamp Croatia ( next one is in September in Split: <a href=\"https://2016.split.wordcamp.org/\" target=\"_blank\">https://2016.split.wordcamp.org/</a> )</li>\n<li>Big thanks to theme reviewers on WordPress.org, specially to <a href=\"https://twitter.com/joedolson\" target=\"_blank\">Joe Dolson</a> for the theme accessibility reviews, I learned a lot from you <img src=\"https://s.w.org/images/core/emoji/2/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /></li>\n<li>Thanks to Manoela &amp; Pedro from <a href=\"http://tympanus.net/codrops/\" target=\"_blank\">Codrops</a></li>\n<li>Big thanks to <a href=\"https://twitter.com/twsjonathan\" target=\"_blank\">Jonathan Atkinson</a> &amp; <a href=\"https://twitter.com/Smartik89\" target=\"_blank\">Andrei Surdu</a>, you advices helped a lot at the beginning <img src=\"https://s.w.org/images/core/emoji/2/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /></li>\n<li>and thanks to all great people &amp; friends I met during my work &amp; WordCamps, so many beautiful &amp; inspiring people out there <img src=\"https://s.w.org/images/core/emoji/2/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /></li>\n</ul>\n<p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/my-road-to-wordpress/\">My Road to WordPress</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 24 Jul 2016 20:45:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Ana Segota\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"HeroPress: The Making of a WordPress Journalist\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1020\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"http://heropress.com/essays/making-wordpress-journalist/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:17958:\"<img width=\"960\" height=\"522\" src=\"http://heropress.com/wp-content/uploads/2016/06/Maedah_Batool_Essay_HeroPress_2-1024x557.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Banner: So far I\'ve trained more than 700 women from almost every walk of life and about 80% of them are now earning a living with Wordpress\" /><div class=\"rtsocial-container rtsocial-container-align-left rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: The Making of a WordPress Journalist\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=The%20Making%20of%20a%20WordPress%20Journalist&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Fmaking-wordpress-journalist%2F\" rel=\"nofollow\" target=\"_blank\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-twitter-count\"></span></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: The Making of a WordPress Journalist\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Fmaking-wordpress-journalist%2F\" rel=\"nofollow\" target=\"_blank\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-fb-count\"></span></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Fmaking-wordpress-journalist%2F&title=The+Making+of+a+WordPress+Journalist\" rel=\"nofollow\" target=\"_blank\" title=\"Share: The Making of a WordPress Journalist\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-linkedin-count\"></span></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/making-wordpress-journalist/&media=http://heropress.com/wp-content/uploads/2016/06/Maedah_Batool_Essay_HeroPress_2-150x150.jpg&description=The Making of a WordPress Journalist\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: The Making of a WordPress Journalist\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-pinterest-count\"></span></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/making-wordpress-journalist/\" title=\"The Making of a WordPress Journalist\"></a></div><p><em>I went from being an Electrical Engineer to a WordPress Journalist cum Researcher. I review products, provide WordPress support and handle technical documentations. Here’s my story.</em></p>\n<p>October 27th, 2010 — The day my passion became my paycheck, and I was hopeful and excited about trying out something I always wanted to do i.e. to blog!</p>\n<h2>The Backstory</h2>\n<p>I was always a shy kid. But had a great inclination towards all the creative writing opportunities which were offered in the school. Be it contributing to the <i>school&#8217;s annual magazine</i> or joining the editorial team of the <i>Buzz</i> (the monthly newsletter), I always considered myself an amateur writer. I also remember how anxiously; I used to wait for the weekly edition of the US Magazine and used to pile up all its copies neatly in a big plastic folder bag. (I still have that big bundle stacked in my cupboard. <img src=\"https://s.w.org/images/core/emoji/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /> )</p>\n<p>Throughout my school, the laser focus on my career was to become a doctor and take up writing as a side profession. Even if I wanted to take writing as a full-time career at that time, my parents would not have allowed it (every parent wants their kids to be an engineer or a doctor — professions with less uncertainty).</p>\n<p>So, I knew that just aiming to become a professional writer would only do more harm than good. Anywho, long story short, I ended up joining the Engineering field mostly because the profession ran in my blood. (Duh&#8230; my dad is an Engineer).</p>\n<p>The general perception is that if you&#8217;re passionate about something, you&#8217;re more willing to take risks. But this wasn&#8217;t true for me. Honestly, I’m not a life-hacking kind of girl. Nor can I pretend to be one who has fully recovered from giving up on her passion. But somewhere in there I still wanted to write (as in professionally).</p>\n<h3>The Hard Truth</h3>\n<p>I was now on track to become an Electrical Engineer, which was not anywhere close to writing, except for that only <i>Communications Skills</i> course which included a few PPT presentations, technical writing and a 20-page report as a semester project. There was nothing creative about it since we were supposed to write like they write a research paper. There was more fuss about syntax than the content itself. It&#8217;s safe to assume that I didn&#8217;t enjoy <i>that</i> kind of writing.</p>\n<h2>Stepping Forward Professionally</h2>\n<p>Five years ago during my 4th semester at the university, I met an amazing team of entrepreneurs led by <a href=\"https://ahmadawais.com/\">Ahmad Awais</a>; it was a small team of passionate developers and bloggers. Better yet, they were looking to add one more resource to their team. I knew this was my chance to be a writer again.</p>\n<p>For me, writing meant putting my voice out there and wanting it to matter even a tiny bit. After a few articles that I contributed, I was offered a part-time job, and I quickly jumped on it. I was like &#8220;Holly Smokes! It&#8217;s getting real&#8221;. I got started by writing on different niches like technology, design, food, fashion, hospitality, the web, etc.</p>\n<blockquote><p>Re-living my passion once again induced new hope and rejuvenated me a lot.</p></blockquote>\n<p>Whatever I wrote, came profoundly from my heart and this instinct made me believe I might have a chance to take a stab on writing once again. But writing for technology blogs wasn&#8217;t that simple as I had hoped.</p>\n<h3>Defining Parts of a Copywriter</h3>\n<p>Becoming a professional and sound copywriter is an intimidating struggle because there’s a lot of jargon. Unfortunately, you&#8217;re going to find some new mantra each time you browse this topic. So, I&#8217;m just writing what I found is necessary for one to become one such copywriter.</p>\n<ul>\n<li>Writing (of course!)</li>\n<li>Code</li>\n<li>Design</li>\n</ul>\n<p>One needs to know at least the basics of these three bullet points listed above. So, that was my goal. Mostly, because I worked with a team of developers and being an engineer, development was not a remote concept either. I knew that having basic design and development skills will only allow me to push beyond the limits of a normal copywriter.</p>\n<h2>A Turning Point!</h2>\n<p>Ahmad had always been a big fan of WordPress, and all three of our blogs were built with WordPress. The CMS was entirely new to me but when I gave it a spin found it surprisingly easy to learn. We had internal workshops about WordPress almost every other week. I made a point to sit through these workshops and even went through project RFP&#8217;s and init meetings. During the next semesters, I had fallen for two things, writing and yes, you guessed it, WordPress.</p>\n<p>Now the biggest challenge for me was to pace things up as quickly as possible so that by the time I graduate, I don&#8217;t end up working in a Grid Station in a remote area. (I mean no offense to the Electrical Engineers out there. But it wasn&#8217;t the thing for me.)</p>\n<p>I started getting a firm grip over WordPress. I kicked off with video tutorials from Lynda and then started reading authentic web resources like <a href=\"http://www.wpbeginner.com/\">WPBeginner</a>, <a href=\"http://wptavern.com/\">WP Tavern</a>, etc. After toying around with the basic setup and configurations, the next step was to face my biggest fear i.e. coding.</p>\n<p>Did I mention that initially I knew very little of code?</p>\n<h3>Encountering the Gap</h3>\n<p>My first real interaction with the code was via C Programming in the first semester and believe me it was a deeply rooted bizarre.</p>\n<blockquote><p>I found the fact <strong><i>development jobs “are for men”</i></strong> ridiculous and therefore, continued to focus on progressing my career.</p></blockquote>\n<p>This was only possible if I would learn how to code.</p>\n<p>I learned HTML5 followed by CSS3 and then jumped to high-level programming languages like PHP and JavaScript. And guess what&#8230; just after six months of coding, things started to make sense. I began with teeny tiny modifications of simple HTML templates and worked through the complex frameworks like Redux and Titan. I think this was because I was more focused on speed than I was on building a solid understanding of what I was doing.</p>\n<h3>It Isn&#8217;t Enough</h3>\n<p>With time, I started noticing an encouraging shift in my life. I knew I was up to something. My next step was to evolve with the local community and hence, I started attending design conferences and workshops. Why design? Because this would fulfill my third component to become a professional copywriter and it let me interact with people around me. Images play a vital role in making your content appealing, and a basic knowledge of Photoshop would be sufficient to achieve my goal.</p>\n<p>My next step eventually hit the brick wall, and I started speaking at workshops too. I assisted the leading speakers at most of the workshops which made me gain experience that proved its worth just some time later.</p>\n<h2>Be The Change</h2>\n<p>By the time I graduated, I was leading the team of bloggers and had expanded my team to about 15 people. Believe me; it feels great to be working on what I want and when I want! Delegating to a team of emerging writers was an achievement itself. Obviously, it’s not an easy thing, but I enjoyed every single bit of it.</p>\n<p>At that time, we thought of starting a new company focused on teaching people all things web. That also meant selling our blogging network. So, we have begun prepping for that and by the end of the year, we had have sold almost 80% of our blogs.</p>\n<h2>The Startup — FinkTanks</h2>\n<p>By now, I&#8217;ve realized that the only person who can get in the way of your career progress is <i>YOU</i>. One has to keep moving forward regardless of what you’re up against. The work you do may not bring drastic and immediate results, but your efforts will not go to waste. And I knew that the career path which I&#8217;ve opted for can directly impact the future of our next generation of women.</p>\n<p>So, it just hit me that I should teach others how I did it, not much of a success story, but at least I could spread the word. Then I came up with the idea of a startup with my team. FinkTanks — as we called it was launched in 2013 and then again in 2014. I searched for my target audience and the perfect fit for this venture were the young girls just like me — fresh graduate looking to learn a few extra skill.</p>\n<h3>When Women Engineer&#8230;</h3>\n<p>I surveyed a little and realized that a number of females were interested in working from home (mostly coz it is easier, flexible and no transportation mess). There could not be a better choice for them other than blogging &amp; copywriting. I mean you don’t have to go for a job you just need to work hard wherever you are. All you need is a laptop and an uninterrupted internet connection which fortunately is available to almost all of us. So this was my biggest inspiration and hence I got started.</p>\n\n<a href=\"http://heropress.com/essays/making-wordpress-journalist/13436098_10207765500470328_2048167471_n/\"><img width=\"150\" height=\"150\" src=\"http://heropress.com/wp-content/uploads/2016/06/13436098_10207765500470328_2048167471_n-150x150.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"Small theatre-style classroom filled with women\" /></a>\n<a href=\"http://heropress.com/essays/making-wordpress-journalist/13444387_10207765496750235_2139752860_n/\"><img width=\"150\" height=\"150\" src=\"http://heropress.com/wp-content/uploads/2016/06/13444387_10207765496750235_2139752860_n-150x150.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"Small theatre-style classroom filled with women\" /></a>\n<a href=\"http://heropress.com/essays/making-wordpress-journalist/13459626_10207765480509829_61196780_n/\"><img width=\"150\" height=\"150\" src=\"http://heropress.com/wp-content/uploads/2016/06/13459626_10207765480509829_61196780_n-150x150.jpg\" class=\"attachment-thumbnail size-thumbnail\" alt=\"4 men and three women holding up award certificates.\" /></a>\n\n<p>I conducted training sessions on a monthly basis where I taught how to be a blogger and how to be self-employed. I taught all the essential components which a blogger needs to know starting from WordPress to design, code, and of course copywriting.</p>\n<blockquote><p>So far, I&#8217;ve trained more than 700 women from almost every walk of life, and about 80% of them are now earning a living with WordPress.</p></blockquote>\n<h2>WordPress is my new gluten</h2>\n<p>All this was only possible because of WordPress. Had I not started early on with this open source script I had never been able to positively affect so many lives. WordPress had started to change my life.</p>\n<p>When I started publishing content with WordPress, I knew little about its technical insights but gradually became aware of it. I started as a 360 writer who could pen down her thoughts on any niche, but soon I realized that<strong><i> instead of doing something of everything, I should learn everything of something</i></strong>. And that everything was WordPress.</p>\n<p>Yes! WordPress is my new gluten and since 2013, this open source script has become a life-changing experience for me. I think that my passion for writing is the best fit to convey my thoughts and opinions on WordPress. Currently, I’m a part of <a href=\"http://wptie.com/\">WPTie</a> and working as the Creative Director.</p>\n<h3>A Competitive Advantage</h3>\n<p>My day to day routine involves reading about WordPress (and boy I read a lot of it), slacking through WP Slack, improving documentation of our products, providing WordPress support and blogging about WordPress. I also try listening to the popular podcasts. I follow folks like <a href=\"https://twitter.com/chrislema\">Chris Lema</a>, <a href=\"https://twitter.com/tommcfarlin\">Tom McFarlin</a>, and <a href=\"https://twitter.com/learnwithmattc\">Matt Cromwell</a>. Recently, I&#8217;ve also started a new venture with Ahmad Awais, i.e. a blog about stuff that couples well with WordPress <a href=\"http://wpcouple.com/\">WPCouple.com</a>.</p>\n<p>Working at WPTie has been amazing. It has provided me with an excellent opportunity to work with a talented lot of the community ranging from beginners all the way up to professional developers, bloggers, designers, and WordPress core contributors, etc. So, interacting with like-minded people who are heading towards the same career goals as me is fascinating.</p>\n<h2>All Set To Grow as a WordPress Journalist</h2>\n<p>I have turned my life around from being an Electrical Eng. to becoming a WordPress Journalist. By now, I have reviewed several plugins, themes, and frameworks, and now I&#8217;m heading towards a big goal. My team and I are working on a brand new online content agency through which we can offer copywriting services to the WordPress community.</p>\n<p>One of my goals has to never be just a copywriter, and that&#8217;s what I am up to. I write on complex WordPress topics which help me experiment and learn how to develop with WordPress while following the coding standards set by the community.</p>\n<blockquote><p>If you think my story has a lot of WordPress in it, then you cannot be more right.</p></blockquote>\n<p>I believe that sharing more than 26% of the web; WordPress has empowered many ordinary people.  I also find myself gearing for the same queue. My prime focus will be towards reviewing WordPress products as they are here to stay for sure. Likewise, I&#8217;m also brainstorming about my content agency.</p>\n<p>With that said, I am planning to enter the services market, and one of my huge inspirations and motivations have been <a href=\"https://twitter.com/jenniferbourn\">Jennifer Bourn</a>. I truly admire the way she is maintaining a perfect blend of both personal and professional life. Because there always exists a big <strong><i>either</i></strong> for most of the women when it comes to choosing a professional career versus being a traditional housewife. Likewise, I&#8217;m planning to attend WordCamps next year and looking forward to meeting her.</p>\n<p>I’ll conclude by stating the obvious ~ It&#8217;s hard to write about yourself. I don&#8217;t call myself a hero, hell I am no hero. On the contrary I am embarking on a journey to be better at what I do, and I cannot wait to see what is in store for me. Right now I&#8217;m happy and satisfied with what I do, I am surrounded by great people trying to accomplish great things and not many people can say that about their career. That&#8217;s because of WordPress and the community around it. So, Thank You, WordPress!</p>\n<p>Thanks for reading! I&#8217;d love to hear back from you. You can reach out to me on <a href=\"https://twitter.com/MaedahBatool\">Twitter</a> or at my personal <a href=\"https://maedahbatool.com/\">blog</a>.</p>\n<p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/making-wordpress-journalist/\">The Making of a WordPress Journalist</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 24 Jul 2016 20:45:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Maedah Batool\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"HeroPress: You Really Have No Excuse\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1011\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"http://heropress.com/essays/really-no-excuse/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:11696:\"<img width=\"600\" height=\"600\" src=\"http://heropress.com/wp-content/uploads/2016/06/vlad_olaru_pixelgrade.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Vlad Olaru\" /><div class=\"rtsocial-container rtsocial-container-align-left rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: You Really Have No Excuse\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=You%20Really%20Have%20No%20Excuse&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Freally-no-excuse%2F\" rel=\"nofollow\" target=\"_blank\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-twitter-count\"></span></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: You Really Have No Excuse\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Freally-no-excuse%2F\" rel=\"nofollow\" target=\"_blank\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-fb-count\"></span></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Freally-no-excuse%2F&title=You+Really+Have+No+Excuse\" rel=\"nofollow\" target=\"_blank\" title=\"Share: You Really Have No Excuse\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-linkedin-count\"></span></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/really-no-excuse/&media=http://heropress.com/wp-content/uploads/2016/06/vlad_olaru_pixelgrade-150x150.jpg&description=You Really Have No Excuse\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: You Really Have No Excuse\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-pinterest-count\"></span></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/really-no-excuse/\" title=\"You Really Have No Excuse\"></a></div><p>Topher really dropped it on me with this article. There I was happily mumbling away about philosophy and life lessons (with regards to our experience at PixelGrade) when he said: “<em>I’d love a message from you to other Romanians about what a business around WordPress can do for them</em>”. I kept on mumbling anyway (it’s a thing I am really good at <img src=\"https://s.w.org/images/core/emoji/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /> ). “<em>Sure, I can do that!</em>”</p>\n<p>But when it came to writing my “message”, damn. Talk about brain freeze. Should I write about this or that? Does this really relate to Romanians or it’s just something general? Are Romanians different in this respect? We have good coders here… but boy how lame we are when it comes to… There is talent here but… And on and on it went — procrastination 101.</p>\n<p>I just couldn’t put my finger on it. I needed a solid reason. Something worthwhile. Something that I could get behind as being useful to others (Romanians included) from a new point of view (at least for me).</p>\n<p>But you know what? I am going to mumble away about what I think kept us alive and kicking all these years and what is keeping others from joining the fun. WordPress, with it’s <em>capital_P_dangit()</em>, is an important part of it. Consider it an open letter to the Romanian community (and others in a similar situation), worthy of HeroPress, but most importantly helpful to some of you.</p>\n<h3>Where do I start?</h3>\n<p>You start from yourself. The rest will come later, with time. Right now all you have is you: you the wannabe coder, designer, marketer, what have you.</p>\n<p>Just like me and my brother George. When we’ve started, we were just two kids (he was really a kid in highschool; I was in university — but age doesn’t show on me <img src=\"https://s.w.org/images/core/emoji/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /> ) wanting to do something NOW. Not tomorrow, not when we finished our formal education, not when the opportunity presented itself to us. NOW! This sense of urgency is important to seed early on and hang on to it.</p>\n<p>We knew some HTML, CSS, coding on my part (but not PHP), and that was pretty much it. No business experience, no mentors, no friends that were already doing this, no internet acquaintances that would give us some work to start from. Just us, a computer and the internet (that is, Romania’s internet speed — lucky us).</p>\n<p>So where to start? From the obvious place, of course. Freelancing marketplaces. After some looking around, we’ve settled for vWorker.com (mainly because it seemed more upper class than the likes of freelancer.com — it got bought by the latter in the meantime). We started with very small gigs and worked our way (in a couple of years) to larger projects.</p>\n<p>This is the point where we were forcibly introduced to WordPress. At first small customizations for themes, then the classic by now PSD-to-WP. We were getting the hang of it and loving it. We were honing our skills, making more money than most around us (it pays to have low living standards), and making a good name for ourselves.</p>\n<p>So stop making excuses and start doing something. Keep at it and good things will happen, with time.</p>\n<h3>But I want to be the Michelangelo of coders…</h3>\n<p>Oh please! I know you want to be the best you can be, that you think learning that extra technique will make you even greater, that exploring that extra framework will widen your possibilities. No it won’t. It will only postpone the day when you actually do something and put it to the test of actual people. I know, it scares the shit out of you. It surely did scare us.</p>\n<p>But that is the only way you will truly learn. You will hone your skills, but more importantly, you will learn what you actually need to know to get something done. That extra framework that you know will only drag you down. When faced with a problem you will have a hard time attacking it because you know so many “wonderful” ways it could be done. You will try to code for the sake of code.</p>\n<p>Trust me. You don’t really want to be Michelangelo (I think neither did he). You want to be happy and satisfied with your end results. This is where WordPress comes into play once again.</p>\n<p>It’s code base is not beautiful by any current standard. It’s not cutting edge, it’s not very “automagical”, part of it is truly out-dated, the templating is cumbersome bordering ancient in today’s landscape. You know it, I know it, and everybody else with some coding experience knows it. So what? Is it stopping you from crafting a sweet design and letting your customers enjoy it? Far from it.</p>\n<blockquote><p>Stop agonizing about what it can’t do for your coder ego, and focus on what it can do for your life and your customers.</p></blockquote>\n<p>Praise the internet gods for having such a low barrier of entry, for the gargantuan community, for the endless snippets of code laying around just ripe for copy-pasting. But above all else, thank each contributor that it hasn’t given up on “the user comes first”. It means your customers will also come first. What a great partner to have when starting out.</p>\n<p>And don’t worry, you will get plenty of opportunities to focus on crafting clever code in your themes and/or plugins. Just not at the scale of Google. But then again, you are not Google. It’s healthy to keep a firm footing in reality.</p>\n<h3>It sounds complicated, and I don’t have the resources</h3>\n<p>Are you committed to this or not? Good! Then stop for a moment and think. Do you have to build everything yourself? Do you have to learn everything? How could you cut some corners without anyone noticing?</p>\n<p>Welcome to the WordPress way (it could very well be the open-source way). The ones before you have literally put millions and millions worth of work on the table (that is dollars, not lei) for anyone to grab and use. You know CSS but not much PHP? Great, grab a starter theme. Or better yet, grab any free theme and hack it to your heart’s desire. And then sell it. Weird right?</p>\n<p>You envision your design with some fancy (aka complicated) functionality? I am sure there is a WordPress plugin out there that does pretty much that. Recommended it, offer styling for it and you are good to go — bootstrapping 101.</p>\n<p>One day, when you will afford it (and if really really makes sense), you can build your own bespoke solutions. But they better be damn good, ‘cuz otherwise few will notice the change.</p>\n<p>When we build a new theme, we purposely try to match the design specs with what is available on WP.org or as a paid add-on to a certain “master” plugin (like WooCommerce). This way we make sure we leave enough time/resources on the table for the things we are really good at: fine tuning the front-end, ensuring a smooth customization experience on the back-end, crafting the copy to help make the complex less so, and so on. Even with 11 strong as we are today, we wouldn’t be able to get at those without leveraging open-source.</p>\n<p>As you can see, the entire WordPress ecosystem is built on a can-do attitude. It’s fun being part of it. Don’t forget to give something back from time to time.</p>\n<h3>The WordPress “stain” will never wash</h3>\n<p>Sadly I still hear about this among developers. And I am sure it can be quite the deterrent for newcomers. I mean you don’t want to hang out with the wrong kind of people right from the start. You’ve got big, long term plans for you life. You could almost envision yourself interviewing for your dream job and being laughed upon for stating WordPress as your experience. It must suck, big time.</p>\n<p>Unless… you realize early on that you simply want to be happy, and that no convoluted line of code will make you happy. Come to think of it, you could create your own dream job.</p>\n<blockquote><p>Choose your own team mates. Forge your own values.</p></blockquote>\n<p>Maybe even a huge WordPress logo outside the office (just to spite the non-believers — or that’s what WordCamps are for?).</p>\n<p>The PixelGrade crew is filled with sinners from all walks of life. We bathe daily in less-than-perfect code, we shamelessly copy-paste code from StackOverflow (with proper attribution of course), we kick browser-compatibility’s butt with !importants… I should really stop. We are actually serious people — sort of.</p>\n<p>Anyway, if you’ve peeked inside the WordPress world and you truly feel it would hold you back, despite all the advantages, leave right ahead. But don’t avoid it just because of misconceptions. You may be missing out.</p>\n<hr class=\"ttfmake-hr\" />\n<p>I could go on mumbling for a long time (it’s a thing I am really good at :) — remember?). Better leave the rest for another time.</p>\n<p>Now, you Romanian (or less so) WordPress enthusiasts (or less so), do let me know your thoughts about the above.</p>\n<p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/really-no-excuse/\">You Really Have No Excuse</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 24 Jul 2016 20:45:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Vlad Olaru\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"HeroPress: How WordPress Taught Me To Be a Better Developer\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1001\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"http://heropress.com/essays/wordpress-taught-better-developer/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9239:\"<div class=\"rtsocial-container rtsocial-container-align-left rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: How WordPress Taught Me To Be a Better Developer\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=How%20WordPress%20Taught%20Me%20To%20Be%20a%20Better%20Developer&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Fwordpress-taught-better-developer%2F\" rel=\"nofollow\" target=\"_blank\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-twitter-count\"></span></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: How WordPress Taught Me To Be a Better Developer\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Fwordpress-taught-better-developer%2F\" rel=\"nofollow\" target=\"_blank\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-fb-count\"></span></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Fwordpress-taught-better-developer%2F&title=How+WordPress+Taught+Me+To+Be+a+Better+Developer\" rel=\"nofollow\" target=\"_blank\" title=\"Share: How WordPress Taught Me To Be a Better Developer\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-linkedin-count\"></span></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/wordpress-taught-better-developer/&media=http://heropress.com/wp-content/uploads/2016/06/ed_heropress_article_banner-150x150.jpg&description=How WordPress Taught Me To Be a Better Developer\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: How WordPress Taught Me To Be a Better Developer\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-pinterest-count\"></span></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/wordpress-taught-better-developer/\" title=\"How WordPress Taught Me To Be a Better Developer\"></a><input type=\"hidden\" name=\"rts_id\" class=\"rts_id\" value=\"1001\" /><input type=\"hidden\" id=\"rts_media_nonce\" name=\"rts_media_nonce\" value=\"0de9308744\" /><input type=\"hidden\" name=\"_wp_http_referer\" value=\"/feed/\" /></div><p>I might seem like a curious choice to write a post at HeroPress. I haven&#8217;t done any WP dev since around 2.0. I&#8217;ve done some work here and there setting up a couple WP installs since, but it&#8217;s been years since I was on a first-name basis with the code of WP.</p>\n<p>After having written some fairly complex plugins, I was pretty cynical about it. Generally I felt that it was a pretty solid front-end, but the codebase was a mess. It may still be a mess, I dunno. I do remember being super disappointed that WP didn&#8217;t go all-in with PHP5 when it stabilized, like some other CMSes. I also spent a fair bit of time criticizing what I felt were technical shortcomings or the codebase. A quick glance at the current codebase tells me it hasn&#8217;t changed much in it&#8217;s approach, and were I to judge the project just based on it&#8217;s codebase, I&#8217;d say it was… problematic.</p>\n<p>I was at <a href=\"https://gist.github.com/funkatron/php%7Ctek%202013\">php|tek 2013</a>, and <a href=\"http://tek13.phparch.com/speakers/#nacin\">one of the keynotes</a> was by <a href=\"https://nacin.com/\">Andrew Nacin</a>. Andrew knew he was speaking to a room filled with a lot of folks who felt like I did &#8212; that WordPress was somehow an <em>embarassment</em> to PHP because it wasn&#8217;t following current best practices. Some people took this quite personally, and spent a lot of time on Twitter during his keynote expressing disagreement with his assertions.</p>\n<p>I, however, found myself in wholesale agreement with Andrew. From the talk description:</p>\n<blockquote><p>Why is [WordPress] so ubiquitous? The answer lies … in a core philosophy that holds the user above all else.</p></blockquote>\n<p>The WordPress lead developers weren&#8217;t stupid, contrary to what so many people thought in that room. They just put the concerns of users over developers.</p>\n<p>The purpose of the project is to <strong>empower users</strong></p>\n<p>The purpose is <em>not</em> to make developers&#8217; lives easier.</p>\n<p>That meant making hard choices about living with legacy code, and being very, very careful about breaking backwards compatibility. Several of Andrew&#8217;s slides showed how utilizing newer PHP libraries or extensions would make it impossible for hundreds of thousands &#8212; sometimes <em>millions</em> &#8212; of WP users to run it on their current hosting provider. API changes due to major code refactors would break popular plugins that users rely on, and likely splinter the WP add-on developer community beyond recognition.</p>\n<p>&#8220;Fixing&#8221; WordPress would in fact make it useless to many, if not most, of the users.</p>\n<p>Ultimately I believe that this is the correct approach. The purpose of creating software, web or otherwise is to <strong>empower people to do things that they&#8217;d otherwise find more difficult or impossible</strong>.</p>\n<p>Web technologies are building blocks. We use them to build solutions to people&#8217;s problems. The point is not the thing we make, nor is the point how we make it. <strong>The point is to help the user</strong>.</p>\n<p>Have we given them more time to do other things by making a task take less time?</p>\n<p>Have we given them access to information they didn&#8217;t have before?</p>\n<p>Have we empowered them to create something they could not?</p>\n<p>Have we given them a voice they didn&#8217;t possess until now?</p>\n<p>Those are the kinds of questions we have to ask. Anything that we choose to do must be in the service of those questions.</p>\n<p><a href=\"https://gist.github.com/funkatron/harperreed.com\">Harper Reed</a> described technology as <strong>a <em>force multiplier</em></strong>, and I think it&#8217;s important to consider it in that respect. The intent is the matter of the user; <strong>the things we create take the user&#8217;s intent and amplify it</strong>.</p>\n<blockquote><p>This is key to really being great at what we do &#8212; we empathize with the user, understand their intent, and create something to amplify their intent.</p></blockquote>\n<p>Sometimes they need a bit of help applying their intent in the most effective ways, but <strong>our technology and technique choices can only serve that intent</strong>. The work I&#8217;ve done in the past few years hasn&#8217;t led me to use WordPress, but that doesn&#8217;t mean it&#8217;s not a very powerful, very useful tool for many people.</p>\n<p>The philosophy of the project continues to guide my thinking as a developer, a speaker at tech conferences, a school board member, and an advocate for mental wellness. In all of these, I have to find the intent, such as allowing a business owner to communicate more easily to customers, or to help others have satisfying careers, or to educate kids in the most effective way possible, or to help others who struggle with mental illness get the help they need.</p>\n<p>Then I have to find what I am able to do that serves that intent. Sometimes it means making a web-based tool. Sometimes it means practicing my technique to be a better speaker. Sometimes it means writing a letter to a frustrated parent. Sometimes it means pushing myself to do things I&#8217;m afraid to do, because it will make a big difference for people who are hurting, and are to afraid to ask for help.</p>\n<p><img class=\"alignnone size-full wp-image-1002\" src=\"http://heropress.com/wp-content/uploads/2016/05/osmi.png\" alt=\"Banner for OSMI, Open Sourcing Mental Illness\" width=\"1024\" height=\"583\" /></p>\n<p>Ultimately what I find most satisfying in life is not the particular actions I&#8217;ve chosen, but <strong>the impact they have upon the people around me</strong>.</p>\n<p><a href=\"http://j.mp/osmikalxvideo\">When I spoke</a> at the <a href=\"http://kalamazoox.org/\">Kalamazoo X conference</a> this spring, I was tasked by the organizers to come up with a <a href=\"https://www.amazon.com/All-Changed-Instant-Six-Word-Memoirs-ebook/dp/B003100UQ0\">six-word memoir</a>. It was an exercise that made me reflect on where I&#8217;ve been, where I hope I&#8217;m going, and how I want to be remembered. This is what I came up with:</p>\n<p>&#8220;By helping others, I save myself.&#8221;</p>\n<p>That&#8217;s what WordPress taught me.</p>\n<p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/wordpress-taught-better-developer/\">How WordPress Taught Me To Be a Better Developer</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 24 Jul 2016 20:45:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Ed Finkler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"HeroPress: Growing Through WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"http://heropress.com/?post_type=heropress-essays&p=996\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"http://heropress.com/essays/growing-through-wordpress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6853:\"<div class=\"rtsocial-container rtsocial-container-align-left rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: Growing Through WordPress\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=Growing%20Through%20WordPress&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Fgrowing-through-wordpress%2F\" rel=\"nofollow\" target=\"_blank\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-twitter-count\"></span></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: Growing Through WordPress\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Fgrowing-through-wordpress%2F\" rel=\"nofollow\" target=\"_blank\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-fb-count\"></span></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Fgrowing-through-wordpress%2F&title=Growing+Through+WordPress\" rel=\"nofollow\" target=\"_blank\" title=\"Share: Growing Through WordPress\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-linkedin-count\"></span></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/growing-through-wordpress/&media=http://heropress.com/wp-content/uploads/2016/05/sam_najian-150x150.jpg&description=Growing Through WordPress\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: Growing Through WordPress\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-pinterest-count\"></span></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/growing-through-wordpress/\" title=\"Growing Through WordPress\"></a><input type=\"hidden\" name=\"rts_id\" class=\"rts_id\" value=\"996\" /><input type=\"hidden\" id=\"rts_media_nonce\" name=\"rts_media_nonce\" value=\"3ee123df18\" /><input type=\"hidden\" name=\"_wp_http_referer\" value=\"/feed/\" /></div><p>Having coded on visual studio for quite a while an older fellow of mine got me more interested in web and developing for web by saying &#8220;developing for a desktop is not as fun and as challenging as developing for web, things can get very boring soon on desktop, on web you have more problems to solve and more things to learn&#8221; This was all enough to get me interested in programming for web. With a bit of Yahooing ( googling was not really common or even known back then) I learned about the simplest ui factors of web, CSS and HTML, so thought CSS is the first thing I would like to learn. You know I love colors, colors are attractive after all, specially compared to all the skeleton looking HTML which was never fun enough for me to learn about its font and color attributes.</p>\n<p>CSS and the appetite to learn more got me to this lovely blog of Chris Coyier, namely<a href=\"http://css-tricks.com\"> css-tricks.com</a>. Man you could find a lot in there and most interesting was the videos he did to teach new stuff every week or so. There was this <a href=\"https://css-tricks.com/video-screencasts/1-converting-a-photoshop-mockup-part-1-of-3/\">converting photoshop mockup</a> videos and <a href=\"https://css-tricks.com/video-screencasts/25-designing-for-wordpress-part-one/\">designing for WordPress</a> videos by him that brought me in touch with WordPress. Promise you won’t laugh and I will reveal a secret; before watching these WordPress templating video I was always mistaking WordPress logo for of that of <a href=\"http://www.volkswagen.de/de.html\">Volkswagen</a>, and was always really confused about the sentences on<a href=\"http://wordpress.org\"> wordpress.org</a> homepage and how they could relate to Volkswagen. Add to this my bad English, yea my English was even worse than what you see now in those days.</p>\n<p>I was already making some little money developing in vb, but the exposure to WordPress brought an even more fun and well in demand skill-to-be to my plate. I was learning more and more about WordPress here and there, getting a few clients to create some kind of online catalogues for them while trying to bring a CMS out of this blogging platform. Back then without all the fancy custom post types and custom taxonomies and all the rest that came with them was not an easy thing to treat WordPress as a CMS.</p>\n<h3>Expanding to the web</h3>\n<p>WordPress was great company for the situation of those days. I was a freshman university student with very little computer science education, almost no money to buy extracurricular courses but very eager to be independent and learn things on my own with the help of not-so-fast internet of those days. jQuery was just around as well and I was making JavaScript more fun and easy. Remember, JavaScript demand of those days was hardly anything other than manipulating the DOM, so the ease and fun of WordPress and the life-saver jQuery was empowering me to get clients and make them happy. Honestly I learned WordPress before even learning PHP, HTML, CSS, a bit of jQuery and some knowledge about WordPress was just enough for me to create websites, mostly in the online-catalogue realm.</p>\n<p>In those days Joomla and Drupal were much more advanced than WordPress since WordPress hadn’t added the more advanced features we have today.</p>\n<blockquote><p>So as I was learning more about WordPress, Web, and PHP, WordPress was getting bigger and more advanced.</p></blockquote>\n<p>Perfect timing right? It was small when I had little knowledge but was getting bigger and more advanced while I was educating myself more about WordPress.</p>\n<p>How WordPress makes things easy keeps me using it and developing for it even after  good experience with a couple of other PHP and JavaScript frameworks.  This is why after developing with some other PHP frameworks I was thrilled to receive an email from <a href=\"https://premium.wpmudev.org/\">WPMUDEV</a> telling me about their job vacancy for WordPress plugin developer, so I applied for this position with them and was lucky enough to get back to work with this lovely and fun tool after a while being away from it.</p>\n<p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/growing-through-wordpress/\">Growing Through WordPress</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 24 Jul 2016 20:45:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Sam Najian\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"HeroPress: Groomed for Real Estate, Destined for Something Else . . .\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"http://heropress.com/?post_type=heropress-essays&p=987\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"http://heropress.com/essays/groomed-real-estate-destined-something-else/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7787:\"<div class=\"rtsocial-container rtsocial-container-align-left rtsocial-horizontal\"><div class=\"rtsocial-twitter-horizontal\"><div class=\"rtsocial-twitter-horizontal-button\"><a title=\"Tweet: Groomed for Real Estate, Destined for Something Else . . .\" class=\"rtsocial-twitter-button\" href=\"https://twitter.com/share?text=Groomed%20for%20Real%20Estate%2C%20Destined%20for%20Something%20Else%20.%20.%20.&via=heropress&url=http%3A%2F%2Fheropress.com%2Fessays%2Fgroomed-real-estate-destined-something-else%2F\" rel=\"nofollow\" target=\"_blank\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-twitter-count\"></span></div></div><div class=\"rtsocial-fb-horizontal fb-light\"><div class=\"rtsocial-fb-horizontal-button\"><a title=\"Like: Groomed for Real Estate, Destined for Something Else . . .\" class=\"rtsocial-fb-button rtsocial-fb-like-light\" href=\"https://www.facebook.com/sharer.php?u=http%3A%2F%2Fheropress.com%2Fessays%2Fgroomed-real-estate-destined-something-else%2F\" rel=\"nofollow\" target=\"_blank\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-fb-count\"></span></div></div><div class=\"rtsocial-linkedin-horizontal\"><div class=\"rtsocial-linkedin-horizontal-button\"><a class=\"rtsocial-linkedin-button\" href=\"https://www.linkedin.com/shareArticle?mini=true&url=http%3A%2F%2Fheropress.com%2Fessays%2Fgroomed-real-estate-destined-something-else%2F&title=Groomed+for+Real+Estate%2C+Destined+for+Something+Else+.+.+.\" rel=\"nofollow\" target=\"_blank\" title=\"Share: Groomed for Real Estate, Destined for Something Else . . .\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-linkedin-count\"></span></div></div><div class=\"rtsocial-pinterest-horizontal\"><div class=\"rtsocial-pinterest-horizontal-button\"><a class=\"rtsocial-pinterest-button\" href=\"https://pinterest.com/pin/create/button/?url=http://heropress.com/essays/groomed-real-estate-destined-something-else/&media=http://heropress.com/wp-content/uploads/2016/05/nicole_osburn-150x150.jpg&description=Groomed for Real Estate, Destined for Something Else . . .\" rel=\"nofollow\" target=\"_blank\" title=\"Pin: Groomed for Real Estate, Destined for Something Else . . .\"></a></div><div class=\"rtsocial-horizontal-count\"><div class=\"rtsocial-horizontal-notch\"></div><span class=\"rtsocial-pinterest-count\"></span></div></div><a rel=\"nofollow\" class=\"perma-link\" href=\"http://heropress.com/essays/groomed-real-estate-destined-something-else/\" title=\"Groomed for Real Estate, Destined for Something Else . . .\"></a><input type=\"hidden\" name=\"rts_id\" class=\"rts_id\" value=\"987\" /><input type=\"hidden\" id=\"rts_media_nonce\" name=\"rts_media_nonce\" value=\"ba53090d47\" /><input type=\"hidden\" name=\"_wp_http_referer\" value=\"/feed/\" /></div><p>While other kids played with beanie babies I was hawking mine on eBay. I was always enamored with business and marketing. My family had a successful real estate business and at a young age I knew I wanted to go into business. I realized the importance of online marketing early on with my beanie baby business. Heck, I made two thousand dollars selling beanie babies when I was 13. I was not making that kind of money when I set up booths at collector shows. It’s all about the E-Commerce, baby!</p>\n<h3>Bubble burst</h3>\n<p>When I was 19, I obtained my real estate license. College was never really in my “life” plan. My plan was to work for the family business, in real estate.</p>\n<p>Unfortunately for me, I became a real estate agent in 2007. As you recall, the real estate market crashed in 2008 and it crashed hard. This is when I realized I had to change my career path because of the economy. I was heartbroken that I had to start over. Little did I know this was a blessing in disguise.</p>\n<h3>Diversification</h3>\n<p>Fast forward to my college years. -Oh boy!</p>\n<p><img class=\"alignright size-full wp-image-988\" src=\"http://heropress.com/wp-content/uploads/2016/05/Selection_431.png\" alt=\"Logo for 33.3\" width=\"201\" height=\"100\" />With an entrepreneurship spirit, a few of my friends and I joined forces to make the best t-shirt company ever. Our business model was flawless, well at least that’s what we had thought. The name of our company was 33.3 (I know, how cliché). We had a developer, graphic designer and a marketing/sales person.</p>\n<p>While our developer used Dreamweaver, this was the first time I understood the importance of web development. Watching Diggnation and conjuring up our next business scheme, I began to understand more about development, different kinds of files, and the difference between serif and sans serif (everything I now take for granted). The t-shirt business failed <img src=\"https://s.w.org/images/core/emoji/72x72/1f641.png\" alt=\"?\" class=\"wp-smiley\" /> but the lessons it taught me were priceless. This was the first time I knew I had to be a part of the web development process.</p>\n<h3>Back at it again</h3>\n<p>My family stumbled upon some land that was a great investment. It was a “no-brainer” to purchase because the price was too good to pass up. My sister and I decided it was time to learn how the building industry works. Trinity Home Builders emerged where I spent the next four years developing our marketing strategy and web presence.</p>\n<p>After working with three different web developers, I was still not happy with the end result of our website. So, I became obsessed with web development. After the website was in a good place, I was no longer content at Trinity. The CRM and PPC campaigns were on autopilot. Purchasing lumber and dealing with draw sheets was not my forte. I separated myself from Trinity and went back to school to finish the remaining two classes I needed to graduate in Marketing.</p>\n<h3>HTML &amp; CSS 101</h3>\n<p>Last summer I spend two nights a week learning the fundamentals of web development. I obtained a social media certificate after completing that course.</p>\n<p>During the course, we were assigned the task of developing a WordPress website. I finally had my “ah-ha” moment &#8211; now everything I was trying to do for so long made sense.</p>\n<p>Now, just because I can create a site on WordPress, this does not mean I’m a developer. It’s the organic SEO, GA, GSC, social media, and all other inbound marketing that drives me.</p>\n<p>After a combination of my HTML class and WordCamp sessions, WordPress became my CMS of choice and I never looked back.</p>\n<h3>WordCamp</h3>\n<p>I was fortunate to be able to volunteer the first year I attended WordCamp Milwaukee. It was the beginning of my initiation into the WordCamp community. I met many talented individuals during the sessions, volunteering, snagging swag and at the social events. These individuals were not just acquaintances I met in passing, but they became friends and invaluable resources. It was and continues to be a wonderful experience.</p>\n<p>During last year’s WordCamp at the speaker/sponsor after party, I had the privilege of meeting Topher. I shared my story with him and told him how WordPress had impacted my life for the better. He told me about HeroPress. He asked me if I would be interested in writing an essay about my WordPress journey thus far. And, here I am.</p>\n<p>Currently, I work for Tuna Traffic as a Digital Marketing Technologist, and every day I am learning something new. I’m excited to see where my WordPress journey takes me next!</p>\n<p>The post <a rel=\"nofollow\" href=\"http://heropress.com/essays/groomed-real-estate-destined-something-else/\">Groomed for Real Estate, Destined for Something Else . . .</a> appeared first on <a rel=\"nofollow\" href=\"http://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 24 Jul 2016 20:45:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Nicole Osburn\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"WPTavern: WordPress to Bump Recommended PHP Version From 5.6 to 7.0 By The Middle of 2017\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=58030\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"https://wptavern.com/wordpress-to-bump-recommended-php-version-from-5-6-to-7-0-by-the-middle-of-2017\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5703:\"<p>Over the years, WordPress has been developed so that users and site owners don&#8217;t need to have a lot of technical knowledge to install and maintain it. Andrey Savchenko believes that WordPress is <a href=\"https://www.rarst.net/wordpress/technical-responsibility/\">causing technical irresponsibility</a> due to site owners not having to know technical details like which PHP version their site is running.</p>\n<blockquote><p>Is not knowing good for you as a site owner?</p>\n<p>Few good things ever happened by accident and ignorance.</p>\n<p>Running your own site takes learning and effort. It is admirable of WordPress to make that easier. It is self–serving and insincere of it to pretend you don’t have to know anything.</p>\n<p>You <strong>have to know</strong>. You <strong>are responsible</strong>.</p></blockquote>\n<p>The post generated a healthy <a href=\"https://twitter.com/Rarst/status/755084068207861760\">discussion on Twitter</a> that included Matt Mullenweg.</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\"><a href=\"https://twitter.com/perezbox\">@perezbox</a> <a href=\"https://twitter.com/Rarst\">@Rarst</a> shallow article: straw man assumptions and arguments, poor understanding of hosting ecosystem, faux controversial ending.</p>\n<p>&mdash; Matt Mullenweg (@photomatt) <a href=\"https://twitter.com/photomatt/status/755204070789394432\">July 19, 2016</a></p></blockquote>\n<p></p>\n<p>Although it&#8217;s not happening at break neck speeds, there is an effort underway to increase WordPress&#8217; recommended PHP version from 5.6 to 7.</p>\n<p>In September of 2015, Aaron Jorbin <a href=\"https://make.wordpress.org/core/2015/09/10/wordpress-and-php7/\">published a post</a> on the Make WordPress Core blog that explains what was accomplished in order for WordPress to officially support PHP 7. In the comments of the post, <a href=\"https://make.wordpress.org/core/2015/09/10/wordpress-and-php7/#comment-27688\">Rahul286 suggests</a> that a warning be displayed that informs users they&#8217;re using an outdated version of PHP.</p>\n<p>Samuel &#8216;Otto&#8217; Wood <a href=\"https://make.wordpress.org/core/2015/09/10/wordpress-and-php7/#comment-27699\">succinctly explains</a> why a notice wouldn&#8217;t do any good.</p>\n<blockquote><p>A notice by itself is massively pointless to show the end user, who likely neither knows nor cares how their hosting service runs.</p>\n<p>However, it might be worth considering trying to detect the host in question, and providing valuable information for that specific host, such as links and other methods the end user can do to update themselves. Many hosts have a choice, somewhere, and if we know that, we can provide guidance.</p></blockquote>\n<p>Unlike WordPress&#8217; <a href=\"https://premium.wpmudev.org/blog/wordpress-3-2-browse-happy-or-browse-crappy/\">Browse Happy notifications added in WordPress 3.2</a> that notifies users to update their browser, it appears WordPress is unlikely to perform a similar role with PHP versions.</p>\n<p>Jorbin <a href=\"https://make.wordpress.org/core/2015/09/10/wordpress-and-php7/#comment-27670\">also commented</a> on the article suggesting that developers reach out to their local user groups and inform users why they need to care about which version of PHP their site is using.</p>\n<blockquote><p>One thing everyone can do to help move these numbers is to talk to your local user group about why they need to care about the PHP version they run. Show them how they can upgrade, show them benchmarks of PHP 7 vs. earlier versions (especially vs 5.2).</p></blockquote>\n<p>Three months ago, Jorbin created a <a href=\"https://core.trac.wordpress.org/ticket/36484\">trac ticket</a> with the suggestion that the PHP requirement for WordPress be increased from 5.6 to 7. Although many of the commenters agree with the move, Gary Pendergast <a href=\"https://core.trac.wordpress.org/ticket/36484#comment:8\">says</a> it&#8217;s best to wait. Dominik Schilling, WordPress 4.6 release lead, <a href=\"https://core.trac.wordpress.org/ticket/36484#comment:11\">agrees</a>.</p>\n<blockquote><p>Given that we have until the end of the year before we <em>have</em> to bump it, there&#8217;s no harm in holding off until major plugins are confirmed to work without notices or warnings. Until we can confirm that, I&#8217;m -1 on bumping the version for now.</p>\n<p>This is remembering that we&#8217;re talking about the <em>recommended</em> PHP version. The recommended version should be providing an ideal experience for folks, we shouldn&#8217;t be bumping to a bigger number just because it&#8217;s there.</p>\n<p>Given the PHP 5.6 support timeline, we&#8217;ll be bumping it by WordPress 4.8 at the latest, so it&#8217;d be nice to use those intervening months to ensure the UX for the wider WordPress ecosystem under PHP 7 is solid.</p></blockquote>\n<p>Major plugins like the <a href=\"https://core.trac.wordpress.org/ticket/36281\">WordPress Importer</a> are not yet compatible with PHP 7. Developers are highly encouraged to use the time before PHP 5.6 reaches <a href=\"http://php.net/supported-versions.php\">end of life</a> to thoroughly test their plugins and themes for PHP 7 compatibility.</p>\n<p>Mullenweg has <a href=\"https://make.wordpress.org/core/2015/09/10/wordpress-and-php7/#comment-27668\">made it clear</a> that he will not use WordPress&#8217; marketshare to force webhosting companies to upgrade to PHP 7 but rely on established relationships instead. In order to move the needle and get site owners to know and care about PHP versions, it&#8217;s going to take a continuous effort on the part of the WordPress community to educate them.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 23 Jul 2016 00:42:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WPTavern: BuddyPress 2.8 Will Bump Minimum PHP Requirement to 5.3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=57943\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://wptavern.com/buddypress-2-8-will-bump-minimum-php-requirement-to-5-3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3951:\"<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2014/09/buddypress-logo-blue.png?ssl=1\"><img src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2014/09/buddypress-logo-blue.png?resize=839%2C398&ssl=1\" alt=\"buddypress-logo-blue\" class=\"aligncenter size-full wp-image-30655\" /></a></p>\n<p>BuddyPress lead developers have decided to bump the minimum PHP requirement for version 2.8 of the plugin to 5.3+. The <a href=\"https://codex.buddypress.org/getting-started/php-version-support/\" target=\"_blank\">new guidelines for BuddyPress&#8217; PHP version support</a>, authored by Boone Gorges on behalf of the team, states that the plugin will offer full support for <a href=\"http://php.net/supported-versions.php\" target=\"_blank\">all stable versions of PHP officially supported by the PHP project</a> (currently, 5.6.x and 7.0.x). Gorges outlined what &#8220;full support&#8221; means:</p>\n<ul>\n<li>BuddyPress should run error-free (ie, without fatal errors or PHP notices) on the PHP version.</li>\n<li>If a new version of BP includes a feature that requires a more recent version of PHP, the feature should be gracefully disabled on earlier PHP versions.</li>\n<li>The PHP version will be included in the plugin&#8217;s <a href=\"https://travis-ci.org/buddypress/BuddyPress/\" target=\"_blank\">automated testing build matrix</a>.</li>\n</ul>\n<p>The BP leadership team agreed that the project will provide basic support for legacy versions of PHP &#8220;until the cost-benefit ratio for supporting a given version suggests that it should be dropped.&#8221; That is the case with 5.2, which is currently in use on 7.6% of WordPress sites. Gorges acquired additional statistics from WordPress.org that indicate only 3.23% of BuddyPress sites are running on PHP 5.2:</p>\n<p><code>Unknown - 1.08%<br />\n5.2     - 3.23%<br />\n5.3     - 12.92%<br />\n5.4     - 34.44%<br />\n5.5     - 22.38%<br />\n5.6     - 23.02%<br />\n7.0     - 2.92%</code></p>\n<p>Another factor in the team&#8217;s decision is the project&#8217;s recent <a href=\"https://wptavern.com/buddypress-2-7-development-kicks-off-project-shifts-focus-to-developers-and-site-builders\" target=\"_blank\">shift in focus towards developers and site builders</a>, prioritizing building out the BuddyPress REST API.</p>\n<p>&#8220;Coupled with these numbers is the recognition that PHP 5.3 introduced features that have a meaningful effect on our ability to write a modern PHP application: namespaces, closures, guaranteed access to SPL, late static binding, and so on,&#8221; Gorges said. &#8220;As BuddyPress aims to build a major new feature – a REST API – it frees us up significantly to be able to take advantage of these and other features unavailable in PHP 5.2.&#8221;</p>\n<p>Gorges also explained why BuddyPress isn&#8217;t bumping the minimum version all the way up to 5.6, which is the oldest version for which the PHP project is still issuing security updates. With roughly three quarters of BuddyPress sites running on PHP versions 5.5 or older, a major jump to 5.6 would break the majority of sites using the plugin.</p>\n<p>&#8220;For many (most?) people running BuddyPress, updating PHP is emphatically not a simple task,&#8221; Gorges said. &#8220;As such, we would simply lose these users, or cause them to stay on old and unsupported versions of BuddyPress. We support WordPress’ ongoing, progressive efforts to work with webhosts to move sites off of old versions of PHP.&#8221;</p>\n<p>These changes will go into effect as of BuddyPress 2.8. In the meantime, contributors are working on <a href=\"https://buddypress.trac.wordpress.org/ticket/7195\" target=\"_blank\">adding a notice</a> when activating BuddyPress on a site that doesn&#8217;t meet system requirements as well as <a href=\"https://buddypress.trac.wordpress.org/ticket/7196\" target=\"_blank\">preventing the plugin from being updated</a> when minimum requirements are not met.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 22 Jul 2016 18:56:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:37;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"WPTavern: Stack Overflow Documentation is Now in Beta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=57906\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://wptavern.com/stack-overflow-documentation-is-now-in-beta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4516:\"<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/07/stack-overflow.png?ssl=1\"><img src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/07/stack-overflow.png?resize=1025%2C401&ssl=1\" alt=\"stack-overflow\" class=\"aligncenter size-full wp-image-57913\" /></a></p>\n<p>Building on the success of its Q&amp;A communities, Stack Overflow <a href=\"http://blog.stackoverflow.com/2016/07/introducing-stack-overflow-documentation-beta/\" target=\"_blank\">announced</a> that its new <a href=\"http://stackoverflow.com/tour/documentation\" target=\"_blank\">Documentation</a> product is now in beta. For the past eight years, the site has rewarded expert advice by floating high quality answers to the top and allowing users to earn reputation points. This formula has turned out to be more successful than traditional forums where it&#8217;s often difficult, if not impossible, to discern the quality of answers provided to questions.</p>\n<p>Stack Overflow Documentation is curated by the community and focuses on providing code examples for developers. It offers versioning, collaborative authoring, and voting, which helps surface the best contributions. The documentation segment of the site has a new set of reputation badges and is open to contribution and feedback from anyone.</p>\n<p>&#8220;Documentation gives a home to a lot of this good content that has been turned away, or very hard to &#8216;get right&#8217; in the Q&amp;A format. Namely, the canonical, general reference, instructional content,&#8221; Stack Overflow developer Kevin Montrose said in the announcement.</p>\n<p>&#8220;It&#8217;s need-driven and self-healing,&#8221; Montrose said. &#8220;The best, most diligent technical writer out there still can&#8217;t beat thousands of actual users trying to learn a function or concept while writing real code. They&#8217;ll determine what topics or examples are needed most. And whenever something fails to explain something clearly, they can ask for it to be improved.&#8221;</p>\n<p>The <a href=\"http://wordpress.stackexchange.com/\" target=\"_blank\">WordPress Stack Exchange</a> is a thriving community and a <a href=\"http://stackoverflow.com/documentation/wordpress\" target=\"_blank\">WordPress documentation tag</a> is already active on Stack Overflow with 10 topics, 12 topic requests, and 13 proposed. A sampling of topics so far include the Loop, registering custom post types, making network requests with HTTP API, and enqueuing scripts.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/07/wordpress-documentation-stack-overflow.png?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/07/wordpress-documentation-stack-overflow.png?resize=1025%2C696&ssl=1\" alt=\"wordpress-documentation-stack-overflow\" class=\"aligncenter size-full wp-image-57915\" /></a></p>\n<p>It would take many months, if not years, for the Stack Overflow WordPress Documentation to even come close to the quantity of official documentation on WordPress.org, but the site has the potential to become a valuable alternative resource. The fact that anyone can jump in and contribute using an existing Stack Overflow account makes the barrier to entry very low.</p>\n<p>&#8220;From my experience with WP docs over years there is a significant issue with people using code snippets over and over again, while they become long outdated,&#8221; said Andrey Savchenko, a longtime WordPress Stack Exchange contributor and moderator.</p>\n<p>&#8220;However, my first impression is that Documentation is considerably harder to use than the Q&amp;A sites,&#8221; he said. &#8220;It will take some time to see if it will be easier to contribute to than say Codex and Devhub, as well as if it manages to gather a community of WP experts to consistently participate.&#8221;</p>\n<p>For whatever reason, many developers are not fond of writing documentation, especially when it comes to documenting products that are not their own. Stack Overflow&#8217;s Documentation beta will show whether recognition in the form of badges and reputation can attract people who otherwise wouldn&#8217;t be inclined to contribute to documentation.</p>\n<p>If Stack Overflow can motivate developers to write documentation with the same success as the Q&amp;A sites, the company may potentially <a href=\"http://disq.us/p/1a8c0kf\" target=\"_blank\">explore adding this feature to its Enterprise version</a>, which is built to support private instances of 500 or more users.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 22 Jul 2016 16:57:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:113:\"WPTavern: WPCampus Survey Results Indicate Misconceptions of WordPress Are Slowing its Growth in Higher Education\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"https://wptavern.com?p=57793&preview_id=57793\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:124:\"https://wptavern.com/wpcampus-survey-results-indicate-misconceptions-of-wordpress-are-slowing-its-growth-in-higher-education\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3611:\"<p>Before the first inaugural <a href=\"https://wpcampus.org/\">WPCampus</a> took place last weekend, the organizing team <a href=\"https://wptavern.com/help-wpcampus-gather-data-on-how-schools-and-campuses-use-wordpress\">conducted a survey</a> to learn how WordPress is used in higher education. A total of 486 people responded to the survey. Modern Tribe has not only made the <a href=\"http://bit.ly/WPCampusStudy\">survey results available to the public</a>, they have also published <a href=\"http://tri.be/blog/wpcampus-survey-wordpress-trends-in-education/\">an in-depth</a> review of the data.</p>\n<p>There are a couple of items that stand out to me. Misconceptions that have plagued WordPress for years are affecting people&#8217;s decision to use it.</p>\n<p>For instance, 18% of respondents said scalability is a barrier to being accepted at their school. Meanwhile, 37% of respondents said that WordPress&#8217; reputation of being <em>just a blogging platform</em> hindered its ability to be the platform of choice.</p>\n<p>The <a href=\"https://wordpress.org/showcase/\">WordPress showcase</a> is filled with sites both large and small that prove WordPress&#8217; scalability. It&#8217;s also filled with sites that show WordPress is used for far more than blogging.</p>\n<p>As WordPress continues to evolve from being a blogging platform to something capable of doing much more, it&#8217;s disappointing that this misconception still exists. Is there any hope that people can discover and realize that blogging is something WordPress is great at, but at its core, provides people the ability to go above and beyond?</p>\n<p>Another fascinating part of the survey is the security aspect where 42% of respondents reported that they do not have a list of vetted plugins for their network. In addition, 13% of respondents said their networks are not running the latest version of WordPress.</p>\n<p>How survey questions are asked can be the difference between receiving actionable or unusable data. ModernTribe acknowledges that the questions in future versions of the survey can be worded better to increase the accuracy of data.</p>\n<blockquote><p>If you take a look at the multi-part question we used to help qualify the institutions represented in the survey, you’ll that it could have been written much better. Since the main part of the question was mandatory, the survey also made the subsection where you could input your URL mandatory as well.</p>\n<p>Other areas we can improve include better categorization for multiple-choice questions, including an option for &#8216;n/a&#8217; or &#8216;I don’t know&#8217; in more questions, and fewer write-in responses.</p></blockquote>\n<p>If you&#8217;re interested in reviewing the survey results, you can access them via <a href=\"http://bit.ly/WPCampusStudy\">this spreadsheet</a> on Google Docs.</p>\n<p>For those that didn&#8217;t get a chance to attend WPCampus in person or watch it live, I highly encourage you to read <a href=\"http://davidbisset.com/wpcampus-review/\">this review</a> from David Bisset, who has organized a number of large WordPress conferences. There&#8217;s also <a href=\"https://calderawp.com/2016/07/wpcampus-2016-recap/\">this review</a> by Josh Pollock of CalderaWP. Last but not least, Adam Warner <a href=\"https://wpdistrict.sitelock.com/blog/wp-campus-a-wordpress-event-focused-on-higher-education/\">shares his experience</a> on the SiteLock blog.</p>\n<p>What do you think of the WPCampus survey results? Is there any data that surprises you? Let us know in the comments.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 21 Jul 2016 23:56:36 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"WPTavern: WPWeekly Episode 242 – Interview with Eric Meyer\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"https://wptavern.com?p=57789&preview_id=57789\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://wptavern.com/wpweekly-episode-242-interview-with-eric-meyer\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2812:\"<p>In this episode of WordPress Weekly, <a href=\"http://marcuscouch.com/\">Marcus Couch</a> and I are joined by <a href=\"http://meyerweb.com/\">Eric Meyer</a>. Meyer is an American web design consultant and author. He is best known for his advocacy work on behalf of<a href=\"https://en.wikipedia.org/wiki/Web_standards\"> web standards</a>, most notably<a href=\"https://en.wikipedia.org/wiki/Cascading_Style_Sheets\"> Cascading Style Sheets</a> (CSS), which is a technique for managing how<a href=\"https://en.wikipedia.org/wiki/HTML\"> HTML</a> is displayed.</p>\n<p>We start off the show by discussing the technology of the 70s and 80s and how Meyer got involved with the CSS language. We then go in-depth on a number of topics covered in his WordCamp Northeast Ohio keynote presentation on <a href=\"http://wordpress.tv/2016/06/24/eric-a-meyer-design-for-real-life/\">Designing for Real Life</a>. Near the end of the interview, we find out what the state of CSS is and some of the key developments to keep an eye on.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"https://wordpress.org/news/2016/07/wordpress-4-6-beta-4/\">WordPress 4.6 Beta 4</a><br />\n<a href=\"http://wordpress.tv/2016/06/24/eric-a-meyer-design-for-real-life/\">Eric Meyer &#8211; Designing for Real Life</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/byconsole-woo-order-delivery-time/\">WooCommerce Order Delivery or Pickup with Date and Time </a>is a plugin that allows customers to choose a desired delivery/pickup date and time for WooCommerce&#8217;s orders through a frontend widget. You can control number of days required to place an order, delivery hours to choose from, and the pickup hours available.</p>\n<p><a href=\"https://wordpress.org/plugins/haremo-social-screenshots/\">HAREMO Social Screenshots </a>creates screenshots of Posts and Pages and uses the screen grabs as thumbnail images when the URL is shared on Facebook or Twitter.</p>\n<p><a href=\"https://wordpress.org/plugins/cf7-messenger/\">Cf7 Messenger </a>works with Contact Form 7 and immediately sends submissions to Facebook Messenger.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, August 3rd 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"https://wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #242:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 21 Jul 2016 20:42:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:141:\"WPTavern: Ford Foundation Publishes Non-Technical White Paper on Open Source Software and the Challenges of Sustaining Digital Infrastructure\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=57765\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:152:\"https://wptavern.com/ford-foundation-publishes-non-technical-white-paper-on-open-source-software-and-the-challenges-of-sustaining-digital-infrastructure\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6254:\"<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/07/roads.jpg?ssl=1\"><img src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/07/roads.jpg?resize=960%2C564&ssl=1\" alt=\"photo credit: Khara Woods\" class=\"size-full wp-image-57770\" /></a>photo credit: <a href=\"https://stocksnap.io/photo/476JX1HAUX\">Khara Woods</a>\n<p>Last week the Ford Foundation <a href=\"http://www.fordfoundation.org/library/reports-and-studies/roads-and-bridges-the-unseen-labor-behind-our-digital-infrastructure/\" target=\"_blank\">published a white paper</a> titled &#8220;Roads and Bridges: The Unseen Labor Behind Our Digital Infrastructure.&#8221; The foundation, established in 1936 by Edsel Ford, president of the Ford Motor Company, is currently working to challenge inequality and advance human welfare. This new document in the foundation&#8217;s library, written by Nadia Eghbal, addresses the challenges of sustaining our digital infrastructure:</p>\n<blockquote><p>Everybody relies on shared code to write software, including Fortune 500 companies, government, major software companies and startups. In a world driven by technology, we are putting increased demand on those who maintain our digital infrastructure. Yet because these communities are not highly visible, the rest of the world has been slow to notice.</p>\n<p>Just like physical infrastructure, digital infrastructure needs regular upkeep and maintenance. But financial support for digital infrastructure is much harder to come by.</p></blockquote>\n<p>Eghbal, an amateur software developer who previously worked in venture capital, drew from her experience using open source code when preparing the 143-page report. She also interviewed many leaders and contributors in various open source software communities.</p>\n<p>&#8220;After I left my job in venture capital last year, I set off to explore the paradox I couldn’t stop thinking about: that there were valuable software tools that couldn’t be supported by commercial models, and that they lacked any form of institutional support,&#8221; she said.</p>\n<p>The unique thing about this extraordinary contribution from the Ford Foundation is that Eghbal wrote the document to help consumers and companies understand the toll open source software takes on its contributors and offers strategies for how they can be supportive of the world&#8217;s shared digital infrastructure. It bridges a critical gap in understanding between the open source software development community and the people who use the software every day.</p>\n<p>&#8220;Most of us take opening a software application for granted, the way we take turning on the lights for granted,&#8221; Eghbal said. &#8220;We don’t think about the human capital necessary to make that happen.&#8221;</p>\n<p>Eghbal compares the physical infrastructure of the transportation industry to that of the digital world. She contends that the decentralized nature of digital infrastructure makes it more difficult to maintain as a public good. Since the progress is driven by citizens working together, and not by any official governing body, it requires consumers and companies to be supportive of how software communities work if we hope to achieve long-term sustainability of the open source projects we depend on.</p>\n<p>Eghbal introduces consumers to common ways that open source projects find financial support but also highlights how many widely used projects can fall through the cracks. The document opens with the example of OpenSSL and the Heartbleed vulnerability which was exposed in 2014.</p>\n<p>&#8220;A 2015 study by the Federal University of Minas Gerais in Brazil looked at 133 of the most actively used projects hosted on GitHub, across programming languages, and found that 64%, or nearly two-thirds, relied upon just one or two developers to survive,&#8221; Eghbal said. &#8220;Although there may be a long tail of casual or infrequent contributors, for many projects, the major responsibilities of project management fall on just a few people.&#8221;</p>\n<p>In offering a brief history of open source software, Eghbal cites WordPress as a prime example (on page 34) of software that is flexible to customize thanks to the freedom its creators gave the project when licensing it under the GPL. Nevertheless, our community shares many of the struggles identified in the document, as maintainers of some of our most important development tools often cannot find financial support that will enable them to keep working on these projects.</p>\n<p>The white paper covers many important topics that help non-technical consumers understand the critical need to support the creators of our digital infrastructure. A few example chapters include:</p>\n<ul>\n<li>How not charging for software transformed society</li>\n<li>Why digital infrastructure support problems are accelerating</li>\n<li>Open source’s complicated relationship with money</li>\n<li>Business models for digital infrastructure</li>\n<li>Institutional efforts to support digital infrastructure</li>\n</ul>\n<p>Eghbal advocates treating digital infrastructure as a necessary public good and working with existing software communities. She calls for a more holistic approach to project support, beyond just code and money.</p>\n<p>Many of the topics in this white paper are completely new ideas for software consumers but Eghbal&#8217;s explanations make them easy for anyone to understand. She includes basic explanations for software terms like frameworks, libraries, and languages, and explains why certain types of open source projects have a more difficult time finding a means of financial support.</p>\n<p>I highly recommend reading this document, whether you are an open source project maintainer, a company decision maker who contracts software development, or a consumer. The white paper doesn&#8217;t just explore the challenges but also offers constructive ways that people of all walks of life can work together to support our digital infrastructure. You can <a href=\"http://www.fordfoundation.org/library/reports-and-studies/roads-and-bridges-the-unseen-labor-behind-our-digital-infrastructure/\" target=\"_blank\">download the PDF</a> for free from the Ford Foundation.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 21 Jul 2016 20:11:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:108:\"WPTavern: Downtime Expected for Some WP Engine Customers as Linode Patches A Critical Security Vulnerability\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"https://wptavern.com?p=57724&preview_id=57724\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:119:\"https://wptavern.com/downtime-expected-for-some-wp-engine-customers-as-linode-patches-a-critical-security-vulnerability\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2128:\"<p>WP Engine customers on legacy Xen Linode host servers are being notified via email and the <a href=\"https://wpenginestatus.com/cloud-security-maintenance-may-cause-downtime/\">company&#8217;s status blog</a> about impending downtime between July 21st and July 25th. According to an email forwarded to the Tavern from a WP Engine customer, Linode&#8217;s <a href=\"https://status.linode.com/incidents/dgzvdyqttr9f\">legacy Xen host servers</a> contain a critical security vulnerability.</p>\n<blockquote><p>We are contacting you today regarding an upcoming emergency security maintenance being performed at one of our cloud infrastructure providers. The majority of cloud infrastructure providers across the world will be conducting maintenance due to this situation.</p></blockquote>\n<p>The details of the vulnerability <a href=\"http://xenbits.xen.org/xsa/\">are embargoed</a> until July 26th giving Linode a limited amount of time to patch its systems. According to Linode, the company has no control over the disclosure date.</p>\n<p>WP Engine expects the maintenance procedure to be conducted at some point on July 23rd. Downtime could last anywhere from 20-40 minutes during the migration.</p>\n<p>This isn&#8217;t the first time both companies have been in the news due to security issues. Earlier this year, <a href=\"https://wptavern.com/linode-confirms-data-security-breach-that-matches-recent-wp-engine-attack\">Linode confirmed</a> that it experienced a data breach which resulted in resetting all of its customer&#8217;s passwords. The data breach was similar to one experienced by WP Engine where an attacker bypassed multiple layers of security to gain access to an administrative panel.</p>\n<p>Linode is encouraging customers using its legacy Xen servers outside of hosting providers to <a href=\"https://www.linode.com/docs/uptime/reboot-survival-guide\">review the following document</a> to prepare for the reboot. WP Engine customers affected by this issue are encouraged to check the <a href=\"http://wpenginestatus.com\">company&#8217;s status blog</a> for further updates.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Jul 2016 22:48:43 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:117:\"WPTavern: 18 WordPress Plugins Updated Due to Summer of Pwnage Findings, 40+ Vulnerabilities Still in Reporting Stage\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=57668\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:126:\"https://wptavern.com/18-wordpress-plugins-updated-due-to-summer-of-pwnage-findings-40-vulnerabilities-still-in-reporting-stage\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3211:\"<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/07/summer-of-pwnage.png?ssl=1\"><img src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/07/summer-of-pwnage.png?resize=1025%2C390&ssl=1\" alt=\"summer-of-pwnage\" class=\"aligncenter size-full wp-image-57671\" /></a></p>\n<p><a href=\"https://sumofpwn.nl/\" target=\"_blank\">Summer of Pwnage</a>, a Dutch community program for anyone interested in software security, is focusing on WordPress for its current open source security bug hunting event. The community program hosts meetups and workshops on the weekend where anyone from &#8220;enthusiastic beginners to the 1337est hackers&#8221; is welcome to share findings and demonstrate skills and exploits.</p>\n<p>The goal of the community event is to contribute to the security of widely used open source software projects and participants are strongly encouraged to responsibly disclose vulnerabilities to the authors of the original code. WordPress and its thousands of plugins are the target for this month, which organizers call &#8220;a bug hunter&#8217;s paradise.&#8221;</p>\n<p>Summer of Pwnage <a href=\"https://sumofpwn.nl/advisories.html\" target=\"_blank\">July 2016 findings</a> includes dozens of vulnerabilities discovered in popular WordPress plugins. So far, 18 vulnerabilities have been fixed by the plugin authors and more than 40 others are currently in the reporting stage.</p>\n<p>This week Ninja Forms, which has more than 600,000 active installs, issued <a href=\"https://wordpress.org/plugins/ninja-forms/changelog/\" target=\"_blank\">a security release</a> that fixed multiple Cross-Site Scripting (XSS) vulnerabilities discovered by Summer of Pwnage participants. The bug hunters also discovered a XSS vulnerability in WooCommerce (active on over a million installs), which was subsequently <a href=\"https://woocommerce.wordpress.com/2016/07/19/woocommerce-2-6-3-fixsecurity-release-notes/\" target=\"_blank\">patched</a>.</p>\n<p>Security updates are also available for other popular plugins as the result of the program&#8217;s efforts, including Paid Memberships Pro, WP Fastest Cache, Easy Forms for MailChimp, and others. The list of reported vulnerabilities includes links to describe each and is being updated frequently, as WordPress plugin authors release patches to their plugins.</p>\n<p>Summer of Pwnage is hosted at <a href=\"https://www.securify.nl/\" target=\"_blank\">Securify</a>, a software security company. Organizers provide users with VMs and set them loose hunting bugs. The focus of the event is sharing knowledge and teaching others and has been highly beneficial to the WordPress community so far.</p>\n<p>With WordPress plugin vulnerabilities so plentiful, even within the top professionally supported plugins, it would be great to see a niche conference or virtual event focused on security with a contributor day. WordPress needs more guardians spread across the community that can specialize in contributing back in this way. Educational events like Summer of Pwnage demonstrate how successful this kind of event can be for hunting down serious vulnerabilities in the software that millions of people use every day.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Jul 2016 21:38:12 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"WPTavern: Human Made is Giving Away Two Full Scholarships to A Week of REST Conference\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=57650\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"https://wptavern.com/human-made-is-giving-away-two-full-scholarships-to-a-week-of-rest-conference\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1349:\"<p><a href=\"https://aweekofrest.hm/\">A Week of REST</a>, a four-day conference devoted to the WordPress REST API that takes place September 4-9 in Darwin Lake, Matlock in the United Kingdom, <a href=\"https://hmn.md/2016/07/20/announcing-two-full-scholarships-a-week-of-rest-for-students-and-under-represented-groups-in-the-tech-industry/\">has announced</a> it is offering two full scholarships for students and under-represented groups in the tech industry.</p>\n<p>“The WordPress REST API is transforming how people use WordPress, opening it up to new technologies and communities. We want to enable people from under-represented groups in technology to develop the skills they need to use the REST API and further their career,” said Siobhan McKeown, Events Director at Human Made.</p>\n<p>The scholarships are worth £1500, and include all of the workshops, training, accommodation, meals, and transfer to Derby or Matlock station. To qualify for the scholarships, you must be employed or looking for work in the field of web development or design.</p>\n<p>Those interested in applying have until July 29th, Midnight CET, to <a href=\"https://aweekofrest.hm/page/scholarship-tickets\">submit an application</a>. Applicants will receive an email by August 5th with details on who received a scholarship.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Jul 2016 20:40:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"WPTavern: WP-CLI GUI: An Interface to Speed Up WordPress Installation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=57554\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"https://wptavern.com/wp-cli-gui-an-interface-to-speed-up-wordpress-installation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2563:\"<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/07/wp-cli-gui.png?ssl=1\"><img src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/07/wp-cli-gui.png?resize=1025%2C400&ssl=1\" alt=\"wp-cli-gui\" class=\"aligncenter size-full wp-image-57658\" /></a></p>\n<p><a href=\"https://wpcligui.com/\" target=\"_blank\">WP-CLI GUI</a> is a new tool from WordPress developer <a href=\"http://timbrugman.com/\" target=\"_blank\">Tim Brugman</a>, created to speed up the creation of new WordPress sites when using <a href=\"http://wp-cli.org/\" target=\"_blank\">WP-CLI</a>. The tool captures the details required to configure the database, site info, admin user, and password. It outputs one long command that WP-CLI users can copy and paste.</p>\n<p>At first it might seem counterintuitive &#8211; if you use the command line to manage WordPress, why would you want to add an extra interface to your workflow? Brugman explained the problem that led him to create WP-CLI GUI:</p>\n<p>&#8220;I heard about WP-CLI and gave it a shot,&#8221; he said. &#8220;I thought it was very neat for managing your sites but a bit of a hassle for new installs. Because installing WP with the CLI is a sequence of commands, if you don&#8217;t concatenate them, you have wait for each to end. It&#8217;s especially annoying because the first, downloading WP, takes the longest.&#8221;</p>\n<p>If you concatenate all of the commands into one giant command with all of the installation variables, the risk of typos increases to where you need to copy and paste.</p>\n<p>&#8220;Once I started copy pasting, I figured I might as well automate that with JavaScript,&#8221; Brugman said. &#8220;That became the ridiculous GUI for the CLI.&#8221;</p>\n<p>Brugman plans to expand with options for removing Akismet and Hello Dolly and is considering adding a list of optional plugins to install.</p>\n<p>&#8220;Depending on the number of plugins you &#8216;always&#8217; use, could save some more time,&#8221; he said. &#8220;Tasks beyond the installation I haven&#8217;t yet looked at. Requests are welcome.&#8221;</p>\n<p><a href=\"https://wpcligui.com/\" target=\"_blank\">WP-CLI GUI</a> is supported by <a href=\"https://toscani.nl/\" target=\"_blank\">Toscani</a>, a web development company. Brugman and his colleagues there use the tool to speed up installation of new WordPress sites. He said the tool is ideally suited for developers who often create new WordPress sites and are comfortable with the command line but don&#8217;t use WP-CLI at every opportunity.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Jul 2016 16:55:38 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:106:\"WPTavern: John James Jacoby Publishes 35 Part Tweetstorm on WordPress Leadership, Community, and Economics\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=57643\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:115:\"https://wptavern.com/john-james-jacoby-publishes-35-part-tweetstorm-on-wordpress-leadership-community-and-economics\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6722:\"<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2014/11/jjj.jpg?ssl=1\"><img class=\"alignright wp-image-33407 size-medium\" src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2014/11/jjj.jpg?resize=300%2C145&ssl=1\" alt=\"jjj\" /></a><a href=\"http://jjj.me/\">John James Jacoby</a>, lead developer of bbPress and BuddyPress, published a <a href=\"https://twitter.com/JJJ/status/755490645976940544\">35 part tweetstorm</a> sharing his thoughts on leadership in the WordPress project, the community, and the WordPress economy. A tweetstorm is a series of tweets linked together in chronological order around a particular topic.</p>\n<p>There are a number of useful nuggets of wisdom in his tweets that I think can benefit from more exposure to a wider segment of the WordPress community outside of Twitter. It&#8217;s a snapshot of one individual&#8217;s eight year plus journey in trying to create a sustainable business using WordPress. With Jacoby&#8217;s permission, I&#8217;ve republished his tweetstorm into a blog post to make it easier to read and digest.</p>\n<hr />\n<p>No exacting leadership hierarchy provides the perception of opportunity for anyone to step-up. This is actually really important. Having<a href=\"https://twitter.com/photomatt\"> @photomatt</a> (Matt Mullenweg) be the BDFL (Benevolent Dictator For Life) means we always have a safety net, to help the community be true-north during times of unrest.</p>\n<p>Don&#8217;t forget that<a href=\"https://twitter.com/photomatt\"> @photomatt</a> purposely has made monumental gestures to remove himself and<a href=\"https://twitter.com/automattic\"> @automattic</a> as a WordPress dependency. It&#8217;s up to the 99% of us that aren&#8217;t<a href=\"https://twitter.com/photomatt\"> @photomatt</a> to learn from what he&#8217;s accomplished, and find the ways to invest that he hasn&#8217;t yet.</p>\n<p>Core, Plugins, Themes, etc… none of this in WordPress is easy or directly profitable. It&#8217;s all a very long gamble to sustainability. Some WordPress companies/agencies have long-term investment strategies outside of employee retention/satisfaction. Again, it&#8217;s a long game.</p>\n<p>Ultimately, WordPress needs more than<a href=\"https://twitter.com/automattic\"> @Automattic</a>&#8216;s bank-roll to help empower the next generation of awesome plugins/themes as products. Some people in the WordPress community that have labeled me: Hot-Lava: Do Not Touch – that makes me sad, because I don&#8217;t feel that way.</p>\n<p>People will choose to stonewall professional progress because of misperception. Biases exist all around the WordPress community. Some of the most prolific contributors to WordPress (<a href=\"https://twitter.com/alexkingorg\">@alexkingorg</a>,<a href=\"https://twitter.com/koop\"> @koop</a>, etc…) ultimately were shunned and exiled. It can be toxic.</p>\n<p>When<a href=\"https://twitter.com/johnbillion\"> @johnbillion</a> (John Blackbourn) says there&#8217;s a lack of leadership – there is plenty of leadership, it&#8217;s all just currently in a holding pattern. Holding patterns are not bad things, they are necessary to assess what happens next. And there is more happening than ever before.</p>\n<p>WordPress is about to get real. Reporting will shape your perception of progress, because there is too much progress to report on. <a href=\"https://twitter.com/post_status\">@post_status</a> &amp;<a href=\"https://twitter.com/wptavern\"> @wptavern</a> are our CNN and BBC. They are plugged in so the rest of us do not have to be, and can worry about other things.</p>\n<p>I&#8217;ve made a lot of friends and allies through WordPress, and accidentally made foes somehow too. That&#8217;s not fair. We all need each other. So many individuals are pouring their lives into passion projects surrounding WordPress, hoping to eventually pay their kids tuition.</p>\n<p>Talented individuals wanting a better life for their families than they had, busting their butts 24/7 on great ideas, need our support. When someone says <em>this plugin sucks because whatever</em> – it&#8217;s an OPPORTUNITY to help someone. Take it, be helpful, that&#8217;s the spirit.</p>\n<p>When someone says <em>this WordCamp talk was bad</em> – provide that person with feedback yourself, in private, and help elevate them. The problems of the relatively small WordPress community are systemic across all communities. Be ready to be wrong, learn, and recover.</p>\n<p>I&#8217;d be lying if I said I wanted to take a vow of poverty, relinquish my earthly possessions, and accept WordPress as my CMS and savior. I do want to be profitable enough (thanks to my WordPress experience) to provide others with stable and comfortable living conditions.</p>\n<p>I&#8217;m eight solid years in, with a thorough understanding of the entire WordPress landscape, and know there are good people struggling. There&#8217;s no reason for qualified professionals to struggle in the WordPress space anymore. There is LIMITLESS opportunity and ability.</p>\n<p>I deeply want WordPress to continue down the trajectory of success, and I want everyone following me to succeed along with it. Angel rounds dramatically increase the odds of success. Companies like<a href=\"https://twitter.com/10up\"> @10up</a> (the bootstrapped anomalies) need a<a href=\"https://twitter.com/jakemgold\"> @jakemgold</a> (Jake Goldman) to work.</p>\n<p>People are VERY quick to categorize. Yes; I&#8217;m an engineer. I also love philosophy, business, yo-yo&#8217;s, and clearly tweet-storms. The next time someone says something negative about someone/thing WordPress related, please remind them super-villains are not real.</p>\n<p>To make money in WordPress, you need to be likable, and build products where your likability shines through. Like<a href=\"https://twitter.com/pippinsplugins\"> @pippinsplugins</a> (Pippin Williamson). Being likable and profitable in open-source means having integrity, focusing on people more than product, and hoping it pays off in the end.</p>\n<p>I think I&#8217;m likable, and I&#8217;d always like to be more likable, but I also know tweet-storms like this make people think you&#8217;re crazy. If you think there is ANYTHING I can do personally or professionally to help you, please know that I desperately want to.</p>\n<p>I used to know<a href=\"https://twitter.com/photomatt\"> @photomatt</a> very well. He&#8217;s not a bad guy; he&#8217;s a great guy. Also an easy target. Concentrate on you. Shout-out to my starving indie plugin and theme artists out there. You rule. Don&#8217;t give up. We&#8217;ll figure it out together. Thanks for listening; sorry to muck-up your day. WordPress rules because of all of you.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 19 Jul 2016 21:49:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"WPTavern: Easily Add, Remove, and Rearrange Columns With The Admin Columns Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"https://wptavern.com?p=57565&preview_id=57565\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://wptavern.com/easily-add-remove-and-rearrange-columns-with-the-admin-columns-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2834:\"<p>If you find yourself wanting more control over the columns on the posts, post types, pages, media, comments, links, and users administration screens, take a look at the <a href=\"https://wordpress.org/plugins/codepress-admin-columns/\">Admin Columns</a> plugin. Admin Columns, developed by <a href=\"https://profiles.wordpress.org/codepress/\">Codepress</a>, is a free plugin that is actively installed on more than 60K sites that enables administrators to add, remove, and rearrange columns.</p>\n<p>Each column type has its own options panel where you can control settings such as width, label, and in the case of the featured image, preview size.</p>\n<p><img class=\"alignnone size-full wp-image-57576\" src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/07/AddingAFeaturedImageColumn.png?resize=1020%2C679&ssl=1\" alt=\"AddingAFeaturedImageColumn\" /></p>\n<p>There are a number of <a href=\"https://www.admincolumns.com/documentation/columns/column-types/\">column types</a> available but if you need additional flexibility, there&#8217;s a <a href=\"https://www.admincolumns.com/documentation/columns/custom-field-column/\">Custom Field</a> column type. Admin Columns also has built-in support for the <a href=\"https://www.admincolumns.com/documentation/compatible-plugins/advanced-custom-fields/\">Advanced Custom Fields</a>, <a href=\"https://www.admincolumns.com/documentation/compatible-plugins/pods/\">Pods</a>, and <a href=\"https://www.admincolumns.com/documentation/compatible-plugins/types/\">Types</a> plugins.</p>\n<p>One of the things I found particularly useful as a new user is the Help tab. This tab in the upper right corner of the screen is often overlooked or not utilized by plugins. Admin Columns uses the tab to provide basic information about the plugin and how to navigate its user interface.</p>\n<p><img class=\"alignnone size-full wp-image-57598\" src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/07/AdminColumnsHelpTab.png?resize=860%2C295&ssl=1\" alt=\"AdminColumnsHelpTab\" /></p>\n<p>Although the free version likely takes care of most use cases, there is a <a href=\"https://www.admincolumns.com/upgrade-to-admin-columns-pro/?utm_source=plugin-installation&utm_medium=banner&utm_campaign=plugin-installation&utm_content=usp-editing\">commercial version</a> available that adds sorting, filtering, import/export, inline editing, and multiple column sets. If you maintain a number of sites that uses Admin Columns, the ability to import and export column configurations can be a huge time saver.</p>\n<p>I thoroughly tested <a href=\"https://profiles.wordpress.org/codepress/\">Admin Columns</a> on WordPress 4.6 beta 3 and didn&#8217;t encounter any issues. To see a demo of the plugin in action, check out the following video.</p>\n<div class=\"embed-wrap\"></div>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 18 Jul 2016 23:33:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"WP Mobile Apps: WordPress for iOS: Version 6.3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://apps.wordpress.com/?p=3471\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://apps.wordpress.com/2016/07/16/wordpress-for-ios-version-6-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2227:\"<p>Hi there, WordPress users! <a href=\"https://itunes.apple.com/us/app/wordpress/id335703880?mt=8&uo=6&at=&ct=\">Version 6.3 of the WordPress for iOS app</a> is now available in the App Store.</p>\n<h1>What&#8217;s New:</h1>\n<p><strong>Access your site’s media library</strong> — even if WordPress isn’t given permission to access your personal photo library.</p>\n\n<a href=\"https://apps.wordpress.com/img_2282/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/06/img_2282.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"IMG_2282\" /></a>\n\n<p><strong>An improved design</strong> makes updating your WordPress.com profile and account settings easier and faster than ever.</p>\n<p><strong>Several UI fixes.</strong> A bevy of fixes for WordPress for iPad, including search field, date picker, and layout improvements.</p>\n<p><strong>And much more! </strong>You can see the full list of changes <a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?utf8=✓&q=is%3Aissue%20is%3Aclosed%20milestone%3A6.3\">here</a>.</p>\n<h1>Thank You</h1>\n<p>Thanks to all of the contributors who worked on this release:<br />\n<a href=\"https://github.com/aerych\">@aerych</a>, <a href=\"https://github.com/astralbodies\">@astralbodies</a>, <a href=\"https://github.com/claudiosmweb\">@claudiosmweb</a>, <a href=\"https://github.com/diegoreymendez\">@diegoreymendez</a>, <a href=\"https://github.com/frosty\">@frosty</a>, <a href=\"https://github.com/jleandroperez\">@jleandroperez</a>, <a href=\"https://github.com/koke\">@koke</a>, <a href=\"https://github.com/kurzee\">@kurzee</a>, <a href=\"https://github.com/kwonye\">@kwonye</a>, <a href=\"https://github.com/oguzkocer\">@oguzkocer</a>, <a href=\"https://github.com/sendhil\">@sendhil</a>, <a href=\"https://github.com/SergioEstevao\">@SergioEstevao</a>.</p>\n<p>You can track the development progress for the next update by visiting <a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?utf8=✓&q=is%3Aissue+milestone%3A6.4+\" target=\"_blank\">our 6.4 milestone on GitHub</a>. Until next time!</p><img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=apps.wordpress.com&blog=108068616&post=3471&subd=apps&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 16 Jul 2016 21:12:54 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"diegoreymendez\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"WordPress.tv Blog: Staff Pick: Theming in WordPress – Where do I start?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.wordpress.tv/?p=524\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"http://blog.wordpress.tv/2016/07/16/staff-pick-theming-in-wordpress-where-do-i-start/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1125:\"<p>From the stage of <a href=\"http://wordpress.tv/event/wordcamp-europe-2016/\">WordCamp Europe 2016</a> here is Edmund Turbin&#8217;s great presentation on how to get started in creating WordPress themes.</p>\n<p></p>\n<p>Base theme, child theme, framework – These are a few of the options you can use for creating a WordPress Theme. Wether you are developing a theme for your personal blog, a clients website, or a theme to be used by other sites and the WordPress community, it is important to know the different approaches for getting started with theme development.</p>\n<p><a href=\"http://www.slideshare.net/eturbin/theming-wordpress-where-do-i-start\">Presentation Slides</a></p>\n<p><a href=\"http://wordpress.tv/\">Watch more great videos on WordPress.tv!</a></p><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptvblog.wordpress.com/524/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptvblog.wordpress.com/524/\" /></a> <img alt=\"\" border=\"0\" src=\"http://pixel.wp.com/b.gif?host=blog.wordpress.tv&blog=5310177&post=524&subd=wptvblog&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 16 Jul 2016 02:49:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Jerry Bates\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"Post Status: Medium and WordPress — Draft Podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=25489\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"https://poststatus.com/medium-wordpress-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2496:\"<p>Welcome to the Post Status <a href=\"https://poststatus.com/category/draft\">Draft podcast</a>, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>, <a href=\"https://play.google.com/music/m/Ih5egfxskgcec4qadr3f4zfpzzm?t=Post_Status__Draft_WordPress_Podcast\">Google Play</a>, <a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>, and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Post Status Draft is hosted by Joe Hoyle &#8212; the CTO of Human Made &#8212; and Brian Krogsgard.</p>\n<p>In this episode, Joe and Brian talk about Medium &amp; WordPress and whether Medium and similar platforms are a significant threat to WordPress. They also discuss the benefits and challenges of open source platforms versus proprietary ones, and WordPress’s potential as a lower level item in the site stack.</p>\n<p><a href=\"https://audio.simplecast.com/41890.mp3\">https://audio.simplecast.com/41890.mp3</a><br />\n<a href=\"http://audio.simplecast.com/41890.mp3\">Direct Download</a></p>\n<h3>Links</h3>\n<ul>\n<li><a href=\"https://wordpress.tv/2016/06/25/matt-mullenweg-interview-and-qa/\">Interview with Matt</a></li>\n<li><a href=\"http://wordpress.tv/2016/06/30/joe-hoyle-the-ultimate-rest-api-talk-part-1/\">Joe&#8217;s REST API talk</a></li>\n<li><a href=\"https://github.com/joehoyle/vienna\">Vienna WordPress app concept</a></li>\n<li><a href=\"https://ma.tt/2015/03/typewriter/\">Billionaire&#8217;s Typewriter</a></li>\n<li><a href=\"https://markarms.com/2016/06/23/what-to-consider-when-the-platforms-show-up-with-money/\">What to Consider When the Platforms Show up With Money</a></li>\n<li><a href=\"https://medium.com/\">Medium.com</a></li>\n<li><a href=\"https://developer.wordpress.com/calypso/\">WordPress.com Calypso</a></li>\n<li><a href=\"https://www.alleyinteractive.com/blog/how-medium-became-livejournal-for-publishers/\">Medium compared to LiveJournal</a></li>\n</ul>\n<h3>Sponsor</h3>\n<p>This episode is sponsored by <a href=\"https://pippinsplugins.com/\">Pippin&#8217;s Plugins.</a> If you want to sell downloads, setup content restriction, or start an affiliate program, Pippin’s Plugins have you covered. If you need all three, even better. Pippin’s Plugins is well known for making some of the best coded and most reliable plugins in the market. Check out <a href=\"https://pippinsplugins.com/\">PippinsPlugins.com </a>for more information.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 08 Jul 2016 23:28:43 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Katie Richards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";a:10:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Thu, 01 Sep 2016 11:02:46 GMT\";s:12:\"content-type\";s:8:\"text/xml\";s:14:\"content-length\";s:6:\"456574\";s:10:\"connection\";s:5:\"close\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:13:\"last-modified\";s:29:\"Thu, 01 Sep 2016 10:45:15 GMT\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";s:4:\"x-nc\";s:11:\"HIT lax 250\";s:13:\"accept-ranges\";s:5:\"bytes\";}s:5:\"build\";s:14:\"20130911090210\";}','no');
