insert  into `wp_posts`(`ID`,`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) values ('27','1','2016-06-01 11:54:56','2016-06-01 11:54:56','<strong>Mission: </strong>To make the search for a campsite an easier and more enjoyable process, and to give back (url link here) to environmental organizations that help protect the same outdoor areas we love.\r\n\r\nFind Your Campsite was founded with one simple idea in mind: to make the search for a campsite an easier and more informative process. We longed for one website where you could browse multiple reviews and high quality photos in the same place. Thus, we decided to create it, and with an environmental focus in mind. We give 5% of our proceeds back to non-profit environmental groups (url link here) that help protect the outdoor areas we love and enjoy.\r\n\r\nI hope you find this site helpful in researching your next camping trip. And please leave a review or post some photos from your last trip if you have the time! At Find Your Campsite, we love tips and suggestions (considering the whole website is founded on the user experience!). Please email us at <a href=\"mailto:info@findyourcampsite.com\">info@findyourcampsite.com</a> and expect a quick response.\r\n\r\nMany thanks for using our site and happy camping!','About Us','','publish','closed','closed','','about','','','2016-08-22 10:12:36','2016-08-22 10:12:36','','0','http://localhost/campsite/?page_id=27','0','page','','0');
